(19, 'Amirahfadh11lah_', 'Bagus. memudarkan bekas jerawat meratakan tekstur walau pake 1 pot aja, klo mau hasil lbh bagus pemakaian berikutnya ya. Tpi gk ada efek mencerahkannya di aku. Yg kecil 20 harian aja udh habis, jdi menurutku buat kalian yg baru nyoba2 boleh beli yg kecil, selanjutnya beli langsung yg gede?. Klo dibandingin TO aku blm tau sih krn blm prnh coba, tpi biasanya liat beauty influencer kak novie maru dulu yg kulitnya pribumi bgt? mirip2 aku.', 'bagus. memudarkan bekas jerawat meratakan tekstur walau pake 1 pot aja, klo mau hasil lbh bagus pemakaian berikutnya ya. tpi gk ada efek mencerahkannya di aku. yg kecil 20 harian aja udh habis, jdi menurutku buat kalian yg baru nyoba2 boleh beli yg kecil, selanjutnya beli langsung yg gede?. klo dibandingin to aku blm tau sih krn blm prnh coba, tpi biasanya liat beauty influencer kak novie maru dulu yg kulitnya pribumi bgt? mirip2 aku.', 'bagus memudarkan bekas jerawat meratakan tekstur walau pake pot aja klo mau hasil lbh bagus pemakaian berikutnya ya tpi gk ada efek mencerahkannya di aku yg kecil harian aja udh habis jdi menurutku buat kalian yg baru nyoba boleh beli yg kecil selanjutnya beli langsung yg gede klo dibandingin to aku blm tau sih krn blm prnh coba tpi biasanya liat beauty influencer kak novie maru dulu yg kulitnya pribumi bgt mirip aku', '[\"bagus\", \"memudarkan\", \"bekas\", \"jerawat\", \"meratakan\", \"tekstur\", \"walau\", \"pakai\", \"pot\", \"aja\", \"klo\", \"mau\", \"hasil\", \"lbh\", \"bagus\", \"pemakaian\", \"berikutnya\", \"tpi\", \"ada\", \"efek\", \"mencerahkannya\", \"aku\", \"kecil\", \"harian\", \"aja\", \"sudah\", \"habis\", \"jdi\", \"menurutku\", \"buat\", \"kalian\", \"baru\", \"nyoba\", \"boleh\", \"beli\", \"kecil\", \"selanjutnya\", \"beli\", \"langsung\", \"gede\", \"klo\", \"dibandingin\", \"aku\", \"blm\", \"tau\", \"sih\", \"krn\", \"blm\", \"prnh\", \"coba\", \"tpi\", \"biasanya\", \"lihat\", \"beauty\", \"influencer\", \"kak\", \"novie\", \"maru\", \"dulu\", \"k