(20, 'ekanisyt', 'packagingnya botol airless pump yang menurutku kesannya mewah. teksturnya gel emulsion warna kuning keruh. ada banyak brightening ingredients di dalamnya, kayak niacinamide, glycolic acid, alpha arbutin, dipotassium glycyrrhizate, tranexamic acid, nicotinoyl dipeptide-22, dan tranexamoyl dipeptide-22. ini ada fragrance di urutan tengah, tapi sayangnya belum mampu nutupin aroma asli yang kurang sedap (yang mungkin dari bahan baku DNA). aku pake ini setelah hydrating essence dan sebelum moisturizer, di malam hari aja. bisa dipake pagi tapi harus reapply sunscreen karena ada glycolic acid yang bisa memicu fotosensitif (tapi gatau berapa persen). rasanya lembab dan sedikit lengket setelah digunakan, tapi tidak terlalu mengganggu... lebih menganggu aromanya sih. setelah pemakaian sekitar 7 hari, aku ngerasa produk ini ngasih perubahan yang signifikan di kulit. keliatan lebih cerah secara keseluruhan dan bantu menyamarkan PIE banget. ga ada efek negatif kayak bikin berjerawat, cekit-cekit, kemerahan, dsb. aku sempet menghentikan penggunaan selama beberapa hari, tidak ada efek negatif yang muncul, mungkin pertanda ini ga bikin ketergantungan. ini produk MSGlow pertama yang aku gunakan dan satu-satunya, tentu bisa aku pakai bersama produk brand lain tanpa efek negatif. kesimpulannya, produk ini memberikan hasil yang sesuai ekspektasi, namun sedikit perlu diimprove dari segi kenyamanan penggunaan (khususnya aroma).', 'packagingnya botol airless pump yang menurutku kesannya mewah. teksturnya gel emulsion warna kuning keruh. ada banyak brightening ingredients di dalamnya, kayak niacinamide, glycolic acid, alpha arbutin, dipotassium glycyrrhizate, tranexamic acid, nicotinoyl dipeptide-22, dan tranexamoyl dipeptide-22. ini ada fragrance di urutan tengah, tapi sayangnya belum mampu nutupin aroma asli yang kurang sedap (yang mungkin dari bahan baku dna). aku pake ini setelah hydrating essence dan sebelum moisturizer, di malam hari aja. bisa dipake pagi tapi harus reapply sunscreen karena ada glycolic acid yang bisa memicu fotosensitif (tapi gatau berapa persen). rasanya lembab dan sedikit lengket setelah digunakan, tapi tidak terlalu mengganggu... lebih menganggu aromanya sih. setelah pemakaian sekitar 7 hari, aku ngerasa produk ini ngasih perubahan yang signifikan di kulit. keliatan lebih cerah secara keseluruhan dan bantu menyamarkan pie banget. ga ada efek negatif kayak bikin berjerawat, cekit-cekit, kemerahan, dsb. aku sempet menghentikan penggunaan selama beberapa hari, tidak ada efek negatif yang muncul, mungkin pertanda ini ga bikin ketergantungan. ini produk msglow pertama yang aku gunakan dan satu-satunya, tentu bisa aku pakai bersama produk brand lain tanpa efek negatif. kesimpulannya, produk ini memberikan hasil yang sesuai ekspektasi, namun sedikit perlu diimprove dari segi kenyamanan penggunaan (khususnya aroma).', 'packagingnya botol airless pump yang menurutku kesannya mewah teksturnya gel emulsion warna kuning keruh ada banyak brightening ingredients di dalamnya kayak niacinamide glycolic acid alpha arbutin dipotassium glycyrrhizate tranexamic acid nicotinoyl dipeptide dan tranexamoyl dipeptide ini ada fragrance di urutan tengah tapi sayangnya belum mampu nutupin aroma asli yang kurang sedap', '[\"packagingnya\", \"botol\", \"airless\", \"pump\", \"yang\", \"menurutku\", \"kesannya\", \"mewah\", \"teksturnya\", \"gel\", \"emulsion\", \"warna\", \"kuning\", \"keruh\", \"ada\", \"banyak\", \"brightening\", \"ingredients\", \"dalamnya\", \"kayak\", \"niacinamide\", \"glycolic\", \"acid\", \"alpha\", \"arbutin\", \"dipotassium\", \"glycyrrhizate\", \"tranexamic\", \"acid\", \"nicotinoyl\", \"dipeptide\", \"dan\", \"tranexamoyl\", \"dipeptide\", \"ini\", \"ada\", \"fragrance\", \"urutan\", \"tengah\", \"tapi\", \"sayangnya\", \"belum\", \"mampu\", \"nutupin\", \"aroma\", \"asli\", \"yang\", \"kurang\", \"sedap\"]', 'packagingnya botol airless pump yang menurutku kesannya mewah teksturnya gel emulsion warna kuning keruh ada banyak brightening ingredients dalamnya kayak niacinamide glycolic acid alpha arbutin dipotassium glycyrrhizate tranexamic acid nicotinoyl dipeptide dan tranexamoyl dipeptide ini ada fragrance urutan tengah tapi sayangnya belum mampu nutupin aroma asli yang kurang sedap', '\"packagingnya botol airless pump menurutku kesannya mewah teksturnya gel emulsion warna kuning keruh brightening ingredients dalamnya kayak niacinamide glycolic acid alpha arbutin dipotassium glycyrrhizate tranexamic acid nicotinoyl dipeptide tranexamoyl dipeptide fragrance urutan sayangnya nutupin aroma asli sedap\"', 'packagingnya botol airless pump turut kesan mewah tekstur gel emulsion warna kuning keruh brightening ingredients dalam kayak niacinamide glycolic acid alpha arbutin dipotassium glycyrrhizate tranexamic acid nicotinoyl dipeptide tranexamoyl dipeptide fragrance urut sayang nutupin aroma asli sedap', 'Negatif', '2024-11-29 06:38:00', '2024-11-29 06:38:00', NULL),
(21, 'Niaalstari', 'Aku pake rangkaian acne biasanya pas lg datang bulan aja karena muka ku bukan yg jerawatan, tp tiap sblm haid selalu timbul jerawat 3biji jd aku selalu pake rangkaian acne series ini. Dan emang bagus jerawat jd kempes dan kering. Cocok banget ini pro acne', 'aku pake rangkaian acne biasanya pas lg datang bulan aja karena muka ku bukan yg jerawatan, tp tiap sblm haid selalu timbul jerawat 3biji jd aku selalu pake rangkaian acne series ini. dan emang bagus jerawat jd kempes dan kering. cocok banget ini pro acne', 'aku pake rangkaian acne biasanya pas lg datang bulan aja karena muka ku bukan yg jerawatan tp tiap sblm haid selalu timbul jerawat biji jd aku selalu pake rangkaian acne series ini dan emang bagus jerawat jd kempes dan kering cocok banget ini pro acne', '[\"aku\", \"pakai\", \"rangkaian\", \"acne\", \"biasanya\", \"pas\", \"datang\", \"bulan\", \"aja\", \"karena\", \"muka\", \"bukan\", \"jerawatan\", \"tiap\", \"sblm\", \"haid\", \"selalu\", \"timbul\", \"jerawat\", \"biji\", \"aku\", \"selalu\", \"pakai\", \"rangkaian\", \"acne\", \"series\", \"ini\", \"dan\", \"emang\", \"bagus\", \"jerawat\", \"kempes\", \"dan\", \"kering\", \"cocok\", \"banget\", \"ini\", \"pro\", \"acne\"]', 'aku pakai rangkaian acne biasanya pas datang bulan aja karena muka bukan jerawatan tiap sblm haid selalu timbul jerawat biji aku selalu pakai rangkaian acne series ini dan emang bagus jerawat kempes dan kering cocok banget ini pro acne', '\"pakai rangkaian acne pas aja muka jerawatan sblm haid timbul jerawat biji pakai rangkaian acne series emang bagus jerawat kempes kering cocok banget pro acne\"', 'pakai rangkai acne pas aja muka jerawat sblm haid timbul jerawat biji pakai rangkai acne series emang bagus jerawat kempes kering cocok banget pro acne', 'Negatif', '2024-11-29 06:38:00', '2024-11-29 06:38:00', NULL),
(22, 'Relisa_Rosana', 'salah satu local product yg banyak di minati dan memang cocok bgt untuk kulit normal dan yang ingin mencerahkan kulit. Di pakai tiap malam dan pagi harinya kulit lgsg lembab dan shining sih. But, ak kurang suka dengan aromanya. mgkn next Scarlett bisa ganti aromanya yg lebih calm yaa', 'salah satu local product yg banyak di minati dan memang cocok bgt untuk kulit normal dan yang ingin mencerahkan kulit. di pakai tiap malam dan pagi harinya kulit lgsg lembab dan shining sih. but, ak kurang suka dengan aromanya. mgkn next scarlett bisa ganti aromanya yg lebih calm yaa', 'salah satu local product yg banyak di minati dan memang cocok bgt untuk kulit normal dan yang ingin mencerahkan kulit di pakai tiap malam dan pagi harinya kulit lgsg lembab dan shining sih but ak kurang suka dengan aromanya mgkn next scarlett bisa ganti aromanya yg lebih calm yaa', '[\"salah\", \"satu\", \"local\", \"product\", \"banyak\", \"minati\", \"dan\", \"memang\", \"cocok\", \"bgt\", \"untuk\", \"kulit\", \"normal\", \"dan\", \"yang\", \"ingin\", \"mencerahkan\", \"kulit\", \"pakai\", \"tiap\", \"malam\", \"dan\", \"pagi\", \"harinya\", \"kulit\", \"lgsg\", \"lembab\", \"dan\", \"shining\", \"sih\", \"but\", \"kurang\", \"suka\", \"dengan\", \"aromanya\", \"mgkn\", \"next\", \"scarlett\", \"bisa\", \"ganti\", \"aromanya\", \"lebih\", \"calm\", \"yaa\"]', 'salah satu local product banyak minati dan memang cocok bgt untuk kulit normal dan yang ingin mencerahkan kulit pakai tiap malam dan pagi harinya kulit lgsg lembab dan shining sih but kurang suka dengan aromanya mgkn next scarlett bisa ganti aromanya lebih calm yaa', '\"salah local product minati cocok bgt kulit normal mencerahkan kulit pakai malam pagi harinya kulit lgsg lembab shining sih but suka aromanya mgkn next scarlett ganti aromanya calm yaa\"', 'salah local product minat cocok bgt kulit normal cerah kulit pakai malam pagi hari kulit lgsg lembab shining sih but suka aroma mgkn next scarlett ganti aroma calm yaa