(23, 'ciwi', 'Scarlett ini adalah krim basic skincare ku yg ke dua setelah whitelab. Di minggu pertama aja udah langsung jerawatan, jerawat yg kalau di pegang tuh sakit padahal dari dulu aku kalau jerawatan tuh paling satu atau dua dan itu pun biasanya hormon mau mens? yaudah tetap positif thinking yakaann, mungkin detox jadi pertahankan sampe udah stengah kok rasanya jerawat kayaknya seminggu sekali muncul terus mana bekasnya susah ilang?. Terus tetap positif thinking mungkin belum habis 1 jar aku fikir yaudah tetep ku pake, alhasil udah abis niiih muka emang agak“cerah” tapi jerawat masih membekas dan masih ada dikit2. Yaudah tetep aku beli untuk jar selanjutnya, jadinya udah 2x beli yakaannn. Ternyataaa masih dengan kejadian yg sama, muka masih nimbul2 jerawat padahal nggak mens padahal rajin cuci muka padahal pola makan juga di jaga tapi ya karna aku terlalu berekspektasi lebih sama si scarlett basic skincare ini ??? maaf scarlett aku beralih ?', 'scarlett ini adalah krim basic skincare ku yg ke dua setelah whitelab. di minggu pertama aja udah langsung jerawatan, jerawat yg kalau di pegang tuh sakit padahal dari dulu aku kalau jerawatan tuh paling satu atau dua dan itu pun biasanya hormon mau mens? yaudah tetap positif thinking yakaann, mungkin detox jadi pertahankan sampe udah stengah kok rasanya jerawat kayaknya seminggu sekali muncul terus mana bekasnya susah ilang?. terus tetap positif thinking mungkin belum habis 1 jar aku fikir yaudah tetep ku pake, alhasil udah abis niiih muka emang agak“cerah” tapi jerawat masih membekas dan masih ada dikit2. yaudah tetep aku beli untuk jar selanjutnya, jadinya udah 2x beli yakaannn. ternyataaa masih dengan kejadian yg sama, muka masih nimbul2 jerawat padahal nggak mens padahal rajin cuci muka padahal pola makan juga di jaga tapi ya karna aku terlalu berekspektasi lebih sama si scarlett basic skincare ini ??? maaf scarlett aku beralih ?', 'scarlett ini adalah krim basic skincare ku yg ke dua setelah whitelab di minggu pertama aja udah langsung jerawatan jerawat yg kalau di pegang tuh sakit padahal dari dulu aku kalau jerawatan tuh paling satu atau dua dan itu pun biasanya hormon mau mens yaudah tetap positif thinking yakaann mungkin detox jadi pertahankan sampe udah stengah kok rasanya jerawat kayaknya seminggu sekali muncul terus mana bekasnya susah ilang terus tetap positif thinking mungkin belum habis jar aku fikir yaudah tetep ku pake alhasil udah abis niiih muka emang agakcerah tapi jerawat masih membekas dan masih ada dikit yaudah tetep aku beli untuk jar selanjutnya jadinya udah x beli yakaannn ternyataaa masih dengan kejadian yg sama muka masih nimbul jerawat padahal nggak mens padahal rajin cuci muka padahal pola makan juga di jaga tapi ya karna aku terlalu berekspektasi lebih sama si scarlett basic skincare ini maaf scarlett aku beralih', '[\"scarlett\", \"ini\", \"adalah\", \"krim\", \"basic\", \"skincare\", \"dua\", \"setelah\", \"whitelab\", \"minggu\", \"pertama\", \"aja\", \"udah\", \"langsung\", \"jerawatan\", \"jerawat\", \"kalau\", \"pegang\", \"tuh\", \"sakit\", \"padahal\", \"dari\", \"dulu\", \"aku\", \"kalau\", \"jerawatan\", \"tuh\", \"paling\", \"satu\", \"atau\", \"dua\", \"dan\", \"itu\", \"pun\", \"biasanya\", \"hormon\", \"mau\", \"mens\", \"yaudah\", \"tetap\", \"positif\", \"thinking\", \"yakaann\", \"mungkin\", \"detox\", \"jadi\", \"pertahankan\", \"sampe\", \"udah\", \"stengah\", \"kok\", \"rasanya\", \"jerawat\", \"kayaknya\", \"seminggu\", \"sekali\", \"muncul\", \"terus\", \"mana\", \"bekasnya\", \"susah\", \"ilang\", \"terus\", \"tetap\", \"positif\", \"thinking\", \"mungkin\", \"belum\", \"habis\", \"jar\", \"aku\", \"fikir\", \"yaudah\", \"tetep\", \"pakai\", \"alhasil\", \"udah\", \"abis\", \"niiih\", \"muka\", \"emang\", \"agakcerah\", \"tapi\", \"jerawat\", \"masih\", \"membekas\", \"dan\", \"masih\", \"ada\", \"dikit\", \"yaudah\", \"tetep\", \"aku\", \"beli\", \"untuk\", \"jar\", \"selanjutnya\", \"jadinya\", \"udah\", \"beli\", \"yakaannn\", \"ternyata\", \"masih\", \"dengan\", \"kejadian\", \"sama\", \"muka\", \"masih\", \"nimbul\", \"jerawat\", \"padahal\", \"nggak\", \"mens\", \"padahal\", \"rajin\", \"cuci\", \"muka\", \"padahal\", \"pola\", \"makan\", \"juga\", \"jaga\", \"tapi\", \"karna\", \"aku\", \"terlalu\", \"berekspektasi\", \"lebih\", \"sama\", \"scarlett\", \"basic\", \"skincare\", \"ini\", \"maaf\", \"scarlett\", \"aku\", \"beralih\"]', 'scarlett ini adalah krim basic skincare dua setelah whitelab minggu pertama aja udah langsung jerawatan jerawat kalau pegang tuh sakit padahal dari dulu aku kalau jerawatan tuh paling satu atau dua dan itu pun biasanya hormon mau mens yaudah tetap positif thinking yakaann mungkin detox jadi pertahankan sampe udah stengah kok rasanya jerawat kayaknya seminggu sekali muncul terus mana bekasnya susah ilang terus tetap positif thinking mungkin belum habis jar aku fikir yaudah tetep pakai alhasil udah abis niiih muka emang agakcerah tapi jerawat masih membekas dan masih ada dikit yaudah tetep aku beli untuk jar selanjutnya jadinya udah beli yakaannn ternyata masih dengan kejadian sama muka masih nimbul jerawat padahal nggak mens padahal rajin cuci muka padahal pola makan juga jaga tapi karna aku terlalu berekspektasi lebih sama scarlett basic skincare ini maaf scarlett aku beralih', '\"scarlett krim basic skincare whitelab minggu aja udah langsung jerawatan jerawat pegang tuh sakit jerawatan tuh hormon mens yaudah positif thinking yakaann detox pertahankan sampe udah stengah jerawat kayaknya seminggu muncul bekasnya susah ilang positif thinking habis jar fikir yaudah tetep pakai alhasil udah abis niiih muka emang agakcerah jerawat membekas dikit yaudah tetep beli jar udah beli yakaannn kejadian muka nimbul jerawat nggak mens rajin cuci muka pola makan jaga karna berekspektasi scarlett basic skincare maaf scarlett beralih\"', 'scarlett krim basic skincare whitelab minggu aja udah langsung jerawat jerawat pegang tuh sakit jerawat tuh hormon mens yaudah positif thinking yakaann detox tahan sampe udah stengah jerawat kayak minggu muncul bekas susah ilang positif thinking habis jar fikir yaudah tetep pakai alhasil udah abis niiih muka emang agakcerah jerawat bekas dikit yaudah tetep beli jar udah beli yakaannn jadi muka nimbul jerawat nggak mens rajin cuci muka pola makan jaga karna berekspektasi scarlett basic skincare maaf scarlett alih', 'Negatif', '2024-11-29 06:38:04', '2024-11-29 06:38:04', NULL),
