(45, 'sharonaprilia', 'Melihat banyaknya orang yg suka sama serum ini buat aku pingin nyobain. Feeling dari awal agak ragu bakalan cocok, tp karena prinsip hidupku adalah yolo yaudah deh belii. Dan bener, ternyata aku ngga suka? serum ini susah banget nyerap di kulitku, lengket, bikin kusem, dan bruntusan. Dari serum inilah aku tau ternyata kulitku emg ngga cocok dengan niacinamide.', 'melihat banyaknya orang yg suka sama serum ini buat aku pingin nyobain. feeling dari awal agak ragu bakalan cocok, tp karena prinsip hidupku adalah yolo yaudah deh belii. dan bener, ternyata aku ngga suka? serum ini susah banget nyerap di kulitku, lengket, bikin kusem, dan bruntusan. dari serum inilah aku tau ternyata kulitku emg ngga cocok dengan niacinamide.', 'melihat banyaknya orang yg suka sama serum ini buat aku pingin nyobain feeling dari awal agak ragu bakalan cocok tp karena prinsip hidupku adalah yolo yaudah deh belii dan bener ternyata aku ngga suka serum ini susah banget nyerap di kulitku lengket bikin kusem dan bruntusan dari serum inilah aku tau ternyata kulitku emg ngga cocok dengan niacinamide', '[\"melihat\", \"banyaknya\", \"orang\", \"suka\", \"sama\", \"serum\", \"ini\", \"buat\", \"aku\", \"pingin\", \"nyobain\", \"feeling\", \"dari\", \"awal\", \"agak\", \"ragu\", \"bakalan\", \"cocok\", \"karena\", \"prinsip\", \"hidupku\", \"adalah\", \"yolo\", \"yaudah\", \"deh\", \"belii\", \"dan\", \"bener\", \"ternyata\", \"aku\", \"ngga\", \"suka\", \"serum\", \"ini\", \"susah\", \"banget\", \"nyerap\", \"kulitku\", \"lengket\", \"bikin\", \"kusem\", \"dan\", \"bruntusan\", \"dari\", \"serum\", \"inilah\", \"aku\", \"tau\", \"ternyata\", \"kulitku\", \"emg\", \"ngga\", \"cocok\", \"dengan\", \"niacinamide\"]', 'melihat banyaknya orang suka sama serum ini buat aku pingin nyobain feeling dari awal agak ragu bakalan cocok karena prinsip hidupku adalah yolo yaudah deh belii dan bener ternyata aku ngga suka serum ini susah banget nyerap kulitku lengket bikin kusem dan bruntusan