(46, 'yyeondrey', 'aku punya bbrp bekas jerawat di mukaku, dan aku mutusin buat pake MS Glow WhiteCellDNA Serum karna ada yang nyaranin. Sebenernya ga berekspektasi tinggi sih karna udh lumayan hopeless pake produk lain ga ngefek. Tapi.. ternyata lumayan keliatan perbedannya setelah pakai produk ini ±3 mingguan, bekas jerawatku jadi samar². Not bad ga sih? wkwk, thanks deh buat temenku yang udah nyaranin', 'aku punya bbrp bekas jerawat di mukaku, dan aku mutusin buat pake ms glow whitecelldna serum karna ada yang nyaranin. sebenernya ga berekspektasi tinggi sih karna udh lumayan hopeless pake produk lain ga ngefek. tapi.. ternyata lumayan keliatan perbedannya setelah pakai produk ini ±3 mingguan, bekas jerawatku jadi samar². not bad ga sih? wkwk, thanks deh buat temenku yang udah nyaranin', 'aku punya bbrp bekas jerawat di mukaku dan aku mutusin buat pake ms glow whitecelldna serum karna ada yang nyaranin sebenernya ga berekspektasi tinggi sih karna udh lumayan hopeless pake produk lain ga ngefek tapi ternyata lumayan keliatan perbedannya setelah pakai produk ini mingguan bekas jerawatku jadi samar not bad ga sih wkwk thanks deh buat temenku yang udah nyaranin', '[\"aku\", \"punya\", \"bbrp\", \"bekas\", \"jerawat\", \"mukaku\", \"dan\", \"aku\", \"mutusin\", \"buat\", \"pakai\", \"glow\", \"whitecelldna\", \"serum\", \"karna\", \"ada\", \"yang\", \"nyaranin\", \"sebenernya\", \"berekspektasi\", \"tinggi\", \"sih\", \"karna\", \"sudah\", \"lumayan\", \"hopeless\", \"pakai\", \"produk\", \"lain\", \"ngefek\", \"tapi\", \"ternyata\", \"lumayan\", \"keliatan\", \"perbedannya\", \"setelah\", \"pakai\", \"produk\", \"ini\", \"mingguan\", \"bekas\", \"jerawatku\", \"jadi\", \"samar\", \"not\", \"bad\", \"sih\", \"wkwk\", \"thanks\", \"deh\", \"buat\", \"temenku\", \"yang\", \"udah\", \"nyaranin\"]', 'aku punya bbrp bekas jerawat mukaku dan aku mutusin buat pakai glow whitecelldna serum karna ada yang nyaranin sebenernya berekspektasi tinggi sih karna sudah lumayan hopeles