(47, 'fitri08', 'Agak love hate sama cream ini. Tadinya enak sih dibarengin ama serumnya, tapi kadang aku curiga ini malah bikin jerawatku timbul, kecil-kecil gitu. Kalo pake cream ini doang, ga pake sama serumnya juga kayak ga ada efek signifikan buat jerawat. Udah repurchase beberapa kali juga, tapi jujur setelah ini belum tahu mau lanjut atau gak. Kayaknya pake serumnya aja udah cukup nampol sih.', 'agak love hate sama cream ini. tadinya enak sih dibarengin ama serumnya, tapi kadang aku curiga ini malah bikin jerawatku timbul, kecil-kecil gitu. kalo pake cream ini doang, ga pake sama serumnya juga kayak ga ada efek signifikan buat jerawat. udah repurchase beberapa kali juga, tapi jujur setelah ini belum tahu mau lanjut atau gak. kayaknya pake serumnya aja udah cukup nampol sih.', 'agak love hate sama cream ini tadinya enak sih dibarengin ama serumnya tapi kadang aku curiga ini malah bikin jerawatku timbul kecilkecil gitu kalo pake cream ini doang ga pake sama serumnya juga kayak ga ada efek signifikan buat jerawat udah repurchase beberapa kali juga tapi jujur setelah ini belum tahu mau lanjut atau gak kayaknya pake serumnya aja udah cukup nampol sih', '[\"agak\", \"love\", \"hate\", \"sama\", \"cream\", \"ini\", \"tadinya\", \"enak\", \"sih\", \"dibarengin\", \"ama\", \"serumnya\", \"tapi\", \"kadang\", \"aku\", \"curiga\", \"ini\", \"malah\", \"bikin\", \"jerawatku\", \"timbul\", \"kecilkecil\", \"gitu\", \"kalo\", \"pakai\", \"cream\", \"ini\", \"doang\", \"pakai\", \"sama\", \"serumnya\", \"juga\", \"kayak\", \"ada\", \"efek\", \"signifikan\", \"buat\", \"jerawat\", \"udah\", \"repurchase\", \"beberapa\", \"kali\", \"juga\", \"tapi\", \"jujur\", \"setelah\", \"ini\", \"belum\", \"tahu\", \"mau\", \"lanjut\", \"atau\", \"gak\", \"kayaknya\", \"pakai\", \"serumnya\", \"aja\", \"udah\", \"cukup\", \"nampol\", \"sih\"]', 'agak love hate sama cream ini tadinya enak sih dibarengin ama serumnya tapi kadang aku curiga ini malah bikin jerawatku timbul kecilkecil gitu k