ah packaging ini sunscreen cute abiezzz tapi formulanya yang kurang work kulit', '\"akusi ngerasa sunscreen oily skin tuh berasa berat lengket teksturnya cair menurutku gak oily friendly cocok dry skin penggunaan bikin panas perih kulit sensitif kulitku packaging sunscreen cute abiezzz formulanya work kulit\"', 'akusi ngerasa sunscreen oily skin tuh asa berat lengket tekstur cair turut gak oily friendly cocok dry skin guna bikin panas perih kulit sensitif kulit packaging sunscreen cute abiezzz formula work kulit', 'Negatif', '2024-11-29 06:38:47', '2024-11-29 06:38:47', NULL),
