(86, 'mizanaway', 'ini serum TDA Ascorbate termurah. turunan tidak activenya vitamin c murni/L-Ascorbic acid yang sangat tidak mengiritasi dan diklaim 20x lipat lebih cepat mencerahkan. buat saya yang ngetes serum ini pas musim hujan trus lagi lembab-lembabnya udara, ini bikin jerawat. baunya jamu, saya pribadi suka. teksturnya ini cair tp pas diaplikasikan bener-bener ini serumnya thick&lengket trus agak sedikit bikin kusem di daerah T, kurang nyaman jg ditimpa sunscreen. Kemungkinan besar over-hidrating karena bikin jerawat dibeberapa bagian. Ga akan repurchase sih, after use nya ga enak sensasinya. Untuk efektivitas serum ini belom berasa karena cuma pakai 2 minggu aja. Masih mencari vitamin C yang cocok karena belum nemu yang cocok.', 'ini serum tda ascorbate termurah. turunan tidak activenya vitamin c murni/l-ascorbic acid yang sangat tidak mengiritasi dan diklaim 20x lipat lebih cepat mencerahkan. buat saya yang ngetes serum ini pas musim hujan trus lagi lembab-lembabnya udara, ini bikin jerawat. baunya jamu, saya pribadi suka. teksturnya ini cair tp pas diaplikasikan bener-bener ini serumnya thick&lengket trus agak sedikit bikin kusem di daerah t, kurang nyaman jg ditimpa sunscreen. kemungkinan besar over-hidrating karena bikin jerawat dibeberapa bagian. ga akan repurchase sih, after use nya ga enak sensasinya. untuk efektivitas serum ini belom berasa karena cuma pakai 2 minggu aja. masih mencari vitamin c yang cocok karena belum nemu yang cocok.', 'ini serum tda ascorbate termurah turunan tidak activenya vitamin c murnilascorbic acid yang sangat tidak mengiritasi dan diklaim x lipat lebih cepat mencerahkan buat saya yang ngetes serum ini pas musim hujan trus lagi lembablembabnya udara ini bikin jerawat baunya jamu saya pribadi suka teksturnya ini cair tp pas diaplikasikan benerbener ini serumnya thicklengket trus agak sedikit bikin kusem di daerah t kurang nyaman jg ditimpa sunscreen kemungkinan besar overhidrating karena bikin jerawat dibeberapa bagian ga a