h', '\"semenjak lepas cream dokter muka lgsg jerawatan parah breakout coba pakai product scarlett alhamdulillah cocok jerawat ilang bruntusan bekas jerawat jerawat kemerahan udah better cream gak muka cerah bikin lembab ajaa pas pagi gak bikin muka cerah\"', 'semenjak lepas cream dokter muka lgsg jerawat parah breakout coba pakai product scarlett alhamdulillah cocok jerawat ilang bruntusan bekas jerawat jerawat merah udah better cream gak muka cerah bikin lembab ajaa pas pagi gak bikin muka cerah', 'Negatif', '2024-11-29 06:39:40', '2024-11-29 06:39:40', NULL),
