(109, 'Fasihrdn', 'Karena lagi hamil jadi pake serum yang aman aja kayak niacinamide. Tekstur dia thick, agak lengket, tapi tetep sesuai harga. Jadi kalau punya budget lebih mending yang lain, kalau segini aja ya bisa banget dicoba. Masalahnya kayaknya saya emang nggak cocok sama niacinamide jadi breakout parah. Hanis off skincare 5bulan-an, muka nggak masalah sama sekali cuma kelihatan dull aja. Malah pake nicainamide-nya somethinc jadi breakout parah.', 'karena lagi hamil jadi pake serum yang aman aja kayak niacinamide. tekstur dia thick, agak lengket, tapi tetep sesuai harga. jadi kalau punya budget lebih mending yang lain, kalau segini aja ya bisa banget dicoba. masalahnya kayaknya saya emang nggak cocok sama niacinamide jadi breakout parah. hanis off skincare 5bulan-an, muka nggak masalah sama sekali cuma kelihatan dull aja. malah pake nicainamide-nya somethinc jadi breakout parah.', 'karena lagi hamil jadi pake serum yang aman aja kayak niacinamide tekstur dia thick agak lengket tapi tetep sesuai harga jadi kalau punya budget lebih mending yang lain kalau segini aja ya bisa banget dicoba masalahnya kayaknya saya emang nggak cocok sama niacinamide jadi breakout parah hanis off skincare bulanan muka nggak masalah sama sekali cuma kelihatan dull aja malah pake nicainamidenya somethinc jadi breakout parah', '[\"karena\", \"lagi\", \"hamil\", \"jadi\", \"pakai\", \"serum\", \"yang\", \"aman\", \"aja\", \"kayak\", \"niacinamide\", \"tekstur\", \"dia\", \"thick\", \"agak\", \"lengket\", \"tapi\", \"tetep\", \"sesuai\", \"harga\", \"jadi\", \"kalau\", \"punya\", \"budget\", \"lebih\", \"mending\", \"yang\", \"lain\", \"kalau\", \"segini\", \"aja\", \"bisa\", \"banget\", \"dicoba\", \"masalahnya\", \"kayaknya\", \"saya\", \"emang\", \"nggak\", \"cocok\", \"sama\", \"niacinamide\", \"jadi\", \"breakout\", \"parah\", \"hanis\", \"off\", \"skincare\", \"bulanan\", \"muka\", \"nggak\", \"masalah\", \"sama\", \"sekali\", \"cuma\", \"kelihatan\", \"dull\", \"aja\", \"malah\"