(111, 'diini_sa', 'Karena banyak yang bandingin sama the ordinary, sebelum cobain serum ini patokanku ya ke the ordinary. Texture wise dia lebih enak si emang, ngga peeling, nyaman, ngga lengket, dan kerasa sedikit lembab. Baunya ngga ada, jadi ok buat yang ngga suka wangi wangian di skincare. Tapi untuk hasilnya, di aku ngga begitu ngefek. Mencerahkannya jauh dibanding the ordinary, aku udah pake sampe abis bekas jerawatku masih gitu gitu aja, overall skin tonenya juga gitu gitu aja, discolorationnya ngga improve. Minyak di wajah juga sama sama aja si, ngga lebih terkontrol ato gimana.', 'karena banyak yang bandingin sama the ordinary, sebelum cobain serum ini patokanku ya ke the ordinary. texture wise dia lebih enak si emang, ngga peeling, nyaman, ngga lengket, dan kerasa sedikit lembab. baunya ngga ada, jadi ok buat yang ngga suka wangi wangian di skincare. tapi untuk hasilnya, di aku ngga begitu ngefek. mencerahkannya jauh dibanding the ordinary, aku udah pake sampe abis bekas jerawatku masih gitu gitu aja, overall skin tonenya juga gitu gitu aja, discolorationnya ngga improve. minyak di wajah juga sama sama aja si, ngga lebih terkontrol ato gimana.', 'karena banyak yang bandingin sama the ordinary sebelum cobain serum ini patokanku ya ke the ordinary texture wise dia lebih enak si emang ngga peeling nyaman ngga lengket dan kerasa sedikit lembab baunya ngga ada jadi ok buat yang ngga suka wangi wangian di skincare tapi untuk hasilnya di aku ngga begitu ngefek mencerahkannya jauh dibanding the ordinary aku udah pake sampe abis bekas jerawatku masih gitu gitu aja overall skin tonenya juga gitu gitu aja discolorationnya ngga improve minyak di wajah juga sama sama aja si ngga lebih terkontrol ato gimana', '[\"karena\", \"banyak\", \"yang\", \"bandingin\", \"sama\", \"the\", \"ordinary\", \"sebelum\", \"cobain\", \"serum\", \"ini\", \"patokanku\", \"the\", \"ordinary\", \"texture\", \"wise\", \"dia\", \"lebih\", \"enak\", \"emang\", \"ngga\", \"peeling\", \"nyaman\",