(126, 'keysiaachristina', 'night cream nya juga sama dari tekstur cream nya yang sangat gampang untuk dibaur dimuka, melembabkan, dan emang yang aku rasa pake full varian skincare acne dari scarlett ini ya bekas2 jerawat memudar, kalo ada jerawat cepet kempes. yang awalnya ragu banget mau pake cream ini, tapi ternyata cocok banget dan ada hasilnya dimuka aku luvv', 'night cream nya juga sama dari tekstur cream nya yang sangat gampang untuk dibaur dimuka, melembabkan, dan emang yang aku rasa pake full varian skincare acne dari scarlett ini ya bekas2 jerawat memudar, kalo ada jerawat cepet kempes. yang awalnya ragu banget mau pake cream ini, tapi ternyata cocok banget dan ada hasilnya dimuka aku luvv', 'night cream nya juga sama dari tekstur cream nya yang sangat gampang untuk dibaur dimuka melembabkan dan emang yang aku rasa pake full varian skincare acne dari scarlett ini ya bekas jerawat memudar kalo ada jerawat cepet kempes yang awalnya ragu banget mau pake cream ini tapi ternyata cocok banget dan ada hasilnya dimuka aku luvv', '[\"night\", \"cream\", \"nya\", \"juga\", \"sama\", \"dari\", \"tekstur\", \"cream\", \"nya\", \"yang\", \"sangat\", \"gampang\", \"untuk\", \"dibaur\", \"dimuka\", \"melembabkan\", \"dan\", \"emang\", \"yang\", \"aku\", \"rasa\", \"pakai\", \"full\", \"varian\", \"skincare\", \"acne\", \"dari\", \"scarlett\", \"ini\", \"bekas\", \"jerawat\", \"memudar\", \"kalo\", \"ada\", \"jerawat\", \"cepet\", \"kempes\", \"yang\", \"awalnya\", \"ragu\", \"banget\", \"mau\", \"pakai\", \"cream\", \"ini\", \"tapi\", \"ternyata\", \"cocok\", \"banget\", \"dan\", \"ada\", \"hasilnya\", \"dimuka\", \"aku\", \"luvv\"]', 'night cream nya juga sama dari tekstur cream nya yang sangat gampang untuk dibaur dimuka melembabkan dan emang yang aku rasa pakai full varian skincare acne dari scarlett ini bekas jerawat memudar kalo ada jerawat cepet kempes yang awalnya ragu banget mau pakai cream ini tapi ternyata cocok banget dan ada hasilnya dimuka aku luvv', '\"night cream nya tekstur cream nya gampang dibaur dimuka melembabkan emang pakai full varian skincare acne scarlett bekas jerawat memudar kalo jerawat cepet kempes ragu banget pakai cream cocok banget hasilnya dimuka luvv\"', 'night cream nya tekstur cream nya gampang baur muka melembabkan emang pakai full varian skincare acne scarlett bekas jerawat pudar kalo jerawat cepet kempes ragu banget pakai cream cocok banget hasil muka luvv', 'Negatif', '2024-11-29 06:40:06', '2024-11-29 06:40:06', NULL),
(127, 'Haruka', 'Sangat amat rekomendasi buat muka yang punya bekas jerawat & bopeng! Aku udh pemakaian di botol ke 3? dulu sempet pake serum yg lain, cuma ngefek di sekali pemakaian, abis itu bruntusan lg bahkan ampe breakout.. tapi setelah pake somethinc.. bener bener magical? ga tau lagi cara ilangin bopeng dan bekas jerawat semantul ini gmn selain pake somethinc.. saking suka sm serum ini, aku sampe beli skincare dr somethinc yg lainnya? krn somethinc yg bikin muka aku bersih dan mulus dari jerawat parah.. skrg aku udh ga jerawatan lagi guys!!! Harus coba pake somethinc! Pokoknya bersabar, dan yakin! ', 'sangat amat rekomendasi buat muka yang punya bekas jerawat & bopeng! aku udh pemakaian di botol ke 3? dulu sempet pake serum yg lain, cuma ngefek di sekali pemakaian, abis itu bruntusan lg bahkan ampe breakout.. tapi setelah pake somethinc.. bener bener magical? ga tau lagi cara ilangin bopeng dan bekas jerawat semantul ini gmn selain pake somethinc.. saking suka sm serum ini, aku sampe beli skincare dr somethinc yg lainnya? krn somethinc yg bikin muka aku bersih dan mulus dari jerawat parah.. skrg aku udh ga jerawatan lagi guys!!! harus coba pake somethinc! pokoknya bersabar, dan yakin! ', 'sangat amat rekomendasi buat muka yang punya bekas jerawat bopeng aku udh pemakaian di botol ke dulu sempet pake serum yg lain cuma ngefek di sekali pemakaian abis itu bruntusan lg bahkan ampe breakout tapi setelah pake somethinc bener bener magical ga tau lagi cara ilangin bopeng dan bekas jerawat semantul ini gmn selain pake somethinc saking suka sm serum ini aku sampe beli skincare dr somethinc yg lainnya krn somethinc yg bikin muka aku bersih dan mulus dari jerawat parah skrg aku udh ga jerawatan lagi guys harus coba pake somethinc pokoknya bersabar dan yakin', '[\"sangat\", \"amat\", \"rekomendasi\", \"buat\", \"muka\", \"yang\", \"punya\", \"bekas\", \"jerawat\", \"bopeng\", \"aku\", \"sudah\", \"pemakaian\", \"botol\", \"dulu\", \"sempet\", \"pakai\", \"serum\", \"lain\", \"cuma\", \"ngefek\", \"sekali\", \"pemakaian\", \"abis\", \"itu\", \"bruntusan\", \"bahkan\", \"ampe\", \"breakout\", \"tapi\", \"setelah\", \"pakai\", \"somethinc\", \"bener\", \"bener\", \"magical\", \"tau\", \"lagi\", \"cara\", \"ilangin\", \"bopeng\", \"dan\", \"bekas\", \"jerawat\", \"semantul\", \"ini\", \"bagaimana\", \"selain\", \"pakai\", \"somethinc\", \"saking\", \"suka\", \"serum\", \"ini\", \"aku\", \"sampe\", \"beli\", \"skincare\", \"somethinc\", \"lainnya\", \"krn\", \"somethinc\", \"bikin\", \"muka\", \"aku\", \"bersih\", \"dan\", \"mulus\", \"dari\", \"jerawat\", \"parah\", \"skrg\", \"aku\", \"sudah\", \"jerawatan\", \"lagi\", \"guys\", \"harus\", \"coba\", \"pakai\", \"somethinc\", \"pokoknya\", \"bersabar\", \"dan\", \"yakin\"]', 'sangat amat rekomendasi buat muka yang punya bekas jerawat bopeng aku sudah pemakaian botol dulu sempet pakai serum lain cuma ngefek sekali pemakaian abis itu bruntusan bahkan ampe breakout tapi setelah pakai somethinc bener bener magical tau lagi cara ilangin bopeng dan bekas jerawat semantul ini bagaimana selain pakai somethinc saking suka serum ini aku sampe beli skincare somethinc lainnya krn somethinc bikin muka aku bersih dan mulus dari jerawat parah skrg aku sudah jerawatan lagi guys harus coba pakai somethinc pokoknya bersabar dan yakin', '\"rekomendasi muka bekas jerawat bopeng pemakaian botol sempet pakai serum ngefek pemakaian abis bruntusan ampe breakout pakai somethinc bener bener magical tau ilangin bopeng bekas jerawat semantul pakai somethinc saking suka serum sampe beli skincare somethinc krn somethinc bikin muka bersih mulus jerawat parah skrg jerawatan guys coba pakai somethinc pokoknya bersabar\"', 'rekomendasi muka bekas jerawat bopeng pakai botol sempet pakai serum ngefek pakai abis bruntusan ampe breakout pakai somethinc bener bener magical tau ilangin bopeng bekas jerawat semantul pakai somethinc saking suka serum sampe beli skincare somethinc krn somethinc bikin muka bersih mulus jerawat parah skrg jerawat guys coba pakai somethinc pokok sabar', 'Negatif', '2024-11-29 06:40:08', '2024-11-29 06:40:08', NULL),
