(132, 'Vitachan', 'Beli ini karena penasaran lihat iklan di IG dan memang senang coba bermacam sunscreen lokal yg menjamur belakangan ini. Beli di SurabayaxBeauty 2023 lalu. Kemasannya tuh sudah suka banget dan berharap bisa cocok. Teksturnya in the middle, ngga kental banget tapi juga ngga encer, dengan warna putih kekuningan. Packaging menurtku sudah cocok banget, kuning cerah dan sesuai untuk sunscreen, claim juga sesuai karena ada glow jadi cocok buat kulit kering, di kulitku yg kombinasi juga ngga jadi terlalu oily juga. Masalahnya, setiap aku olesin ke kelopak mata, mataku selalu terasa berbeda, ada sensasi sedikit hangat yg konsisten menetap terus kalau kena mata juga perih. Dicoba 2 minggu ternyata sensasi di mata selalu ada. Akhirnya karena ngga nyaman, aku gunakan aja di badan. Sayang padahal sudah suka packaging yg travel friendly. Pernah coba beberapa skincare Scarlett yg lain, tidak bermasalah, kecuali yg sunscreen ini. Oya baunya jg mirip ma bau mainan anak zaman 80-90an yg tube kecil terus dikasih sedotan dan bisa bikin balon. Selama ini skincare Scarlett setauku jg memang ngga ada fragrance tapi ngga bermasalah karena juga cuma di awalnya saja', 'beli ini karena penasaran lihat iklan di ig dan memang senang coba bermacam sunscreen lokal yg menjamur belakangan ini. beli di surabayaxbeauty 2023 lalu. kemasannya tuh sudah suka banget dan berharap bisa cocok. teksturnya in the middle, ngga kental banget tapi juga ngga encer, dengan warna putih kekuningan. packaging menurtku sudah cocok banget, kuning cerah dan sesuai untuk sunscreen, claim juga sesuai karena ada glow jadi cocok buat kulit kering, di kulitku yg kombinasi juga ngga jadi terlalu oily juga. masalahnya, setiap aku olesin ke kelopak mata, mataku selalu terasa berbeda, ada sensasi sedikit hangat yg konsisten menetap terus kalau kena mata juga perih. dicoba 2 minggu ternyata sensasi di mata selalu ada. akhirnya karena ngga nyaman, aku gunakan aja di badan. sayang padahal sudah suka packaging yg 