(137, 'mailaul', 'Secara tidak terduga, ternyata dia enak banget. wanginya gak terlalu nyengat dan calming. busanya gak terlalu banyak, packagingnya menurutku juga ringkes. gak bikin kulit keset juga malah bikin lembap dan halus. ', 'secara tidak terduga, ternyata dia enak banget. wanginya gak terlalu nyengat dan calming. busanya gak terlalu banyak, packagingnya menurutku juga ringkes. gak bikin kulit keset juga malah bikin lembap dan halus. ', 'secara tidak terduga ternyata dia enak banget wanginya gak terlalu nyengat dan calming busanya gak terlalu banyak packagingnya menurutku juga ringkes gak bikin kulit keset juga malah bikin lembap dan halus', '[\"secara\", \"tidak\", \"terduga\", \"ternyata\", \"dia\", \"enak\", \"banget\", \"wanginya\", \"gak\", \"terlalu\", \"nyengat\", \"dan\", \"calming\", \"busanya\", \"gak\", \"terlalu\", \"banyak\", \"packagingnya\", \"menurutku\", \"juga\", \"ringkes\", \"gak\", \"bikin\", \"kulit\", \"keset\", \"juga\", \"malah\", \"bikin\", \"lembap\", \"dan\", \"halus\"]', 'secara tidak terduga ternyata dia enak banget wanginya gak terlalu nyengat dan calming busanya gak terlalu banyak packagingnya menurutku juga ringkes gak bikin kulit keset juga malah bikin lembap dan halus', '\"terduga enak banget wanginya gak nyengat calming busanya gak packagingnya menurutku ringkes gak bikin kulit keset bikin lembap halus\"', 'duga enak banget wangi gak nyengat calming busa gak packagingnya turut ringkes gak bikin kulit keset bikin lembap halus', 'Negatif', '2024-11-29 06:40:18', '2024-11-29 06:40:18', NULL),
(138, 'yelisnm', 'Jatuh cinta banget sama serum satu ini, karena bisa mudarin bekas jerawat / noda hitam di wajah. Gak bikin jerawatan / komedoan. Teksturnya nyaman di aku dan baunya gak mengandung parfum. Bikin muka tambah cerah dan tampak sehat. Selalu repurchase serum ini karena benar2 ngaruh banget di aku ❤️', 'jatuh cinta banget sama serum satu ini, karena bisa mudarin bekas jerawat / noda hitam di wajah. gak bikin jerawatan / komedoan. teksturnya nyaman di aku dan baunya gak mengandung parfum. bikin muka tambah cerah dan tampak sehat. selalu repurchase serum ini karena benar2 ngaruh banget di aku ❤️', 'jatuh cinta banget sama serum satu ini karena bisa mudarin bekas jerawat noda hitam di wajah gak bikin jerawatan komedoan teksturnya nyaman di aku dan baunya gak mengandung parfum bikin muka tambah cerah dan tampak sehat selalu repurchase serum ini karena benar ngaruh banget di aku', '[\"jatuh\", \"cinta\", \"banget\", \"sama\", \"serum\", \"satu\", \"ini\", \"karena\", \"bisa\", \"mudarin\", \"bekas\", \"jerawat\", \"noda\", \"hitam\", \"wajah\", \"gak\", \"bikin\", \"jerawatan\", \"komedoan\", \"teksturnya\", \"nyaman\", \"aku\", \"dan\", \"baunya\", \"gak\", \"mengandung\", \"parfum\", \"bikin\", \"muka\", \"tambah\", \"cerah\", \"dan\", \"tampak\", \"sehat\", \"selalu\", \"repurchase\", \"serum\", \"ini\", \"karena\", \"benar\", \"ngaruh\", \"banget\", \"aku\"]', 'jatuh cinta banget sama serum satu ini karena bisa mudarin bekas jerawat noda hitam wajah gak bikin jerawatan komedoan teksturnya nyaman aku dan baunya gak mengandung parfum bikin muka tambah cerah dan tampak sehat selalu repurchase serum ini karena benar ngaruh banget aku', '\"jatuh cinta banget serum mudarin bekas jerawat noda hitam wajah gak bikin jerawatan komedoan teksturnya nyaman baunya gak mengandung parfum bikin muka cerah sehat repurchase serum ngaruh banget\"', 'jatuh cinta banget serum mudarin bekas jerawat noda hitam wajah gak bikin jerawat komedoan tekstur nyaman bau gak kandung parfum bikin muka cerah sehat repurchase serum ngaruh banget', 'Negatif', '2024-11-29 06:40:19', '2024-11-29 06:40:19', NULL),
(139, 'daniardepe', 'baru pertama kali coba tonernya scarlett. klaimnya bisa mencerahkan. tekstur tonernya cair dan saat diaplikasikan di kulit wajah jadi lumayan melembabkan, tapi minusnya dikulit terasa panas. bukan cooling sih, tapi serasa pakai minya kayu putih di wajah, rasanya panas gitu. efek mencerahkannya kurang terlihat.', 'baru pertama kali coba tonernya scarlett. klaimnya bisa mencerahkan. tekstur tonernya cair dan saat diaplikasikan di kulit wajah jadi lumayan melembabkan, tapi minusnya dikulit terasa panas. bukan cooling sih, tapi serasa pakai minya kayu putih di wajah, rasanya panas gitu. efek mencerahkannya kurang terlihat.', 'baru pertama kali coba tonernya scarlett klaimnya bisa mencerahkan tekstur tonernya cair dan saat diaplikasikan di kulit wajah jadi lumayan melembabkan tapi minusnya dikulit terasa panas bukan cooling sih tapi serasa pakai minya kayu putih di wajah rasanya panas gitu efek mencerahkannya kurang terlihat', '[\"baru\", \"pertama\", \"kali\", \"coba\", \"tonernya\", \"scarlett\", \"klaimnya\", \"bisa\", \"mencerahkan\", \"tekstur\", \"tonernya\", \"cair\", \"dan\", \"saat\", \"diaplikasikan\", \"kulit\", \"wajah\", \"jadi\", \"lumayan\", \"melembabkan\", \"tapi\", \"minusnya\", \"dikulit\", \"terasa\", \"panas\", \"bukan\", \"cooling\", \"sih\", \"tapi\", \"serasa\", \"pakai\", \"minya\", \"kayu\", \"putih\", \"wajah\", \"rasanya\", \"panas\", \"gitu\", \"efek\", \"mencerahkannya\", \"kurang\", \"terlihat\"]', 'baru pertama kali coba tonernya scarlett klaimnya bisa mencerahkan tekstur tonernya cair dan saat diaplikasikan kulit wajah jadi lumayan melembabkan tapi minusnya dikulit terasa panas bukan cooling sih tapi serasa pakai minya kayu putih wajah rasanya panas gitu efek mencerahkannya kurang terlihat', '\"kali coba tonernya scarlett klaimnya mencerahkan tekstur tonernya cair diaplikasikan kulit wajah lumayan melembabkan minusnya dikulit panas cooling sih serasa pakai minya kayu putih wajah panas gitu efek mencerahkannya\"', 'kal