(140, 'AnnaIlmika', 'Kulitku tipe yg rewel sekali, blackhead ada, jerawat hormon ada, berutusan ada, bekas jerawat juga adaa..(EDIT REVIEW SETELAH 1 BULAN)Hasilnya :Cocok guyysss.. glowing banget aku..Komedo hitam menipis, bekas jerawat menipis, jerawat hormonal gak muncul lagi, skin barrier membaik, trus di pemakaian pas ada jerawat dia seketika membuat jerawatnya gak meradang (bukan hilang, tapi gak meradang lagi)..Biasanya aku pas lagi haid, bakalan muncul jerawat batu sakit banget.. kali ini gak ada.. seneng sekaliii..Masih ada bekas jerawatnya walaupun udah pudaran, semoga kalau di telatenin dan di tambah serum glowtening scarlett, bisa benar2 lepas dari noda2 ini..', 'kulitku tipe yg rewel sekali, blackhead ada, jerawat hormon ada, berutusan ada, bekas jerawat juga adaa..(edit review setelah 1 bulan)hasilnya :cocok guyysss.. glowing banget aku..komedo hitam menipis, bekas jerawat menipis, jerawat hormonal gak muncul lagi, skin barrier membaik, trus di pemakaian pas ada jerawat dia seketika membuat jerawatnya gak meradang (bukan hilang, tapi gak meradang lagi)..biasanya aku pas lagi haid, bakalan muncul jerawat batu sakit banget.. kali ini gak ada.. seneng sekaliii..masih ada bekas jerawatnya walaupun udah pudaran, semoga kalau di telatenin dan di tambah serum glowtening scarlett, bisa benar2 lepas dari noda2 ini..', 'kulitku tipe yg rewel sekali blackhead ada jerawat hormon ada berutusan ada bekas jerawat juga adaabiasanya aku pas lagi haid bakalan muncul jerawat batu sakit banget kali ini gak ada seneng sekaliiimasih ada bekas jerawatnya walaupun udah pudaran semoga kalau di telatenin dan di tambah serum glowtening scarlett bisa benar lepas dari noda ini', '[\"kulitku\", \"tipe\", \"rewel\", \"sekali\", \"blackhead\", \"ada\", \"jerawat\", \"hormon\", \"ada\", \"berutusan\", \"ada\", \"bekas\", \"jerawat\", \"juga\", \"adaabiasanya\", \"aku\", \"pas\", \"lagi\", \"haid\", \"bakalan\", \"muncul\", \"jerawat\", \"batu\", \"sakit\", \"banget\", \"kali\", \"ini\"