(143, 'akangskincare', 'Sunscreen yang ngeset cepet, kalo belum terlalu lama kena air dan keringat mudah terkikis karena bukan water resistant namun mudah dibersihkan jadinya. Teksturnya gel lotion yang lighweight mudah dibaurkan dan tidak nampak whitecast. Suncream untuk kulit normal to dry, namun di oily skin Aa masih ok sepanjang tidak bamyak layer skincare dan ada pelembab dibawahnya. Untuk oily sebaiknya kalo mau coba pakai tidak perlu didahului moisturizer. Aroma alkoholnya terasa tapi lekas nguap, klaim moist dan glow memang terasa. Untuk proteksi dipake indoor maupub outdoor cukup baik dimana kulit terhindar dari sunburn ataupun kusam. Ringan gak lengket, disarankan tidak dipakai disekitar mata tapi di Aa tidak bikin perih walau dipakai di mata.', 'sunscreen yang ngeset cepet, kalo belum terlalu lama kena air dan keringat mudah terkikis karena bukan water resistant namun mudah dibersihkan jadinya. teksturnya gel lotion yang lighweight mudah dibaurkan dan tidak nampak whitecast. suncream untuk kulit normal to dry, namun di oily skin aa masih ok sepanjang tidak bamyak layer skincare dan ada pelembab dibawahnya. untuk oily sebaiknya kalo mau coba pakai tidak perlu didahului moisturizer. aroma alkoholnya terasa tapi lekas nguap, klaim moist dan glow memang terasa. untuk proteksi dipake indoor maupub outdoor cukup baik dimana kulit terhindar dari sunburn ataupun kusam. ringan gak lengket, disarankan tidak dipakai disekitar mata tapi di aa tidak bikin perih walau dipakai di mata.', 'sunscreen yang ngeset cepet kalo belum terlalu lama kena air dan keringat mudah terkikis karena bukan water resistant namun mudah dibersihkan jadinya teksturnya gel lotion yang lighweight mudah dibaurkan dan tidak nampak whitecast suncream untuk kulit normal to dry namun di oily skin aa masih ok sepanjang tidak bamyak layer skincare dan ada pelembab dibawahnya untuk oily sebaiknya kalo mau coba pakai tidak perlu didahului moisturizer aroma alkoholnya terasa tapi lekas nguap klaim moist