hari efeknya mulai terlihat bekas jerawat sedikit memudar dan terlihat lebih cerah dikulitku normal juga ngga bikin bruntusan love bgt sama serum ini', '\"jujurly kali coba expect teksturnya berbeda serum cair bening tekstur serum white cell dna kental pasta pemakaian efeknya bekas jerawat memudar cerah dikulitku normal ngga bikin bruntusan love bgt serum\"', 'jujurly kali coba expect tekstur beda serum cair bening tekstur serum white cell dna kental pasta pakai efek bekas jerawat pudar cerah kulit normal ngga bikin bruntusan love bgt serum', 'Negatif', '2024-11-29 06:40:47', '2024-11-29 06:40:47', NULL),
