(167, 'sucimelindaas', 'serum dari somethinc yg 5% niacinamide + moisture sabi beet serum ini rekomended banget si untuk yg punya permasalahan wajah kusam dan jerawat kemerahan, karna ampuh banget untuk mencerahkan dan mengatasi kemerehan dan masalah jerawatnya juga ? muka jadi kelihatan sehat dan kemerehan jerawat jadi hilang loh asli bagus sih wajib banget sih order lagi ? dan teksturenta ringan banget ini ?', 'serum dari somethinc yg 5% niacinamide + moisture sabi beet serum ini rekomended banget si untuk yg punya permasalahan wajah kusam dan jerawat kemerahan, karna ampuh banget untuk mencerahkan dan mengatasi kemerehan dan masalah jerawatnya juga ? muka jadi kelihatan sehat dan kemerehan jerawat jadi hilang loh asli bagus sih wajib banget sih order lagi ? dan teksturenta ringan banget ini ?', 'serum dari somethinc yg niacinamide moisture sabi beet serum ini rekomended banget si untuk yg punya permasalahan wajah kusam dan jerawat kemerahan karna ampuh banget untuk mencerahkan dan mengatasi kemerehan dan masalah jerawatnya juga muka jadi kelihatan sehat dan kemerehan jerawat jadi hilang loh asli bagus sih wajib banget sih order lagi dan teksturenta ringan banget ini', '[\"serum\", \"dari\", \"somethinc\", \"niacinamide\", \"moisture\", \"sabi\", \"beet\", \"serum\", \"ini\", \"rekomended\", \"banget\", \"untuk\", \"punya\", \"permasalahan\", \"wajah\", \"kusam\", \"dan\", \"jerawat\", \"kemerahan\", \"karna\", \"ampuh\", \"banget\", \"untuk\", \"mencerahkan\", \"dan\", \"mengatasi\", \"kemerehan\", \"dan\", \"masalah\", \"jerawatnya\", \"juga\", \"muka\", \"jadi\", \"kelihatan\", \"sehat\", \"dan\", \"kemerehan\", \"jerawat\", \"jadi\", \"hilang\", \"loh\", \"asli\", \"bagus\", \"sih\", \"wajib\", \"banget\", \"sih\", \"order\", \"lagi\", \"dan\", \"teksturenta\", \"ringan\", \"banget\", \"ini\"]', 'serum dari somethinc niacinamide moisture sabi beet serum ini rekomended banget untuk punya permasalahan wajah kusam dan jerawat kemerahan karna ampuh banget untuk me