(169, 'fadhielnaufaldi', 'Aku pakai yang 5% niacinamide dan tujuan utama ku sebenernya untuk oil control aja sih, cuma dia ngasih bonus lain di kulit ku. Semenjak pakai dia, yang aku rasakan juga membantu kontrol jerawat yang ada di wajah ku, jadi proses jerawatnya gak perlu yang sampai harus besar merah gitu. Jadi proses peredaan jerawatnya kalau pakai dia jadi lebih terbantu.', 'aku pakai yang 5% niacinamide dan tujuan utama ku sebenernya untuk oil control aja sih, cuma dia ngasih bonus lain di kulit ku. semenjak pakai dia, yang aku rasakan juga membantu kontrol jerawat yang ada di wajah ku, jadi proses jerawatnya gak perlu yang sampai harus besar merah gitu. jadi proses peredaan jerawatnya kalau pakai dia jadi lebih terbantu.', 'aku pakai yang niacinamide dan tujuan utama ku sebenernya untuk oil control aja sih cuma dia ngasih bonus lain di kulit ku semenjak pakai dia yang aku rasakan juga membantu kontrol jerawat yang ada di wajah ku jadi proses jerawatnya gak perlu yang sampai harus besar merah gitu jadi proses peredaan jerawatnya kalau pakai dia jadi lebih terbantu', '[\"aku\", \"pakai\", \"yang\", \"niacinamide\", \"dan\", \"tujuan\", \"utama\", \"sebenernya\", \"untuk\", \"oil\", \"control\", \"aja\", \"sih\", \"cuma\", \"dia\", \"ngasih\", \"bonus\", \"lain\", \"kulit\", \"semenjak\", \"pakai\", \"dia\", \"yang\", \"aku\", \"rasakan\", \"juga\", \"membantu\", \"kontrol\", \"jerawat\", \"yang\", \"ada\", \"wajah\", \"jadi\", \"proses\", \"jerawatnya\", \"gak\", \"perlu\", \"yang\", \"sampai\", \"harus\", \"besar\", \"merah\", \"gitu\", \"jadi\", \"proses\", \"peredaan\", \"jerawatnya\", \"kalau\", \"pakai\", \"dia\", \"jadi\", \"lebih\", \"terbantu\"]', 'aku pakai yang niacinamide dan tujuan utama sebenernya untuk oil control aja sih cuma dia ngasih bonus lain kulit semenjak pakai dia yang aku rasakan juga membantu kontrol jerawat yang ada wajah jadi proses jerawatnya gak perlu yang sampai harus besar merah gitu jadi proses peredaan jerawatnya kalau pakai di