(188, 'sitisit01', 'kebetulan aku lagi cari cari serum karena memasuki usia tidak muda lagi.. terus liat banyak yg review white cell dna serum inii dan ternyata aman buat busui seneng banget! Serumnya ini bagus banget sih hasilnya di aku makin cerah dan glowing gitu after pakai.. kalau rutin ya trs nggak yg lengket gitu sih aku suka.', 'kebetulan aku lagi cari cari serum karena memasuki usia tidak muda lagi.. terus liat banyak yg review white cell dna serum inii dan ternyata aman buat busui seneng banget! serumnya ini bagus banget sih hasilnya di aku makin cerah dan glowing gitu after pakai.. kalau rutin ya trs nggak yg lengket gitu sih aku suka.', 'kebetulan aku lagi cari cari serum karena memasuki usia tidak muda lagi terus liat banyak yg review white cell dna serum inii dan ternyata aman buat busui seneng banget serumnya ini bagus banget sih hasilnya di aku makin cerah dan glowing gitu after pakai kalau rutin ya trs nggak yg lengket gitu sih aku suka', '[\"kebetulan\", \"aku\", \"lagi\", \"cari\", \"cari\", \"serum\", \"karena\", \"memasuki\", \"usia\", \"tidak\", \"muda\", \"lagi\", \"terus\", \"lihat\", \"banyak\", \"review\", \"white\", \"cell\", \"dna\", \"serum\", \"inii\", \"dan\", \"ternyata\", \"aman\", \"buat\", \"busui\", \"seneng\", \"banget\", \"serumnya\", \"ini\", \"bagus\", \"banget\", \"sih\", \"hasilnya\", \"aku\", \"makin\", \"cerah\", \"dan\", \"glowing\", \"gitu\", \"after\", \"pakai\", \"kalau\", \"rutin\", \"trs\", \"nggak\", \"lengket\", \"gitu\", \"sih\", \"aku\", \"suka\"]', 'kebetulan aku lagi cari cari serum karena memasuki usia tidak muda lagi terus lihat banyak review white cell dna serum inii dan ternyata aman buat busui seneng banget serumnya ini bagus banget sih hasilnya aku makin cerah dan glowing gitu after pakai kalau rutin trs nggak lengket gitu sih aku suka', '\"cari cari serum memasuki usia muda lihat review white cell dna serum inii aman busui seneng banget serumnya bagus banget sih hasilnya cerah glowing gitu after pakai ru