(190, 'Thenly', 'Pertama kali tau produk ini dari review IG, trus nyoba dan ternyata cocok... muka jadi lebih cerahhh trus juga noda hitam mulai memudar.. teksturnya yang kental tapi cepat menyerap.. awal pemakaian agak perih, tapi lama kelamaan normal dan jadi bagus kulit wajahnya', 'pertama kali tau produk ini dari review ig, trus nyoba dan ternyata cocok... muka jadi lebih cerahhh trus juga noda hitam mulai memudar.. teksturnya yang kental tapi cepat menyerap.. awal pemakaian agak perih, tapi lama kelamaan normal dan jadi bagus kulit wajahnya', 'pertama kali tau produk ini dari review ig trus nyoba dan ternyata cocok muka jadi lebih cerahhh trus juga noda hitam mulai memudar teksturnya yang kental tapi cepat menyerap awal pemakaian agak perih tapi lama kelamaan normal dan jadi bagus kulit wajahnya', '[\"pertama\", \"kali\", \"tau\", \"produk\", \"ini\", \"dari\", \"review\", \"trus\", \"nyoba\", \"dan\", \"ternyata\", \"cocok\", \"muka\", \"jadi\", \"lebih\", \"cerahhh\", \"trus\", \"juga\", \"noda\", \"hitam\", \"mulai\", \"memudar\", \"teksturnya\", \"yang\", \"kental\", \"tapi\", \"cepat\", \"menyerap\", \"awal\", \"pemakaian\", \"agak\", \"perih\", \"tapi\", \"lama\", \"kelamaan\", \"normal\", \"dan\", \"jadi\", \"bagus\", \"kulit\", \"wajahnya\"]', 'pertama kali tau produk ini dari review trus nyoba dan ternyata cocok muka jadi lebih cerahhh trus juga noda hitam mulai memudar teksturnya yang kental tapi cepat menyerap awal pemakaian agak perih tapi lama kelamaan normal dan jadi bagus kulit wajahnya', '\"kali tau produk review trus nyoba cocok muka cerahhh trus noda hitam memudar teksturnya kental cepat menyerap pemakaian perih normal bagus kulit wajahnya\"', 'kali tau produk review trus nyoba cocok muka cerahhh trus noda hitam pudar tekstur kental cepat serap pakai perih normal bagus kulit wajah', 'Negatif', '2024-11-29 06:41:15', '2024-11-29 06:41:15', NULL),
(191, 'maulianur', 'at first sih ok-ok aja but did nothing to my face, bruntusan sih tetep ada and i decided to repurchase this product for the second time... terus entah kenapa kulitku jadi rasa kebakar makenya dan besoknya pipiku bruntusan?? kayaknya aku kurang cocok sama salah satu kandungan yg ada di sini tp gatau apa krn ada centella aciatica, niacinimide, sependek pengetahuanku mereka dua ini ga bikin iritasi... trs aku gatau yg ga cocok apanya, apa mungkin beetnya yaa ? padahal lit org pake ini reviewnya bagus2', 'at first sih ok-ok aja but did nothing to my face, bruntusan sih tetep ada and i decided to repurchase this product for the second time... terus entah kenapa kulitku jadi rasa kebakar makenya dan besoknya pipiku bruntusan?? kayaknya aku kurang cocok sama salah satu kandungan yg ada di sini tp gatau apa krn ada centella aciatica, niacinimide, sependek pengetahuanku mereka dua ini ga bikin iritasi... trs aku gatau yg ga cocok apanya, apa mungkin beetnya yaa ? padahal lit org pake ini reviewnya bagus2', 'at first sih okok aja but did nothing to my face bruntusan sih tetep ada and i decided to repurchase this product for the second time terus entah kenapa kulitku jadi rasa kebakar makenya dan besoknya pipiku bruntusan kayaknya aku kurang cocok sama salah satu kandungan yg ada di sini tp gatau apa krn ada centella aciatica niacinimide sependek pengetahuanku mereka dua ini ga bikin iritasi trs aku gatau yg ga cocok apanya apa mungkin beetnya yaa padahal lit org pake ini reviewnya bagus', '[\"first\", \"sih\", \"okok\", \"aja\", \"but\", \"did\", \"nothing\", \"face\", \"bruntusan\", \"sih\", \"tetep\", \"ada\", \"and\", \"decided\", \"repurchase\", \"this\", \"product\", \"for\", \"the\", \"second\", \"time\", \"terus\", \"entah\", \"kenapa\", \"kulitku\", \"jadi\", \"rasa\", \"kebakar\", \"makenya\", \"dan\", \"besoknya\", \"pipiku\", \"bruntusan\", \"kayaknya\", \"aku\", \"kurang\", \"cocok\", \"sama\", \"salah\", \"satu\", \"kandungan\", \"ada\", \"sini\", \"gatau\", \"apa\", \"krn\", \"ada\", \"centella\", \"aciatica\", \"niacinimide\", \"sependek\", \"pengetahuanku\", \"mereka\", \"dua\", \"ini\", \"bikin\", \"iritasi\", \"trs\", \"aku\", \"gatau\", \"cocok\", \"apanya\", \"apa\", \"mungkin\", \"beetnya\", \"yaa\", \"padahal\", \"lit\", \"orang\", \"pakai\", \"ini\", \"reviewnya\", \"bagus\"]', 'first sih okok aja but did nothing face bruntusan sih tetep ada and decided repurchase this product for the second time terus entah kenapa kulitku jadi rasa kebakar makenya dan besoknya pipiku bruntusan kayaknya aku kurang cocok sama salah satu kandungan ada sini gatau apa krn ada centella aciatica niacinimide sependek pengetahuanku mereka dua ini bikin iritasi trs aku gatau cocok apanya apa mungkin beetnya yaa padahal lit orang pakai ini reviewnya bagus', '\"first sih okok aja but did nothing face bruntusan sih tetep and decided repurchase this product for the second time kulitku kebakar makenya besoknya pipiku bruntusan kayaknya cocok salah kandungan gatau krn centella aciatica niacinimide sependek pengetahuanku bikin iritasi trs gatau cocok apanya beetnya yaa lit orang pakai reviewnya bagus\"', 'first sih okok aja but did nothing face bruntusan sih tetep and decided repurchase this product for the second time kulit bakar makenya besok pipi bruntusan kayak cocok salah kandung gatau krn centella aciatica niacinimide pendek tahu bikin iritasi trs gatau cocok apa beetnya yaa lit orang pakai reviewnya bagus', 'Negatif', '2024-11-29 06:41:18', '2024-11-29 06:41:18', NULL),
(192, 'nzwaptrnayla', 'salah satu serum yang aku suka, sejauh ini cocok kok di wajah aku. dulu sempet bingung nyari-nyari serum kek blm ada aja gitu yg cocok, tp krn produk ini sering muncul di beranda twitter aku jd penasaran pengen coba, akhirnya aku beli dan nyoba serum ini WAH GILA SIH! hasilnya ngefek bgt wajah aku jadi lumayan cerah. terus pas diaplikasikan ke muka juga ringan bgt ga lengket sama sekali', 'salah satu serum yang aku suka, sejauh ini cocok kok di wajah aku. dulu sempet bingung nyari-nyari serum kek blm ada aja gitu yg cocok, tp krn produk ini sering muncul di beranda twitter aku jd penasaran pengen coba, akhirnya aku beli dan nyoba serum ini wah gila sih! hasilnya ngefek bgt wajah aku jadi lumayan cerah. terus pas diaplikasikan ke muka juga ringan bgt ga lengket sama sekali', 'salah satu serum yang aku suka sejauh ini cocok kok di wajah aku dulu sempet bingung nyarinyari serum kek blm ada aja gitu yg cocok tp krn produk ini sering muncul di beranda twitter aku jd penasaran pengen coba akhirnya aku beli dan nyoba serum ini wah gila sih hasilnya ngefek bgt wajah aku jadi lumayan cerah terus pas diaplikasikan ke muka juga ringan bgt ga lengket sama sekali', '[\"salah\", \"satu\", \"serum\", \"yang\", \"aku\", \"suka\", \"sejauh\", \"ini\", \"cocok\", \"kok\", \"wajah\", \"aku\", \"dulu\", \"sempet\", \"bingung\", \"nyarinyari\", \"serum\", \"kek\", \"blm\", \"ada\", \"aja\", \"gitu\", \"cocok\", \"krn\", \"produk\", \"ini\", \"sering\", \"muncul\", \"beranda\", \"twitter\", \"aku\", \"penasaran\", \"pengen\", \"coba\", \"akhirnya\", \"aku\", \"beli\", \"dan\", \"nyoba\", \"serum\", \"ini\", \"wah\", \"gila\", \"sih\", \"hasilnya\", \"ngefek\", \"bgt\", \"wajah\", \"aku\", \"jadi\", \"lumayan\", \"cerah\", \"terus\", \"pas\", \"diaplikasikan\", \"muka\", \"juga\", \"ringan\", \"bgt\", \"lengket\", \"sama\", \"sekali\"]', 'salah satu serum yang aku suka sejauh ini cocok kok wajah aku dulu sempet bingung nyarinyari serum kek blm ada aja gitu cocok krn produk ini sering muncul beranda twitter aku penasaran pengen coba akhirnya aku beli dan nyoba serum ini wah gila sih hasilnya ngefek bgt wajah aku jadi lumayan cerah terus pas diaplikasikan muka juga ringan bgt lengket sama sekali', '\"salah serum suka cocok wajah sempet bingung nyarinyari serum kek blm aja gitu cocok krn produk muncul beranda twitter penasaran pengen coba beli nyoba serum gila sih hasilnya ngefek bgt wajah lumayan cerah pas diaplikasikan muka ringan bgt lengket\"', 'salah serum suka cocok wajah sempet bingung nyarinyari serum kek blm aja gitu cocok krn produk muncul beranda twitter penasaran ken coba beli nyoba serum gila sih hasil ngefek bgt wajah lumayan cerah pas aplikasi muka ringan bgt lengket', 'Negatif', '2024-11-29 06:41:19', '2024-11-29 06:41:19', NULL),
(193, 'evamahira', 'Salah hrsnya aku yg moisture sabi beet serum :( yg itu ngurangin bekas jerawat tp lama banget.. but its okayy kalo aku sih yg penting dia ga numbuhin jerawat baru, ga nimbulin efek yg gimana2, aku bakal sabar kok hehe. Tp sbnrnya aku pake dia barengan sm produk lain yg klaimnya mengurangi bekas jerawat juga, jadi gatau siapa yg bener2 works tpi gpp asalkan mereka bekerja sama di mukaku wkwk.', 'salah hrsnya aku yg moisture sabi beet serum :( yg itu ngurangin bekas jerawat tp lama banget.. but its okayy kalo aku sih yg penting dia ga numbuhin jerawat baru, ga nimbulin efek yg gimana2, aku bakal sabar kok hehe. tp sbnrnya aku pake dia barengan sm produk lain yg klaimnya mengurangi bekas jerawat juga, jadi gatau siapa yg bener2 works tpi gpp asalkan mereka bekerja sama di mukaku wkwk.', 'salah hrsnya aku yg moisture sabi beet serum yg itu ngurangin bekas jerawat tp lama banget but its okayy kalo aku sih yg penting dia ga numbuhin jerawat baru ga nimbulin efek yg gimana aku bakal sabar kok hehe tp sbnrnya aku pake dia barengan sm produk lain yg klaimnya mengurangi bekas jerawat juga jadi gatau siapa yg bener works tpi gpp asalkan mereka bekerja sama di mukaku wkwk', '[\"salah\", \"hrsnya\", \"aku\", \"moisture\", \"sabi\", \"beet\", \"serum\", \"itu\", \"ngurangin\", \"bekas\", \"jerawat\", \"lama\", \"banget\", \"but\", \"its\", \"okayy\", \"kalo\", \"aku\", \"sih\", \"penting\", \"dia\", \"numbuhin\", \"jerawat\", \"baru\", \"nimbulin\", \"efek\", \"gimana\", \"aku\", \"bakal\", \"sabar\", \"kok\", \"hehe\", \"sbnrnya\", \"aku\", \"pakai\", \"dia\", \"barengan\", \"produk\", \"lain\", \"klaimnya\", \"mengurangi\", \"bekas\", \"jerawat\", \"juga\", \"jadi\", \"gatau\", \"siapa\", \"bener\", \"works\", \"tpi\", \"gpp\", \"asalkan\", \"mereka\", \"bekerja\", \"sama\", \"mukaku\", \"wkwk\"]', 'salah hrsnya aku moisture sabi beet serum itu ngurangin bekas jerawat lama banget but its okayy kalo aku sih penting dia numbuhin jerawat baru nimbulin efek gimana aku bakal sabar kok hehe sbnrnya aku pakai dia barengan produk lain klaimnya mengurangi bekas jerawat juga jadi gatau siapa bener works tpi gpp asalkan mereka bekerja sama mukaku wkwk', '\"salah hrsnya moisture sabi beet serum ngurangin bekas jerawat banget but its okayy kalo sih numbuhin jerawat nimbulin efek gimana sabar hehe sbnrnya pakai barengan produk klaimnya mengurangi bekas jerawat gatau bener works tpi gpp mukaku wkwk\"', 'salah hrsnya moisture sabi beet serum ngurangin bekas jerawat banget but its okayy kalo sih numbuhin jerawat nimbulin efek gimana sabar hehe sbnrnya pakai bareng produk klaim kurang bekas jerawat gatau bener works tpi gpp muka wkwk', 'Negatif', '2024-11-29 06:41:21', '2024-11-29 06:41:21', NULL),
