(201, 'rizka_fr', 'Aku coba yang 10% size 40ml. Hasilnya yang paling kerasa adalah wajah lebih cerah. Apakah mengatasi jerawat? tidak juga (tidak signifikan). Apakah memudarkan bekas jerawat? tidak juga (karena prosesnya pasti lebih lama). Sayangnya saat serumku sisa sedikit (+- 15%) mengalami perubahan warna menguning. Mungkin kedepannya aku bakal beli yang ukuran lebih kecil dan yang niacinamide tidak setinggi ini. ', 'aku coba yang 10% size 40ml. hasilnya yang paling kerasa adalah wajah lebih cerah. apakah mengatasi jerawat? tidak juga (tidak signifikan). apakah memudarkan bekas jerawat? tidak juga (karena prosesnya pasti lebih lama). sayangnya saat serumku sisa sedikit (+- 15%) mengalami perubahan warna menguning. mungkin kedepannya aku bakal beli yang ukuran lebih kecil dan yang niacinamide tidak setinggi ini. ', 'aku coba yang size ml hasilnya yang paling kerasa adalah wajah lebih cerah apakah mengatasi jerawat tidak juga mengalami perubahan warna menguning mungkin kedepannya aku bakal beli yang ukuran lebih kecil dan yang niacinamide tidak setinggi ini', '[\"aku\", \"coba\", \"yang\", \"size\", \"hasilnya\", \"yang\", \"paling\", \"kerasa\", \"adalah\", \"wajah\", \"lebih\", \"cerah\", \"apakah\", \"mengatasi\", \"jerawat\", \"tidak\", \"juga\", \"mengalami\", \"perubahan\", \"warna\", \"menguning\", \"mungkin\", \"kedepannya\", \"aku\", \"bakal\", \"beli\", \"yang\", \"ukuran\", \"lebih\", \"kecil\", \"dan\", \"yang\", \"niacinamide\", \"tidak\", \"setinggi\", \"ini\"]', 'aku coba yang size hasilnya yang paling kerasa adalah wajah lebih cerah apakah mengatasi jerawat tidak juga mengalami perubahan warna menguning mungkin kedepannya aku bakal beli yang ukuran lebih kecil dan yang niacinamide tidak setinggi ini', '\"coba size hasilnya kerasa wajah cerah mengatasi jerawat mengalami perubahan warna menguning kedepannya beli ukuran niacinamide\"', 'coba size hasil rasa wajah cerah atas jerawat alami ubah warna kuning depan beli ukur niacinamide', 'Negatif', '2024