(231, 'BellaAlexandrea_97', 'agak ragu sama hal-hal yang mencerahkan karena pernah ga cocok sama produk yang bikin mencerahkan. tapi ternyata malah cocok bgt sama si Somethinc Niacinamide ini!!! Teksturnya cair agak kental bening, mudah menyerap dan melembapkannya enak ga bikin kerasa nempel-nempel gitu. Dan kerasa banget mencerahkannya. Bekas jerawat yg menghitam dan merah-merah tuh jadi cepat pudar. Suka banget pokonya! Dan selama aku pakai product Somethinc ga ada yg ga cocok di aku', 'agak ragu sama hal-hal yang mencerahkan karena pernah ga cocok sama produk yang bikin mencerahkan. tapi ternyata malah cocok bgt sama si somethinc niacinamide ini!!! teksturnya cair agak kental bening, mudah menyerap dan melembapkannya enak ga bikin kerasa nempel-nempel gitu. dan kerasa banget mencerahkannya. bekas jerawat yg menghitam dan merah-merah tuh jadi cepat pudar. suka banget pokonya! dan selama aku pakai product somethinc ga ada yg ga cocok di aku', 'agak ragu sama halhal yang mencerahkan karena pernah ga cocok sama produk yang bikin mencerahkan tapi ternyata malah cocok bgt sama si somethinc niacinamide ini teksturnya cair agak kental bening mudah menyerap dan melembapkannya enak ga bikin kerasa nempelnempel gitu dan kerasa banget mencerahkannya bekas jerawat yg menghitam dan merahmerah tuh jadi cepat pudar suka banget pokonya dan selama aku pakai product somethinc ga ada yg ga cocok di aku', '[\"agak\", \"ragu\", \"sama\", \"halhal\", \"yang\", \"mencerahkan\", \"karena\", \"pernah\", \"cocok\", \"sama\", \"produk\", \"yang\", \"bikin\", \"mencerahkan\", \"tapi\", \"ternyata\", \"malah\", \"cocok\", \"bgt\", \"sama\", \"somethinc\", \"niacinamide\", \"ini\", \"teksturnya\", \"cair\", \"agak\", \"kental\", \"bening\", \"mudah\", \"menyerap\", \"dan\", \"melembapkannya\", \"enak\", \"bikin\", \"kerasa\", \"nempelnempel\", \"gitu\", \"dan\", \"kerasa\", \"banget\", \"mencerahkannya\", \"bekas\", \"jerawat\", \"menghitam\", \"dan\", \"merahmerah\", \"tuh\", \"jadi\", \"cepa