(234, 'fanfan1', 'Kulit gue tu kan acne prone ya, kalau w makan kotor, cuci muka gak bener, atau pindah ke suatu tempat, gue pasti jerawatan. Jerawat yang gede2 gitu loh. Gue beli tuh serum ini. Terus pas udah pake sebotol, kulit w udah lumayan sih, gak gampang jerawatan lagi, paling kalau mau haid doang, itu juga cepet sembuhnya. Suka banget w ma serum ini, sampe w beli lagi botol kedua.', 'kulit gue tu kan acne prone ya, kalau w makan kotor, cuci muka gak bener, atau pindah ke suatu tempat, gue pasti jerawatan. jerawat yang gede2 gitu loh. gue beli tuh serum ini. terus pas udah pake sebotol, kulit w udah lumayan sih, gak gampang jerawatan lagi, paling kalau mau haid doang, itu juga cepet sembuhnya. suka banget w ma serum ini, sampe w beli lagi botol kedua.', 'kulit gue tu kan acne prone ya kalau w makan kotor cuci muka gak bener atau pindah ke suatu tempat gue pasti jerawatan jerawat yang gede gitu loh gue beli tuh serum ini terus pas udah pake sebotol kulit w udah lumayan sih gak gampang jerawatan lagi paling kalau mau haid doang itu juga cepet sembuhnya suka banget w ma serum ini sampe w beli lagi botol kedua', '[\"kulit\", \"gue\", \"kan\", \"acne\", \"prone\", \"kalau\", \"makan\", \"kotor\", \"cuci\", \"muka\", \"gak\", \"bener\", \"atau\", \"pindah\", \"suatu\", \"tempat\", \"gue\", \"pasti\", \"jerawatan\", \"jerawat\", \"yang\", \"gede\", \"gitu\", \"loh\", \"gue\", \"beli\", \"tuh\", \"serum\", \"ini\", \"terus\", \"pas\", \"udah\", \"pakai\", \"sebotol\", \"kulit\", \"udah\", \"lumayan\", \"sih\", \"gak\", \"gampang\", \"jerawatan\", \"lagi\", \"paling\", \"kalau\", \"mau\", \"haid\", \"doang\", \"itu\", \"juga\", \"cepet\", \"sembuhnya\", \"suka\", \"banget\", \"serum\", \"ini\", \"sampe\", \"beli\", \"lagi\", \"botol\", \"kedua\"]', 'kulit gue kan acne prone kalau makan kotor cuci muka gak bener atau pindah suatu tempat gue pasti jerawatan jerawat yang gede gitu loh gue beli tuh serum ini terus pas udah pakai sebotol kulit udah lumayan sih gak gampang jerawatan lagi paling kalau mau haid doang itu juga cepet sembuhnya suka banget serum ini sampe beli lagi botol kedua', '\"kulit gue acne prone makan kotor cuci muka gak bener pindah gue jerawatan jerawat gede gitu loh gue beli tuh serum pas udah pakai sebotol kulit udah lumayan sih gak gampang jerawatan haid doang cepet sembuhnya suka banget serum sampe beli botol\"', 'kulit gue acne prone makan kotor cuci muka gak bener pindah gue jerawat jerawat gede gitu loh gue beli tuh serum pas udah pakai botol kulit udah lumayan sih gak gampang jerawat haid doang cepet sembuh suka banget serum sampe beli botol', 'Negatif', '2024-11-29 06:42:14', '2024-11-29 06:42:14', NULL),
