(236, 'dytakd', 'Cobain ini karena rekomendasi dari temen. Jujur sih cocok pakai ini, gampang diaplikasi in, mudah menyerap dikulit. Setelah pemakaian rutin bekas jerawat jadi memudar, mencerahkan kulit, ringan banget dikulit dan ngga bikin ketergantungan.', 'cobain ini karena rekomendasi dari temen. jujur sih cocok pakai ini, gampang diaplikasi in, mudah menyerap dikulit. setelah pemakaian rutin bekas jerawat jadi memudar, mencerahkan kulit, ringan banget dikulit dan ngga bikin ketergantungan.', 'cobain ini karena rekomendasi dari temen jujur sih cocok pakai ini gampang diaplikasi in mudah menyerap dikulit setelah pemakaian rutin bekas jerawat jadi memudar mencerahkan kulit ringan banget dikulit dan ngga bikin ketergantungan', '[\"cobain\", \"ini\", \"karena\", \"rekomendasi\", \"dari\", \"temen\", \"jujur\", \"sih\", \"cocok\", \"pakai\", \"ini\", \"gampang\", \"diaplikasi\", \"mudah\", \"menyerap\", \"dikulit\", \"setelah\", \"pemakaian\", \"rutin\", \"bekas\", \"jerawat\", \"jadi\", \"memudar\", \"mencerahkan\", \"kulit\", \"ringan\", \"banget\", \"dikulit\", \"dan\", \"ngga\", \"bikin\", \"ketergantungan\"]', 'cobain ini karena rekomendasi dari temen jujur sih cocok pakai ini gampang diaplikasi mudah menyerap dikulit setelah pemakaian rutin bekas jerawat jadi memudar mencerahkan kulit ringan banget dikulit dan ngga bikin ketergantungan', '\"cobain rekomendasi temen jujur sih cocok pakai gampang diaplikasi mudah menyerap dikulit pemakaian rutin bekas jerawat memudar mencerahkan kulit ringan banget dikulit ngga bikin ketergantungan\"', 'cobain rekomendasi temen jujur sih cocok pakai gampang aplikasi mudah serap kulit pakai rutin bekas jerawat pudar cerah kulit ringan banget kulit ngga bikin gantung', 'Negatif', '2024-11-29 06:42:16', '2024-11-29 06:42:16', NULL),
