(252, 'hanafianzya', 'Salah satu serum vitamin c yang harganya cukup affordable dan efek mencerahkannya cukup terlihat menurut aku. After 30hari pemakaian serum ini secara rutin tiap pagi dia aku Membantu banget buat mudarin bekas jerawat yang kehitaman, teksturnya juga mudah meresap', 'salah satu serum vitamin c yang harganya cukup affordable dan efek mencerahkannya cukup terlihat menurut aku. after 30hari pemakaian serum ini secara rutin tiap pagi dia aku membantu banget buat mudarin bekas jerawat yang kehitaman, teksturnya juga mudah meresap', 'salah satu serum vitamin c yang harganya cukup affordable dan efek mencerahkannya cukup terlihat menurut aku after hari pemakaian serum ini secara rutin tiap pagi dia aku membantu banget buat mudarin bekas jerawat yang kehitaman teksturnya juga mudah meresap', '[\"salah\", \"satu\", \"serum\", \"vitamin\", \"yang\", \"harganya\", \"cukup\", \"affordable\", \"dan\", \"efek\", \"mencerahkannya\", \"cukup\", \"terlihat\", \"menurut\", \"aku\", \"after\", \"hari\", \"pemakaian\", \"serum\", \"ini\", \"secara\", \"rutin\", \"tiap\", \"pagi\", \"dia\", \"aku\", \"membantu\", \"banget\", \"buat\", \"mudarin\", \"bekas\", \"jerawat\", \"yang\", \"kehitaman\", \"teksturnya\", \"juga\", \"mudah\", \"meresap\"]', 'salah satu serum vitamin yang harganya cukup affordable dan efek mencerahkannya cukup terlihat menurut aku after hari pemakaian serum ini secara rutin tiap pagi dia aku membantu banget buat mudarin bekas jerawat yang kehitaman teksturnya juga mudah meresap', '\"salah serum vitamin harganya affordable efek mencerahkannya after pemakaian serum rutin pagi membantu banget mudarin bekas jerawat kehitaman teksturnya mudah meresap\"', 'salah serum vitamin harga affordable efek cerah after pakai serum rutin pagi bantu banget mudarin bekas jerawat hitam tekstur mudah resap', 'Negatif', '2024-11-29 06:42:40', '2024-11-29 06:42:40', NULL),
(253, 'Lanisajuda', 'Jujur aku baru pake 2 minggu dan ternyata beneran sengaruh itu sih, kulit jadi lebih cerah glowing dan jerawat juga udah mulai ilang, udah masuk wish list aku eh alhamdulillah kmrin baru bisa co, kayanya bakal beli lagi sih buat stock hihiii', 'jujur aku baru pake 2 minggu dan ternyata beneran sengaruh itu sih, kulit jadi lebih cerah glowing dan jerawat juga udah mulai ilang, udah masuk wish list aku eh alhamdulillah kmrin baru bisa co, kayanya bakal beli lagi sih buat stock hihiii', 'jujur aku baru pake minggu dan ternyata beneran sengaruh itu sih kulit jadi lebih cerah glowing dan jerawat juga udah mulai ilang udah masuk wish list aku eh alhamdulillah kmrin baru bisa co kayanya bakal beli lagi sih buat stock hihiii', '[\"jujur\", \"aku\", \"baru\", \"pakai\", \"minggu\", \"dan\", \"ternyata\", \"beneran\", \"sengaruh\", \"itu\", \"sih\", \"kulit\", \"jadi\", \"lebih\", \"cerah\", \"glowing\", \"dan\", \"jerawat\", \"juga\", \"udah\", \"mulai\", \"ilang\", \"udah\", \"masuk\", \"wish\", \"list\", \"aku\", \"alhamdulillah\", \"kmrin\", \"baru\", \"bisa\", \"kayanya\", \"bakal\", \"beli\", \"lagi\", \"sih\", \"buat\", \"stock\", \"hihiii\"]', 'jujur aku baru pakai minggu dan ternyata beneran sengaruh itu sih kulit jadi lebih cerah glowing dan jerawat juga udah mulai ilang udah masuk wish list aku alhamdulillah kmrin baru bisa kayanya bakal beli lagi sih buat stock hihiii', '\"jujur pakai minggu beneran sengaruh sih kulit cerah glowing jerawat udah ilang udah masuk wish list alhamdulillah kmrin kayanya beli sih stock hihiii\"', 'jujur pakai minggu beneran sengaruh sih kulit cerah glowing jerawat udah ilang udah masuk wish list alhamdulillah kmrin kaya beli sih stock hihiii', 'Negatif', '2024-11-29 06:42:41', '2024-11-29 06:42:41', NULL),
(254, 'sherly88', 'Serum yg ampuh banget untuk mencerahkan. Teksturnya light gampang menyerap. Aku pake ini cuma malem hari aja, efek besok pagi kulit lebih cerah. Dan mengontrol kadar minyak juga di wajah. Cuma minusnya 1 di aku, awal2 pemakaian bs muncul milia di bawah mata, dan semingguan baru ilang. ', 'serum yg ampuh banget untuk mencerahkan. teksturnya light gampang menyerap. aku pake ini cuma malem hari aja, efek besok pagi kulit lebih cerah. dan mengontrol kadar minyak juga di wajah. cuma minusnya 1 di aku, awal2 pemakaian bs muncul milia di bawah mata, dan semingguan baru ilang. ', 'serum yg ampuh banget untuk mencerahkan teksturnya light gampang menyerap aku pake ini cuma malem hari aja efek besok pagi kulit lebih cerah dan mengontrol kadar minyak juga di wajah cuma minusnya di aku awal pemakaian bs muncul milia di bawah mata dan semingguan baru ilang', '[\"serum\", \"ampuh\", \"banget\", \"untuk\", \"mencerahkan\", \"teksturnya\", \"light\", \"gampang\", \"menyerap\", \"aku\", \"pakai\", \"ini\", \"cuma\", \"malem\", \"hari\", \"aja\", \"efek\", \"besok\", \"pagi\", \"kulit\", \"lebih\", \"cerah\", \"dan\", \"mengontrol\", \"kadar\", \"minyak\", \"juga\", \"wajah\", \"cuma\", \"minusnya\", \"aku\", \"awal\", \"pemakaian\", \"muncul\", \"milia\", \"bawah\", \"mata\", \"dan\", \"semingguan\", \"baru\", \"ilang\"]', 'serum ampuh banget untuk mencerahkan teksturnya light gampang menyerap aku pakai ini cuma malem hari aja efek besok pagi kulit lebih cerah dan mengontrol kadar minyak juga wajah cuma minusnya aku awal pemakaian muncul milia bawah mata dan semingguan baru ilang', '\"serum ampuh banget mencerahkan teksturnya light gampang menyerap pakai malem aja efek besok pagi kulit cerah mengontrol kadar minyak wajah minusnya pemakaian muncul milia mata semingguan ilang\"', 'serum ampuh banget cerah tekstur light gampang serap pakai malem aja efek besok pagi kulit cerah kontrol kadar minyak wajah minus pakai muncul milia mata minggu ilang', 'Negatif', '2024-11-