(255, 'wind1403', 'Ceramide tuh kayaknya udah ga asing banget sama pemilik kulit kering, sebenarnya apa sih ceramide itu? Ceramide adalah sejenis asam lemak yang sebenarnya secara alami sudah ada dalam sel kulit manusia. Ceramide itu bernama lipid yang membentuk 50% lapisan kulit terluar kita yang biasa kita sebut epidermis. Salah satu manfaatnya adalah melindungi lapisan penghalang kulit dari paparan radikal bebas yang berpotensi merusak kulit atau yang biasa kita sebut skin barrier. 7X Ceramide Moisturizer ini cocok banget sama kebutuhan kulitku, karena seperti yang kalian tahu kalau salah satu tanda skin barrier yang rusak adalah adalah kulit kering dan berjerawat. Nah SCARLETT Whitening 7X Ceramide Barrier Up Moisturizer ini membantu memperbaiki skin barrier, melembapkan dan menghaluskan kulit, juga membantu meratakan warna kulit wajah.', 'ceramide tuh kayaknya udah ga asing banget sama pemilik kulit kering, sebenarnya apa sih ceramide itu? ceramide adalah sejenis asam lemak yang sebenarnya secara alami sudah ada dalam sel kulit manusia. ceramide itu bernama lipid yang membentuk 50% lapisan kulit terluar kita yang biasa kita sebut epidermis. salah satu manfaatnya adalah melindungi lapisan penghalang kulit dari paparan radikal bebas yang berpotensi merusak kulit atau yang biasa kita sebut skin barrier. 7x ceramide moisturizer ini cocok banget sama kebutuhan kulitku, karena seperti yang kalian tahu kalau salah satu tanda skin barrier yang rusak adalah adalah kulit kering dan berjerawat. nah scarlett whitening 7x ceramide barrier up moisturizer ini membantu memperbaiki skin barrier, melembapkan dan menghaluskan kulit, juga membantu meratakan warna kulit wajah.', 'ceramide tuh kayaknya udah ga asing banget sama pemilik kulit kering sebenarnya apa sih ceramide itu ceramide adalah sejenis asam lemak yang sebenarnya secara alami sudah ada dalam sel kulit manusia ceramide itu bernama lipid yang membentuk lapisan kulit terluar kita yang biasa kita sebut epidermis salah satu manfaatnya adalah melindungi lapisan penghalang kulit dari paparan radikal bebas yang berpotensi merusak kulit atau yang biasa kita sebut skin barrier x ceramide moisturizer ini cocok banget sama kebutuhan kulitku karena seperti yang kalian tahu kalau salah satu tanda skin barrier yang rusak adalah adalah kulit kering dan berjerawat nah scarlett whitening x ceramide barrier up moisturizer ini membantu memperbaiki skin barrier melembapkan dan menghaluskan kulit juga membantu meratakan warna kulit wajah', '[\"ceramide\", \"tuh\", \"kayaknya\", \"udah\", \"asing\", \"banget\", \"sama\", \"pemilik\", \"kulit\", \"kering\", \"sebenarnya\", \"apa\", \"sih\", \"ceramide\", \"itu\", \"ceramide\", \"adalah\", \"sejenis\", \"asam\", \"lemak\", \"yang\", \"sebenarnya\", \"secara\", \"alami\", \"sudah\", \"ada\", \"dalam\", \"sel\", \"kulit\", \"manusia\", \"ceramide\", \"itu\", \"bernama\", \"lipid\", \"yang\", \"membentuk\", \"lapisan\", \"kulit\", \"terluar\", \"kita\", \"yang\", \"biasa\", \"kita\", \"sebut\", \"epidermis\", \"salah\", \"satu\", \"manfaatnya\", \"adalah\", \"melindungi\", \"lapisan\", \"penghalang\", \"kulit\", \"dari\", \"paparan\", \"radikal\", \"bebas\", \"yang\", \"berpotensi\", \"merusak\", \"kulit\", \"atau\", \"yang\", \"biasa\", \"kita\", \"sebut\", \"skin\", \"barrier\", \"ceramide\", \"moisturizer\", \"ini\", \"cocok\", \"banget\", \"sama\", \"kebutuhan\", \"kulitku\", \"karena\", \"seperti\", \"yang\", \"kalian\", \"tahu\", \"kalau\", \"salah\", \"satu\", \"tanda\", \"skin\", \"barrier\", \"yang\", \"rusak\", \"adalah\", \"adalah\", \"kulit\", \"kering\", \"dan\", \"berjerawat\", \"nah\", \"scarlett\", \"whitening\", \"ceramide\", \"barrier\", \"moisturizer\", \"ini\", \"membantu\", \"memperbaiki\", \"skin\", \"barrier\", \"melembapkan\", \"dan\", \"menghaluskan\", \"kulit\", \"juga\", \"membantu\", \"meratakan\", \"warna\", \"kulit\", \"wajah\"]', 'ceramide tuh kayaknya udah asing banget sama pemilik kulit kering sebenarnya apa sih ceramide 