(256, 'firyalane', 'Walaupun kecil tapi dia sesuai klaimnya. Selama pemakaian kondisi kulitku lebih cerah. Jerawat dan beruntusan ga muncul lagi ampuh buat skinbarier. Kemasannya kecil ga abisin tempat di pouch, aman dibawa travel. Teksturnya creamy to gel tapi cepet kok meresapnya. Aku rekomendasi bagi kalian yg butuh buat mencerahkan kulit dan memperkuat skinbarier wajib coba sih', 'walaupun kecil tapi dia sesuai klaimnya. selama pemakaian kondisi kulitku lebih cerah. jerawat dan beruntusan ga muncul lagi ampuh buat skinbarier. kemasannya kecil ga abisin tempat di pouch, aman dibawa travel. teksturnya creamy to gel tapi cepet kok meresapnya. aku rekomendasi bagi kalian yg butuh buat mencerahkan kulit dan memperkuat skinbarier wajib coba sih', 'walaupun kecil tapi dia sesuai klaimnya selama pemakaian kondisi kulitku lebih cerah jerawat dan beruntusan ga muncul lagi ampuh buat skinbarier kemasannya kecil ga abisin tempat di pouch aman dibawa travel teksturnya creamy to gel tapi cepet kok meresapnya aku rekomendasi bagi kalian yg butuh buat mencerahkan kulit dan memperkuat skinbarier wajib coba sih', '[\"walaupun\", \"kecil\", \"tapi\", \"dia\", \"sesuai\", \"klaimnya\", \"selama\", \"pemakaian\", \"kondisi\", \"kulitku\", \"lebih\", \"cerah\", \"jerawat\", \"dan\", \"beruntusan\", \"muncul\", \"lagi\", \"ampuh\", \"buat\", \"skinbarier\", \"kemasannya\", \"kecil\", \"abisin\", \"tempat\", \"pouch\", \"aman\", \"dibawa\", \"travel\", \"teksturnya\", \"creamy\", \"gel\", \"tapi\", \"cepet\", \"kok\", \"meresapnya\", \"aku\", \"rekomendasi\", \"bagi\", \"kalian\", \"butuh\", \"buat\", \"mencerahkan\", \"kulit\", \"dan\", \"memperkuat\", \"skinbarier\", \"wajib\", \"coba\", \"sih\"]', 'walaupun kecil tapi dia sesuai klaimnya selama pemakaian kondisi kulitku lebih cerah jerawat dan beruntusan muncul lagi ampuh buat skinbarier kemasannya kecil abisin tempat pouch aman dibawa travel teksturnya creamy gel tapi cepet kok meresapnya aku rekomendasi bagi kalian butuh buat menc