(273, 'Septiwln_', 'Setelah semingguan lebih pakai emang agak lebih cerah, terbukti di punggung tanganku dan kaki. Soalnya aku ambil gak cuma 2-3pump biar sisa banyak trus dioles ke tangan dan kaki. Cuma bekas jerawat masih bandel aja, tapi selama semingguan pakai ini emang jerawat gak ada yg nongol. Tekturnya gel warna kuning pekat, gampang meresap dan gak lengket. Pumpnya kokoh dan canggih, semakin banyak yg di pakai maka si produk semakin naik. First time pakai produk dari brand ini. Sebenarnya agak takut sih. Entah cuma aku doang atau ada temennya. Pertama pakai,bau yang tercium amat sangat tidak enak, too strong, dan sangat mengganggu. Pemakaian berikut, baunya tidak sekuat pada saat pertama kali. Kalau suruh pilih, mending cari produk lain sih.', 'setelah semingguan lebih pakai emang agak lebih cerah, terbukti di punggung tanganku dan kaki. soalnya aku ambil gak cuma 2-3pump biar sisa banyak trus dioles ke tangan dan kaki. cuma bekas jerawat masih bandel aja, tapi selama semingguan pakai ini emang jerawat gak ada yg nongol. tekturnya gel warna kuning pekat, gampang meresap dan gak lengket. pumpnya kokoh dan canggih, semakin banyak yg di pakai maka si produk semakin naik. first time pakai produk dari brand ini. sebenarnya agak takut sih. entah cuma aku doang atau ada temennya. pertama pakai,bau yang tercium amat sangat tidak enak, too strong, dan sangat mengganggu. pemakaian berikut, baunya tidak sekuat pada saat pertama kali. kalau suruh pilih, mending cari produk lain sih.', 'setelah semingguan lebih pakai emang agak lebih cerah terbukti di punggung tanganku dan kaki soalnya aku ambil gak cuma pump biar sisa banyak trus dioles ke tangan dan kaki cuma bekas jerawat masih bandel aja tapi selama semingguan pakai ini emang jerawat gak ada yg nongol tekturnya gel warna kuning pekat gampang meresap dan gak lengket pumpnya kokoh dan canggih semakin banyak yg di pakai maka si produk semakin naik first time pakai produk dari brand ini sebenarnya agak takut sih entah c