(297, 'Ita93', 'Di aku lumayan cocok. Bikin cerah. Aku pake yang 5%. Tapu entah napa diwajahku bikin kulit jadi kering. Aku pake pas malem doang. Pagi enggak. Cuma ya mau naik ke yang 10% aku takut nanti malah kering. Jadi ya mikir\" dulu.. padahal lumayan bikin kulit cerah dan gak kusem. Ini aja udah diakalin pake moisture hydrating merk lain. Bingung antara masih mau lanjut atau enggak. Cocok cerah tapi bikin agak kering. Serba salah :(', 'di aku lumayan cocok. bikin cerah. aku pake yang 5%. tapu entah napa diwajahku bikin kulit jadi kering. aku pake pas malem doang. pagi enggak. cuma ya mau naik ke yang 10% aku takut nanti malah kering. jadi ya mikir\" dulu.. padahal lumayan bikin kulit cerah dan gak kusem. ini aja udah diakalin pake moisture hydrating merk lain. bingung antara masih mau lanjut atau enggak. cocok cerah tapi bikin agak kering. serba salah :(', 'di aku lumayan cocok bikin cerah aku pake yang tapu entah napa diwajahku bikin kulit jadi kering aku pake pas malem doang pagi enggak cuma ya mau naik ke yang aku takut nanti malah kering jadi ya mikir dulu padahal lumayan bikin kulit cerah dan gak kusem ini aja udah diakalin pake moisture hydrating merk lain bingung antara masih mau lanjut atau enggak cocok cerah tapi bikin agak kering serba salah', '[\"aku\", \"lumayan\", \"cocok\", \"bikin\", \"cerah\", \"aku\", \"pakai\", \"yang\", \"tapu\", \"entah\", \"napa\", \"diwajahku\", \"bikin\", \"kulit\", \"jadi\", \"kering\", \"aku\", \"pakai\", \"pas\", \"malem\", \"doang\", \"pagi\", \"enggak\", \"cuma\", \"mau\", \"naik\", \"yang\", \"aku\", \"takut\", \"nanti\", \"malah\", \"kering\", \"jadi\", \"mikir\", \"dulu\", \"padahal\", \"lumayan\", \"bikin\", \"kulit\", \"cerah\", \"dan\", \"gak\", \"kusem\", \"ini\", \"aja\", \"udah\", \"diakalin\", \"pakai\", \"moisture\", \"hydrating\", \"merk\", \"lain\", \"bingung\", \"antara\", \"masih\", \"mau\", \"lanjut\", \"atau\", \"enggak\", \"cocok\", \"cerah\", \"tapi\", \"bikin\", \"agak\", \"kering\", \"serba\", \