(322, 'ni_sa', 'aku pakai produk scarlet acne series ini cuma day cream dan night cream. di aku sih hasilnya bagus banget nggak, jelek juga nggak. aku pakai produk night cream ini 2 kali per hari (pas abis mandi sore dan pas mau tidur malam). pas bangun tidur hasilnya bikin kulit glowing, bukan glowing kayak tambang minyak yaa. menurutku lebih lembap night cream daripada day cream. untuk mengempeskan jerawat sih butuh waktu selama kurang lebih seminggu, sedangkan untuk menghilangkan bekas jerawat masih butuh waktu yg lebih lama lagi, mungkin karena aku makainya ga dibarengin sama serum acne nya sih (?). jadi, hingga hari ini hasilnya tu di jidat aku mulus dan kinclong, sedangkan di pipi aku masih terdapat beberapa bekas jerawat walaupun udah jarang jerawatan.untuk ketahanannya, dengan pemakaian acne night cream ini 2 kali per hari selama 1 setengah bulan sisanya tinggal 3/4 jar (btw, aku beli produk ini kemasan share in jar 10gr), lumayanlah. kayaknya besok aku akan repurchase produk ini lagi karena lagi males gonta ganti produk, sangat menghemat pengeluaran hehe?❤', 'aku pakai produk scarlet acne series ini cuma day cream dan night cream. di aku sih hasilnya bagus banget nggak, jelek juga nggak. aku pakai produk night cream ini 2 kali per hari (pas abis mandi sore dan pas mau tidur malam). pas bangun tidur hasilnya bikin kulit glowing, bukan glowing kayak tambang minyak yaa. menurutku lebih lembap night cream daripada day cream. untuk mengempeskan jerawat sih butuh waktu selama kurang lebih seminggu, sedangkan untuk menghilangkan bekas jerawat masih butuh waktu yg lebih lama lagi, mungkin karena aku makainya ga dibarengin sama serum acne nya sih (?). jadi, hingga hari ini hasilnya tu di jidat aku mulus dan kinclong, sedangkan di pipi aku masih terdapat beberapa bekas jerawat walaupun udah jarang jerawatan.untuk ketahanannya, dengan pemakaian acne night cream ini 2 kali per hari selama 1 setengah bulan sisanya tinggal 3/4 jar (btw, aku beli produk ini kemasan share 