(323, 'Nurulfaadilah', 'serum niacinamide kecintaan banyak orang? kemasannya lucu bantet gitu, pipet tetes nya bagus ga macet macet dan ada sekat penahannya biar produknya gak meleber. Tekstur serum ini yg 10% agak thick dan tidak berbau, pas di aplikasikan ke wajah cukup cepat menyerap walaupun sedikit lengket. Yang aku rasain setelah habis 2 botol, tone kulit emang agak naik sedikit, untuk melembabkan juga enak kok, cukup meredakan kemerahan karena centella water salah satu ingredient nya. overall baguss dan aku cocok bangett?', 'serum niacinamide kecintaan banyak orang? kemasannya lucu bantet gitu, pipet tetes nya bagus ga macet macet dan ada sekat penahannya biar produknya gak meleber. tekstur serum ini yg 10% agak thick dan tidak berbau, pas di aplikasikan ke wajah cukup cepat menyerap walaupun sedikit lengket. yang aku rasain setelah habis 2 botol, tone kulit emang agak naik sedikit, untuk melembabkan juga enak kok, cukup meredakan kemerahan karena centella water salah satu ingredient nya. overall baguss dan aku cocok bangett?', 'serum niacinamide kecintaan banyak orang kemasannya lucu bantet gitu pipet tetes nya bagus ga macet macet dan ada sekat penahannya biar produknya gak meleber tekstur serum ini yg agak thick dan tidak berbau pas di aplikasikan ke wajah cukup cepat menyerap walaupun sedikit lengket yang aku rasain setelah habis botol tone kulit emang agak naik sedikit untuk melembabkan juga enak kok cukup meredakan kemerahan karena centella water salah satu ingredient nya overall baguss dan aku cocok bangett', '[\"serum\", \"niacinamide\", \"kecintaan\", \"banyak\", \"orang\", \"kemasannya\", \"lucu\", \"bantet\", \"gitu\", \"pipet\", \"tetes\", \"nya\", \"bagus\", \"macet\", \"macet\", \"dan\", \"ada\", \"sekat\", \"penahannya\", \"biar\", \"produknya\", \"gak\", \"meleber\", \"tekstur\", \"serum\", \"ini\", \"agak\", \"thick\", \"dan\", \"tidak\", \"berbau\", \"pas\", \"aplikasikan\", \"wajah\", \"cukup\", \"cepat\", \"menyerap\", \"walaupun\", \"sedi