(330, 'stefanimeyliana', 'Wah Scarlett ngeluarin Toner nya donkkkk✨,. Didalam Scarlett Acne Essence Toner ini terdapat kandungan Zinc Sebum, Green Tea Water, Tea Tree Water, Phyto Squalane, Mugwort Hydrosol, Vitamin C, Ginkgo Extract, Succinic Acid, dan Gluconolactone yang bermanfaat untuk:Meminimalkan kemerahan pada kulitMerawat kulit berjerawatMenghidrasi kulitMeningkatkan produksi kolagen dan elastisitas kulitMengontrol produksi sebum/minyak pada wajahMengangkat sel kulit mati Memperhalus kulitDi dalam boba atau beads-nya, terdapat kandungan Phyto Squalane yang berfungsi sebagai antiinflamasi atau antiperadangan yang dapat mengurangi kemerahan (redness) dan pembengkakan pada kulit yang sedang berjerawat.', 'wah scarlett ngeluarin toner nya donkkkk✨,. didalam scarlett acne essence toner ini terdapat kandungan zinc sebum, green tea water, tea tree water, phyto squalane, mugwort hydrosol, vitamin c, ginkgo extract, succinic acid, dan gluconolactone yang bermanfaat untuk:meminimalkan kemerahan pada kulitmerawat kulit berjerawatmenghidrasi kulitmeningkatkan produksi kolagen dan elastisitas kulitmengontrol produksi sebum/minyak pada wajahmengangkat sel kulit mati memperhalus kulitdi dalam boba atau beads-nya, terdapat kandungan phyto squalane yang berfungsi sebagai antiinflamasi atau antiperadangan yang dapat mengurangi kemerahan (redness) dan pembengkakan pada kulit yang sedang berjerawat.', 'wah scarlett ngeluarin toner nya donkkkk didalam scarlett acne essence toner ini terdapat kandungan zinc sebum green tea water tea tree water phyto squalane mugwort hydrosol vitamin c ginkgo extract succinic acid dan gluconolactone yang bermanfaat untukmeminimalkan kemerahan pada kulitmerawat kulit berjerawatmenghidrasi kulitmeningkatkan produksi kolagen dan elastisitas kulitmengontrol produksi sebumminyak pada wajahmengangkat sel kulit mati memperhalus kulitdi dalam boba atau beadsnya terdapat kandungan phyto squalane yang berfungsi sebagai antiinflamasi atau antiperadangan yang dapat mengurangi kemerahan dan pembengkakan pada kulit yang sedang berjerawat', '[\"wah\", \"scarlett\", \"ngeluarin\", \"toner\", \"nya\", \"donkkkk\", \"didalam\", \"scarlett\", \"acne\", \"essence\", \"toner\", \"ini\", \"terdapat\", \"kandungan\", \"zinc\", \"sebum\", \"green\", \"tea\", \"water\", \"tea\", \"tree\", \"water\", \"phyto\", \"squalane\", \"mugwort\", \"hydrosol\", \"vitamin\", \"ginkgo\", \"extract\", \"succinic\", \"acid\", \"dan\", \"gluconolactone\", \"yang\", \"bermanfaat\", \"untukmeminimalkan\", \"kemerahan\", \"pada\", \"kulitmerawat\", \"kulit\", \"berjerawatmenghidrasi\", \"kulitmeningkatkan\", \"produksi\", \"kolagen\", \"dan\", \"elastisitas\", \"kulitmengontrol\", \"produksi\", \"sebumminyak\", \"pada\", \"wajahmengangkat\", \"sel\", \"kulit\", \"mati\", \"memperhalus\", \"kulitdi\", \"dalam\", \"boba\", \"atau\", \"beadsnya\", \"terdapat\", \"kandungan\", \"phyto\", \"squalane\", \"yang\", \"berfungsi\", \"sebagai\", \"antiinflamasi\", \"atau\", \"antiperadangan\", \"yang\", \"dapat\", \"mengurangi\", \"kemerahan\", \"dan\", \"pembengkakan\", \"pada\", \"kulit\", \"yang\", \"sedang\", \"berjerawat\"]', 'wah scarlett ngeluarin toner nya donkkkk didalam scarlett acne essence toner ini terdapat kandungan zinc sebum green tea water tea tree water phyto squalane mugwort hydrosol vitamin ginkgo extract succinic acid dan gluconolactone yang bermanfaat untukmeminimalkan kemerahan pada kulitmerawat kulit berjerawatmenghidrasi kulitmeningkatkan produksi kolagen dan elastisitas kulitmengontrol produksi sebumminyak pada wajahmengangkat sel kulit mati memperhalus kulitdi dalam boba atau beadsnya terdapat kandungan phyto squalane yang berfungsi sebagai antiinflamasi atau antiperadangan yang dapat mengurangi kemerahan dan pembengkakan pada kulit yang sedang berjerawat', '\"scarlett ngeluarin toner nya donkkkk didalam scarlett acne essence toner kandungan zinc sebum green tea water tea tree water phyto squalane mugwort hydrosol vitamin ginkgo extrac