(339, 'yuliamaulidina', 'Packagingnya hadir dengan botol berwarna pink namun bening, sedang tutupnya berwarna putih bening yang sangat rapat. Botolnya berukuran 100 ml dan juga disertai dengan box berwarna putih dan pink. Oh iya untuk tonernya ini menggunakan pump yaaaTeksturnya berwarna bening sangat ringan, menurut aku cukup watery juga dan cocok dipakai untuk CSMan. Di dalam botolnya itu ada beads berwarna pink muda.Wanginya menurut aku ini agak sedikit wangi floral tapi tipis dan soft banget walaupun masih cukup bisa tercium.Untuk kelembabannya menurut aku sedang, bukan tipe toner yang benar-benar melembabkan, tapi nilai plusnya dia jadi enggak terlalu bikin sumuk atau gerah, dan untuk yang kulitnya oily juga masih oke banget. Menyerapnya juga cukup cepat, jadi nggak perlu lama-lama untuk lanjut step berikutnya.', 'packagingnya hadir dengan botol berwarna pink namun bening, sedang tutupnya berwarna putih bening yang sangat rapat. botolnya berukuran 100 ml dan juga disertai dengan box berwarna putih dan pink. oh iya untuk tonernya ini menggunakan pump yaaateksturnya berwarna bening sangat ringan, menurut aku cukup watery juga dan cocok dipakai untuk csman. di dalam botolnya itu ada beads berwarna pink muda.wanginya menurut aku ini agak sedikit wangi floral tapi tipis dan soft banget walaupun masih cukup bisa tercium.untuk kelembabannya menurut aku sedang, bukan tipe toner yang benar-benar melembabkan, tapi nilai plusnya dia jadi enggak terlalu bikin sumuk atau gerah, dan untuk yang kulitnya oily juga masih oke banget. menyerapnya juga cukup cepat, jadi nggak perlu lama-lama untuk lanjut step berikutnya.', 'packagingnya hadir dengan botol berwarna pink namun bening sedang tutupnya berwarna putih bening yang sangat rapat botolnya berukuran ml dan juga disertai dengan box berwarna putih dan pink oh iya untuk tonernya ini menggunakan pump yaaateksturnya berwarna bening sangat ringan menurut aku cukup watery juga dan cocok dipakai untuk csman di dalam botolnya itu ada