(340, 'nabilrina10', 'Serum ini mengandung WhiteCellDNA 10%, Niacinamide 5%, and Nano White 2% yang dapat menyamarkan noda hitam dan bekas jerawat, mencerahkan kulit dalam waktu 7 hari. Produk ini 7,2% lebih efektif dan 3,3x lebih tidak membuat iritasi dibandingkan hydroquine. Hasilnya kulit menjadi lebih lembap dan bercahaya bahkan noda hitam berkurang dalam waktu cepat. Produk ini cocok untuk semua jenis kulit. Tekstur serumnya seperti  sangat ringan dan mudah menyerap dikulit. Warnanya kuning dan berkilau gitu. Untuk packagingnya premium gitu dengan isi produk 15 ml. Kekurangan produk ini hanya pada baunya yang kurang begitu mengenakan. Sisanya sudah bagus bgt.', 'serum ini mengandung whitecelldna 10%, niacinamide 5%, and nano white 2% yang dapat menyamarkan noda hitam dan bekas jerawat, mencerahkan kulit dalam waktu 7 hari. produk ini 7,2% lebih efektif dan 3,3x lebih tidak membuat iritasi dibandingkan hydroquine. hasilnya kulit menjadi lebih lembap dan bercahaya bahkan noda hitam berkurang dalam waktu cepat. produk ini cocok untuk semua jenis kulit. tekstur serumnya seperti  sangat ringan dan mudah menyerap dikulit. warnanya kuning dan berkilau gitu. untuk packagingnya premium gitu dengan isi produk 15 ml. kekurangan produk ini hanya pada baunya yang kurang begitu mengenakan. sisanya sudah bagus bgt.', 'serum ini mengandung whitecelldna niacinamide and nano white yang dapat menyamarkan noda hitam dan bekas jerawat mencerahkan kulit dalam waktu hari produk ini lebih efektif dan x lebih tidak membuat iritasi dibandingkan hydroquine hasilnya kulit menjadi lebih lembap dan bercahaya bahkan noda hitam berkurang dalam waktu cepat produk ini cocok untuk semua jenis kulit tekstur serumnya seperti sangat ringan dan mudah menyerap dikulit warnanya kuning dan berkilau gitu untuk packagingnya premium gitu dengan isi produk ml kekurangan produk ini hanya pada baunya yang kurang begitu mengenakan sisanya sudah bagus bgt', '[\"serum\", \"ini\", \"mengandung\", \"whitecelldna\