(343, 'deltariska', 'awal pakai ini agak lengket tapi ternyata ga mengganggu di pemakaian selanjutnya. Selain itu, serum ini ga ada baunya, cepat menyerap, ringan, dan efek mencerahkannya keliatan dalam 1 bulan pemakaian. Tapi mencerahkan secara keseluruhan saja sih ya, bukan yang menghilangkan dark spot (at least dalam 1 bulan pemakaian). Overall, recommended!', 'awal pakai ini agak lengket tapi ternyata ga mengganggu di pemakaian selanjutnya. selain itu, serum ini ga ada baunya, cepat menyerap, ringan, dan efek mencerahkannya keliatan dalam 1 bulan pemakaian. tapi mencerahkan secara keseluruhan saja sih ya, bukan yang menghilangkan dark spot (at least dalam 1 bulan pemakaian). overall, recommended!', 'awal pakai ini agak lengket tapi ternyata ga mengganggu di pemakaian selanjutnya selain itu serum ini ga ada baunya cepat menyerap ringan dan efek mencerahkannya keliatan dalam bulan pemakaian tapi mencerahkan secara keseluruhan saja sih ya bukan yang menghilangkan dark spot overall recommended', '[\"awal\", \"pakai\", \"ini\", \"agak\", \"lengket\", \"tapi\", \"ternyata\", \"mengganggu\", \"pemakaian\", \"selanjutnya\", \"selain\", \"itu\", \"serum\", \"ini\", \"ada\", \"baunya\", \"cepat\", \"menyerap\", \"ringan\", \"dan\", \"efek\", \"mencerahkannya\", \"keliatan\", \"dalam\", \"bulan\", \"pemakaian\", \"tapi\", \"mencerahkan\", \"secara\", \"keseluruhan\", \"saja\", \"sih\", \"bukan\", \"yang\", \"menghilangkan\", \"dark\", \"spot\", \"overall\", \"recommended\"]', 'awal pakai ini agak lengket tapi ternyata mengganggu pemakaian selanjutnya selain itu serum ini ada baunya cepat menyerap ringan dan efek mencerahkannya keliatan dalam bulan pemakaian tapi mencerahkan secara keseluruhan saja sih bukan yang menghilangkan dark spot overall recommended', '\"pakai lengket mengganggu pemakaian serum baunya cepat menyerap ringan efek mencerahkannya keliatan pemakaian mencerahkan sih menghilangkan dark spot overall recommended\"', 'pakai lengket ganggu pakai serum bau cepat