(345, 'nailaslsbila', 'Dari segi tekstur enak ya, watery, gampang diblend, ringan bgt, dan gak whitecast pdhl hybrid sunscreen, tp kyknya lbh banyak kandungan komposisi chemical drpd mineralnya soalnya di kemasan yg ketulis pertama tu yg chemical. Baunya aku kurang suka kyk bau obat (?) . After pemakaian muka kyk glow becek, dan menurutku kurang cocok kl mau dipake pergi cpt soalnya mesti nunggu kering dl. Proteksinya lumayan tinggi, tp sygnya waktu pake ini cuaca di makassar (sampai saat aku nulis ini) lg hujan mendung gak nentu jd gak bs tes kl teriknya makassar belang apa gak. Bumil friendly ceunah tp 13 weeks keatas dan konsul ke dokter dl. Minusnya kl udh lama dipake dia pilling kyk daki tp keluarnya kl digosok, jd kl mau retouch mesti dibilas dl deh. Sebenernya agak underestimate ya soalnya kyk too good to be true dgn tekstur seperti ini tp hybrid dan spfnya tinggi ?', 'dari segi tekstur enak ya, watery, gampang diblend, ringan bgt, dan gak whitecast pdhl hybrid sunscreen, tp kyknya lbh banyak kandungan komposisi chemical drpd mineralnya soalnya di kemasan yg ketulis pertama tu yg chemical. baunya aku kurang suka kyk bau obat (?) . after pemakaian muka kyk glow becek, dan menurutku kurang cocok kl mau dipake pergi cpt soalnya mesti nunggu kering dl. proteksinya lumayan tinggi, tp sygnya waktu pake ini cuaca di makassar (sampai saat aku nulis ini) lg hujan mendung gak nentu jd gak bs tes kl teriknya makassar belang apa gak. bumil friendly ceunah tp 13 weeks keatas dan konsul ke dokter dl. minusnya kl udh lama dipake dia pilling kyk daki tp keluarnya kl digosok, jd kl mau retouch mesti dibilas dl deh. sebenernya agak underestimate ya soalnya kyk too good to be true dgn tekstur seperti ini tp hybrid dan spfnya tinggi ?', 'dari segi tekstur enak ya watery gampang diblend ringan bgt dan gak whitecast pdhl hybrid sunscreen tp kyknya lbh banyak kandungan komposisi chemical drpd mineralnya soalnya di kemasan yg ketulis pertama tu yg chemical baunya aku kurang suka kyk