(348, 'winda_julianti', 'HONEST REVIEW: kebetulan bulan ini skinker dan bodycareku habisnya barengan... jd jatah beli serum kubeli no sekian wkwk... alhamdulillahnya dpt FD TnR serum MS GLOW WHITE CELL DNA ini ? dan aku pertama kali bgt coba produknya MS GLOW dan langsung jatuh cinta... packagingnya gold mevvah gt... kontras dan pas bgt sm warna serumnya... texturenya kental, licin tp gak sticky... agak lama menyerapnya sih tp kalo dah menyerap tuh ringan gabikin berat diwajah... tp ku agak terganggu sedikit dg wanginya yg kurang ramah dicium sih... aku pake ini pagi dan malam hari... jerawat cpt kering dan cpt kempes jg... claim mencerahkan dlm 7 hari terbukti sih krn orang2 sekelilingku bilang wajahku bersihan dan noda hitam bekas jerawatnya berkurang ?? kayanya aku mau terus lanjut pake serumnya deh ?✨', 'honest review: kebetulan bulan ini skinker dan bodycareku habisnya barengan... jd jatah beli serum kubeli no sekian wkwk... alhamdulillahnya dpt fd tnr serum ms glow white cell dna ini ? dan aku pertama kali bgt coba produknya ms glow dan langsung jatuh cinta... packagingnya gold mevvah gt... kontras dan pas bgt sm warna serumnya... texturenya kental, licin tp gak sticky... agak lama menyerapnya sih tp kalo dah menyerap tuh ringan gabikin berat diwajah... tp ku agak terganggu sedikit dg wanginya yg kurang ramah dicium sih... aku pake ini pagi dan malam hari... jerawat cpt kering dan cpt kempes jg... claim mencerahkan dlm 7 hari terbukti sih krn orang2 sekelilingku bilang wajahku bersihan dan noda hitam bekas jerawatnya berkurang ?? kayanya aku mau terus lanjut pake serumnya deh ?✨', 'honest review kebetulan bulan ini skinker dan bodycareku habisnya barengan jd jatah beli serum kubeli no sekian wkwk alhamdulillahnya dpt fd tnr serum ms glow white cell dna ini dan aku pertama kali bgt coba produknya ms glow dan langsung jatuh cinta packagingnya gold mevvah gt kontras dan pas bgt sm warna serumnya texturenya kental licin tp gak sticky agak lama menyerapnya sih tp kalo dah menyerap tuh ringan gabikin berat diwajah tp ku agak terganggu sedikit dg wanginya yg kurang ramah dicium sih aku pake ini pagi dan malam hari jerawat cpt kering dan cpt kempes jg claim mencerahkan dlm hari terbukti sih krn orang sekelilingku bilang wajahku bersihan dan noda hitam bekas jerawatnya berkurang kayanya aku mau terus lanjut pake serumnya deh', '[\"honest\", \"review\", \"kebetulan\", \"bulan\", \"ini\", \"skinker\", \"dan\", \"bodycareku\", \"habisnya\", \"barengan\", \"jatah\", \"beli\", \"serum\", \"kubeli\", \"sekian\", \"wkwk\", \"alhamdulillahnya\", \"dpt\", \"tnr\", \"serum\", \"glow\", \"white\", \"cell\", \"dna\", \"ini\", \"dan\", \"aku\", \"pertama\", \"kali\", \"bgt\", \"coba\", \"produknya\", \"glow\", \"dan\", \"langsung\", \"jatuh\", \"cinta\", \"packagingnya\", \"gold\", \"mevvah\", \"kontras\", \"dan\", \"pas\", \"bgt\", \"warna\", \"serumnya\", \"texturenya\", \"kental\", \"licin\", \"gak\", \"sticky\", \"agak\", \"lama\", \"menyerapnya\", \"sih\", \"kalo\", \"dah\", \"menyerap\", \"tuh\", \"ringan\", \"gabikin\", \"berat\", \"diwajah\", \"agak\", \"terganggu\", \"sedikit\", \"wanginya\", \"kurang\", \"ramah\", \"dicium\", \"sih\", \"aku\", \"pakai\", \"ini\", \"pagi\", \"dan\", \"malam\", \"hari\", \"jerawat\", \"cpt\", \"kering\", \"dan\", \"cpt\", \"kempes\", \"claim\", \"mencerahkan\", \"dlm\", \"hari\", \"terbukti\", \"sih\", \"krn\", \"orang\", \"sekelilingku\", \"bilang\", \"wajahku\", \"bersihan\", \"dan\", \"noda\", \"hitam\", \"bekas\", \"jerawatnya\", \"berkurang\", \"kayanya\", \"aku\", \"mau\", \"terus\", \"lanjut\", \"pakai\", \"serumnya\", \"deh\"]', 'honest review kebetulan bulan ini skinker dan bodycareku habisnya barengan jatah beli serum kubeli sekian wkwk alhamdulillahnya dpt tnr serum glow white cell dna ini dan aku pertama kali bgt coba produknya glow dan langsung jatuh cinta packagingnya gold mevvah kontras dan pas bgt warna serumnya texturenya kental licin gak sticky agak lama menyerapnya sih kalo dah menyerap tuh ringan gabikin berat diwajah agak terganggu sedikit wanginya kurang ramah dicium sih aku pakai ini pagi dan malam hari jerawat cpt kering dan cpt kempes claim mencerahkan dlm hari terbukti sih krn orang sekelilingku bilang wajahku bersihan dan noda hitam bekas jerawatnya berkurang kayanya aku mau terus lanjut pakai serumnya deh', '\"honest review skinker bodycareku habisnya barengan jatah beli serum kubeli sekian wkwk alhamdulillahnya dpt tnr serum glow white cell dna kali bgt coba produknya glow langsung jatuh cinta packagingnya gold mevvah kontras pas bgt warna serumnya texturenya kental licin gak sticky menyerapnya sih kalo dah menyerap tuh ringan gabikin berat diwajah terganggu wanginya ramah dicium sih pakai pagi malam jerawat cpt kering cpt kempes claim mencerahkan dlm terbukti sih krn orang sekelilingku bilang wajahku bersihan noda hitam bekas jerawatnya berkurang kayanya pakai serumnya deh\"', 'honest review skinker bodycareku habis bareng jatah beli serum bel sekian wkwk alhamdulillah dpt tnr serum glow white cell dna kali bgt coba produk glow langsung jatuh cinta packagingnya gold mevvah kontras pas bgt warna serum texturenya kental licin gak sticky serap sih kalo dah serap tuh ringan gabikin berat wajah ganggu wangi ramah cium sih pakai pagi malam jerawat cpt kering cpt kempes claim cerah dlm bukti sih krn orang keliling bilang wajah sih noda hitam bekas jerawat kurang kaya pakai serum deh', 'Negatif', '2024-11-29 06:44:46', '2024-11-29 06:44:46', NULL),
(349, 'Dev_listiana', 'Serum somethinc pertama aku, packaging nya kaca tebel gitu jadi gak takut pecah, Pipit nya mudah untuk ambil serum nya, teksturnya agak kental, mudah meresap, gak lengket sama sekali, bagus buat skincarean pagi dan malam. Ini penolong muka aku yang benar-benar breakout semuka-muka, karena skincare yang aku cobain waktu itu ingredients nya gak cocok di tipe muka aku. Setelah 3hari jerawat breakout aku udah mulai layu, dan udah gak berasa panas, gatal, dan pedih, setelah 1minggu jerawat di muka udh tinggal bekas nya aja, abis dua botol muka q udah kembali lagi kaya semula, bekas jerawat breakout pun udh bersih. secinta itu aku sama serum somethinc. rekomended banget buat yg lagi breakout, cobain serum ini .?', 'serum somethinc pertama aku, packaging nya kaca tebel gitu jadi gak takut pecah, pipit nya mudah untuk ambil serum nya, teksturnya agak kental, mudah meresap, gak lengket sama sekali, bagus buat skincarean pagi dan malam. ini penolong muka aku yang benar-benar breakout semuka-muka, karena skincare yang aku cobain waktu itu ingredients nya gak cocok di tipe muka aku. setelah 3hari jerawat breakout aku udah mulai layu, dan udah gak berasa panas, gatal, dan pedih, setelah 1minggu jerawat di muka udh tinggal bekas nya aja, abis dua botol muka q udah kembali lagi kaya semula, bekas jerawat breakout pun udh bersih. secinta itu aku sama serum somethinc. rekomended banget buat yg lagi breakout, cobain serum ini .?', 'serum somethinc pertama aku packaging nya kaca tebel gitu jadi gak takut pecah pipit nya mudah untuk ambil serum nya teksturnya agak kental mudah meresap gak lengket sama sekali bagus buat skincarean pagi dan malam ini penolong muka aku yang benarbenar breakout semukamuka karena skincare yang aku cobain waktu itu ingredients nya gak cocok di tipe muka aku setelah hari jerawat breakout aku udah mulai layu dan udah gak berasa panas gatal dan pedih setelah minggu jerawat di muka udh tinggal bekas nya aja abis dua botol muka q udah kembali lagi kaya semula bekas jerawat breakout pun udh bersih secinta itu aku sama serum somethinc rekomended banget buat yg lagi breakout cobain serum ini', '[\"serum\", \"somethinc\", \"pertama\", \"aku\", \"packaging\", \"nya\", \"kaca\", \"tebel\", \"gitu\", \"jadi\", \"gak\", \"takut\", \"pecah\", \"pipit\", \"nya\", \"mudah\", \"untuk\", \"ambil\", \"serum\", \"nya\", \"teksturnya\", \"agak\", \"kental\", \"mudah\", \"meresap\", \"gak\", \"lengket\", \"sama\", \"sekali\", \"bagus\", \"buat\", \"skincarean\", \"pagi\", \"dan\", \"malam\", \"ini\", \"penolong\", \"muka\", \"aku\", \"yang\", \"benarbenar\", \"breakout\", \"semukamuka\", \"karena\", \"skincare\", \"yang\", \"aku\", \"cobain\", \"waktu\", \"itu\", \"ingredients\", \"nya\", \"gak\", \"cocok\", \"tipe\", \"muka\", \"aku\", \"setelah\", \"hari\", \"jerawat\", \"breakout\", \"aku\", \"udah\", \"mulai\", \"layu\", \"dan\", \"udah\", \"gak\", \"berasa\", \"panas\", \"gatal\", \"dan\", \"pedih\", \"setelah\", \"minggu\", \"jerawat\", \"muka\", \"sudah\", \"tinggal\", \"bekas\", \"nya\", \"aja\", \"abis\", \"dua\", \"botol\", \"muka\", \"udah\", \"kembali\", \"lagi\", \"kaya\", \"semula\", \"bekas\", \"jerawat\", \"breakout\", \"pun\", \"sudah\", \"bersih\", \"secinta\", \"itu\", \"aku\", \"sama\", \"serum\", \"somethinc\", \"rekomended\", \"banget\", \"buat\", \"lagi\", \"breakout\", \"cobain\", \"serum\", \"ini\"]', 'serum somethinc pertama aku packaging nya kaca tebel gitu jadi gak takut pecah pipit nya mudah untuk ambil serum nya teksturnya agak kental mudah meresap gak lengket sama sekali bagus buat skincarean pagi dan malam ini penolong muka aku yang benarbenar breakout semukamuka karena skincare yang aku cobain waktu itu ingredients nya gak cocok tipe muka aku setelah hari jerawat breakout aku udah mulai layu dan udah gak berasa panas gatal dan pedih setelah minggu jerawat muka sudah tinggal bekas nya aja abis dua botol muka udah kembali lagi kaya semula bekas jerawat breakout pun sudah bersih secinta itu aku sama serum somethinc rekomended banget buat lagi breakout cobain serum ini', '\"serum somethinc packaging nya kaca tebel gitu gak takut pecah pipit nya mudah ambil serum nya teksturnya kental mudah meresap gak lengket bagus skincarean pagi malam penolong muka benarbenar breakout semukamuka skincare cobain ingredients nya gak cocok tipe muka jerawat breakout udah layu udah gak berasa panas gatal pedih minggu jerawat muka tinggal bekas nya aja abis botol muka udah kaya bekas jerawat breakout bersih secinta serum somethinc rekomended banget breakout cobain serum\"', 'serum somethinc packaging nya kaca tebel gitu gak takut pecah pipit nya mudah ambil serum nya tekstur kental mudah resap gak lengket bagus skincarean pagi malam tolong muka benarbenar breakout semukamuka skincare cobain ingredients nya gak cocok tipe muka jerawat breakout udah layu udah gak asa panas gatal pedih minggu jerawat muka tinggal bekas nya aja abis botol muka udah kaya bekas jerawat breakout bersih cinta serum somethinc rekomended banget breakout cobain serum', 'Negatif', '2024-11-29 06:44:48', '2024-11-29 06:44:48', NULL);
