(350, 'yuliamaulidina', 'Packagingnya hadir dengan jar berbahan kaca yang cukup tebal dengan tutup plastik, ada sekat antara jar dan tutupnya agar produk gak bleber atau tumpah. Desainnya didominasi dengan warna pink dan putih. Kemasannya ini juga hadir bersama box dengan desain serupa. Yang perlu diperhatikan, di sini ada kandungan ethylhexyl methoxycinnamate di urutan kedua list ingredientsnya yang merupakan salah satu kandungan sun protection dengan tipe chemical sunscreen. Hal ini yang membedakan dia dengan night cream-nya. Di pertengahan ingredient list juga ada Titanium dioxide yang juga berfungsi sebagai sun protection. Jadi setelah pakai ini menurut aku sangat dianjurkan untuk double cleansing supaya nggak clogged pores.', 'packagingnya hadir dengan jar berbahan kaca yang cukup tebal dengan tutup plastik, ada sekat antara jar dan tutupnya agar produk gak bleber atau tumpah. desainnya didominasi dengan warna pink dan putih. kemasannya ini juga hadir bersama box dengan desain serupa. yang perlu diperhatikan, di sini ada kandungan ethylhexyl methoxycinnamate di urutan kedua list ingredientsnya yang merupakan salah satu kandungan sun protection dengan tipe chemical sunscreen. hal ini yang membedakan dia dengan night cream-nya. di pertengahan ingredient list juga ada titanium dioxide yang juga berfungsi sebagai sun protection. jadi setelah pakai ini menurut aku sangat dianjurkan untuk double cleansing supaya nggak clogged pores.', 'packagingnya hadir dengan jar berbahan kaca yang cukup tebal dengan tutup plastik ada sekat antara jar dan tutupnya agar produk gak bleber atau tumpah desainnya didominasi dengan warna pink dan putih kemasannya ini juga hadir bersama box dengan desain serupa yang perlu diperhatikan di sini ada kandungan ethylhexyl methoxycinnamate di urutan kedua list ingredientsnya yang merupakan salah satu kandungan sun protection dengan tipe chemical sunscreen hal ini yang membedakan dia dengan night creamnya di pertengahan ingredient list juga ada titanium dioxide yang juga berfungsi sebagai sun protection jadi setelah pakai ini menurut aku sangat dianjurkan untuk double cleansing supaya nggak clogged pores', '[\"packagingnya\", \"hadir\", \"dengan\", \"jar\", \"berbahan\", \"kaca\", \"yang\", \"cukup\", \"tebal\", \"dengan\", \"tutup\", \"plastik\", \"ada\", \"sekat\", \"antara\", \"jar\", \"dan\", \"tutupnya\", \"agar\", \"produk\", \"gak\", \"bleber\", \"atau\", \"tumpah\", \"desainnya\", \"didominasi\", \"dengan\", \"warna\", \"pink\", \"dan\", \"putih\", \"kemasannya\", \"ini\", \"juga\", \"hadir\", \"bersama\", \"box\", \"dengan\", \"desain\", \"serupa\", \"yang\", \"perlu\", \"diperhatikan\", \"sini\", \"ada\", \"kandungan\", \"ethylhexyl\", \"methoxycinnamate\", \"urutan\", \"kedua\", \"list\", \"ingredientsnya\", \"yang\", \"merupakan\", \"salah\", \"satu\", \"kandungan\", \"sun\", \"protection\", \"dengan\", \"tipe\", \"chemical\", \"sunscreen\", \"hal\", \"ini\", \"yang\", \"membedakan\", \"dia\", \"dengan\", \"night\", \"creamnya\", \"pertengahan\", \"ingredient\", \"list\", \"juga\", \"ada\", \"titanium\", \"dioxide\", \"yang\", \"juga\", \"berfungsi\", \"sebagai\", \"sun\", \"protection\", \"jadi\", \"setelah\", \"pakai\", \"ini\", \"menurut\", \"aku\", \"sangat\", \"dianjurkan\", \"untuk\", \"double\", \"cleansing\", \"supaya\", \"nggak\", \"clogged\", \"pores\"]', 'packagingnya hadir dengan jar berbahan kaca yang cukup tebal dengan tutup plastik ada sekat antara jar dan tutupnya agar produk gak bleber atau tumpah desainnya didominasi dengan warna pink dan putih kemasannya ini juga hadir bersama box dengan desain serupa yang perlu diperhatikan sini ada kandungan ethylhexyl methoxycinnamate urutan kedua list ingredientsnya yang merupakan salah satu kandungan sun protection dengan tipe chemical sunscreen hal ini yang membedakan dia dengan night creamnya pertengahan ingredient list juga ada titanium dioxide yang juga berfungsi sebagai sun protection jadi setelah pakai ini menurut aku sangat dianjurkan untuk double cleansing supaya nggak clogged pores', '\"packagingnya hadir jar berbahan kaca tebal tutup plastik sekat jar tutupnya produk gak bleber tumpah desainnya didominasi warna pink putih kemasannya hadir box desain diperhatikan kandungan ethylhexyl methoxycinnamate urutan list ingredientsnya salah kandungan sun protection tipe chemical sunscreen membedakan night creamnya pertengahan ingredient list titanium dioxide berfungsi sun protection pakai dianjurkan double cleansing nggak clogged pores\"', 'packagingnya hadir jar bahan kaca tebal tutup plastik sekat jar tutup produk gak bleber tumpah desain dominasi warna pink putih kemas hadir box desain perhati kandung ethylhexyl methoxycinnamate urut list ingredientsnya salah kandung sun protection tipe chemical sunscreen beda night creamnya tengah ingredient list titanium dioxide fungsi sun protection pakai anjur double cleansing nggak clogged pores', 'Negatif', '2024-11-29 06:44:51', '2024-11-29 06:44:51', NULL),
