(362, 'nicarum27', 'Packaging botol plastik warna putih bening jadi kita bisa liat isi dari produk nya. Tekstur nya gel, ada butiran pink kecil-kecil dan ada rose petal nya. Untuk penggunaan, facial wash ini bukan tipe yang meninggalkan keset setelah cuci muka. Melainkan bikin kulit kita jadi lembab, segar dan gak bikin kulit ketarik. Busa yang di hasilkan juga menurutku cukup yaa, kadang yang gel tuh suka ada yang busa nya dikit heheSi butiran kecil nya gak bikin sakit dan gak mengganggu kok. Bukan tipe yang kasar gitu, jadi ini bisa di pake tiap hari. Kalau aku pemakaian nya pagi dan malam hari.', 'packaging botol plastik warna putih bening jadi kita bisa liat isi dari produk nya. tekstur nya gel, ada butiran pink kecil-kecil dan ada rose petal nya. untuk penggunaan, facial wash ini bukan tipe yang meninggalkan keset setelah cuci muka. melainkan bikin kulit kita jadi lembab, segar dan gak bikin kulit ketarik. busa yang di hasilkan juga menurutku cukup yaa, kadang yang gel tuh suka ada yang busa nya dikit hehesi butiran kecil nya gak bikin sakit dan gak mengganggu kok. bukan tipe yang kasar gitu, jadi ini bisa di pake tiap hari. kalau aku pemakaian nya pagi dan malam hari.', 'packaging botol plastik warna putih bening jadi kita bisa liat isi dari produk nya tekstur nya gel ada butiran pink kecilkecil dan ada rose petal nya untuk penggunaan facial wash ini bukan tipe yang meninggalkan keset setelah cuci muka melainkan bikin kulit kita jadi lembab segar dan gak bikin kulit ketarik busa yang di hasilkan juga menurutku cukup yaa kadang yang gel tuh suka ada yang busa nya dikit hehesi butiran kecil nya gak bikin sakit dan gak mengganggu kok bukan tipe yang kasar gitu jadi ini bisa di pake tiap hari kalau aku pemakaian nya pagi dan malam hari', '[\"packaging\", \"botol\", \"plastik\", \"warna\", \"putih\", \"bening\", \"jadi\", \"kita\", \"bisa\", \"lihat\", \"isi\", \"dari\", \"produk\", \"nya\", \"tekstur\", \"nya\", \"gel\", \"ada\", \"butiran\", \"pink\", \"kecilkeci