(369, 'mauryokta', 'Duh sayang bgt ga cocok di aku, padahal aku udah pede bgt bakal cocok sampe beli yang 40ml pdhl belum pernah nyobain. Ternyata pas di pake rada panas perih gitu, udah coba bbrp kali ternyata ttp aja hasilnya panas perih pdhl aku pake yg 5%. Jadi takut mau nyobain niacinamide lagi sejak pake ini. Tapi untungnya varian serum yang lain dr somethinc aku cocok bgtt', 'duh sayang bgt ga cocok di aku, padahal aku udah pede bgt bakal cocok sampe beli yang 40ml pdhl belum pernah nyobain. ternyata pas di pake rada panas perih gitu, udah coba bbrp kali ternyata ttp aja hasilnya panas perih pdhl aku pake yg 5%. jadi takut mau nyobain niacinamide lagi sejak pake ini. tapi untungnya varian serum yang lain dr somethinc aku cocok bgtt', 'duh sayang bgt ga cocok di aku padahal aku udah pede bgt bakal cocok sampe beli yang ml pdhl belum pernah nyobain ternyata pas di pake rada panas perih gitu udah coba bbrp kali ternyata ttp aja hasilnya panas perih pdhl aku pake yg jadi takut mau nyobain niacinamide lagi sejak pake ini tapi untungnya varian serum yang lain dr somethinc aku cocok bgtt', '[\"duh\", \"sayang\", \"bgt\", \"cocok\", \"aku\", \"padahal\", \"aku\", \"udah\", \"pede\", \"bgt\", \"bakal\", \"cocok\", \"sampe\", \"beli\", \"yang\", \"pdhl\", \"belum\", \"pernah\", \"nyobain\", \"ternyata\", \"pas\", \"pakai\", \"rada\", \"panas\", \"perih\", \"gitu\", \"udah\", \"coba\", \"bbrp\", \"kali\", \"ternyata\", \"tetap\", \"aja\", \"hasilnya\", \"panas\", \"perih\", \"pdhl\", \"aku\", \"pakai\", \"jadi\", \"takut\", \"mau\", \"nyobain\", \"niacinamide\", \"lagi\", \"sejak\", \"pakai\", \"ini\", \"tapi\", \"untungnya\", \"varian\", \"serum\", \"yang\", \"lain\", \"somethinc\", \"aku\", \"cocok\", \"bgtt\"]', 'duh sayang bgt cocok aku padahal aku udah pede bgt bakal cocok sampe beli yang pdhl belum pernah nyobain ternyata pas pakai rada panas perih gitu udah coba bbrp kali ternyata tetap aja hasilnya panas perih pdhl aku pakai jadi takut mau nyobain niacinamide lagi sejak pakai ini tapi untungnya varian serum yang lain somethinc aku cocok bgtt', '\"duh sayang bgt cocok udah pede bgt cocok sampe beli pdhl nyobain pas pakai rada panas perih gitu udah coba bbrp kali aja hasilnya panas perih pdhl pakai takut nyobain niacinamide pakai untungnya varian serum somethinc cocok bgtt\"', 'duh sayang bgt cocok udah pede bgt cocok sampe beli pdhl nyobain pas pakai rada panas perih gitu udah coba bbrp kali aja hasil panas perih pdhl pakai takut nyobain niacinamide pakai untung varian serum somethinc cocok bgtt', 'Negatif', '2024-11-29 06:45:17', '2024-11-29 06:45:17', NULL),
