k obat gitu hasilnya bagus sih wajah berminyak jerawatku kempes tinggal ngilangin bekasnya aja\"', 'pakai cream bareng serum nya scarlet acne hasil oke banget tekstur cream lembut mudah aplikasi bau creamnya sengat bau kayak obat gitu hasil bagus sih wajah minyak jerawat kempes tinggal ngilangin bekas aja', 'Negatif', '2024-11-29 06:45:19', '2024-11-29 06:45:19', NULL),
