(374, 'Hasifah', 'mengandung 10% niacinamide + moisture sabi beet max brightening serum. bagus untuk mencerahkan kulit, bagus juga untuk menyamarkan bekas noda, melembabkan dan menghaluskan kulit wajah. Rekomen banget untuk kulit yang kusam, bisa digunakan untuk pagi dan malam hari', 'mengandung 10% niacinamide + moisture sabi beet max brightening serum. bagus untuk mencerahkan kulit, bagus juga untuk menyamarkan bekas noda, melembabkan dan menghaluskan kulit wajah. rekomen banget untuk kulit yang kusam, bisa digunakan untuk pagi dan malam hari', 'mengandung niacinamide moisture sabi beet max brightening serum bagus untuk mencerahkan kulit bagus juga untuk menyamarkan bekas noda melembabkan dan menghaluskan kulit wajah rekomen banget untuk kulit yang kusam bisa digunakan untuk pagi dan malam hari', '[\"mengandung\", \"niacinamide\", \"moisture\", \"sabi\", \"beet\", \"max\", \"brightening\", \"serum\", \"bagus\", \"untuk\", \"mencerahkan\", \"kulit\", \"bagus\", \"juga\", \"untuk\", \"menyamarkan\", \"bekas\", \"noda\", \"melembabkan\", \"dan\", \"menghaluskan\", \"kulit\", \"wajah\", \"rekomen\", \"banget\", \"untuk\", \"kulit\", \"yang\", \"kusam\", \"bisa\", \"digunakan\", \"untuk\", \"pagi\", \"dan\", \"malam\", \"hari\"]', 'mengandung niacinamide moisture sabi beet max brightening serum bagus untuk mencerahkan kulit bagus juga untuk menyamarkan bekas noda melembabkan dan menghaluskan kulit wajah rekomen banget untuk kulit yang kusam bisa digunakan untuk pagi dan malam hari', '\"mengandung niacinamide moisture sabi beet max brightening serum bagus mencerahkan kulit bagus menyamarkan bekas noda melembabkan menghaluskan kulit wajah rekomen banget kulit kusam pagi malam\"', 'kandung niacinamide moisture sabi beet max brightening serum bagus cerah kulit bagus samar bekas noda melembabkan halus kulit wajah rekomen banget kulit kusam pagi malam', 'Negatif', '2024-11-29 06:45:22', '2024-11-29 06:45:22', NULL),
(375, 'eliiinnn', 'gatau lagi udah abis berapa botol untuk niacinamide dari somethinc ini. teksturnya thick dan di pake dikit udh cukup semuka efeknya melembabkan dan bikin muka calm, jerawat yg gede dan sakit aku saranin rutinin pake ini krna sabi beet nya ngaruh bgt buat calming si jerawat ini. mencerahkan jg oke bgt, cuma di aku cepet bgt oksidasi nya. tpi gapapa itu hal normal dan msih aman di pake', 'gatau lagi udah abis berapa botol untuk niacinamide dari somethinc ini. teksturnya thick dan di pake dikit udh cukup semuka efeknya melembabkan dan bikin muka calm, jerawat yg gede dan sakit aku saranin rutinin pake ini krna sabi beet nya ngaruh bgt buat calming si jerawat ini. mencerahkan jg oke bgt, cuma di aku cepet bgt oksidasi nya. tpi gapapa itu hal normal dan msih aman di pake', 'gatau lagi udah abis berapa botol untuk niacinamide dari somethinc ini teksturnya thick dan di pake dikit udh cukup semuka efeknya melembabkan dan bikin muka calm jerawat yg gede dan sakit aku saranin rutinin pake ini krna sabi beet nya ngaruh bgt buat calming si jerawat ini mencerahkan jg oke bgt cuma di aku cepet bgt oksidasi nya tpi gapapa itu hal normal dan msih aman di pake', '[\"gatau\", \"lagi\", \"udah\", \"abis\", \"berapa\", \"botol\", \"untuk\", \"niacinamide\", \"dari\", \"somethinc\", \"ini\", \"teksturnya\", \"thick\", \"dan\", \"pakai\", \"dikit\", \"sudah\", \"cukup\", \"semuka\", \"efeknya\", \"melembabkan\", \"dan\", \"bikin\", \"muka\", \"calm\", \"jerawat\", \"gede\", \"dan\", \"sakit\", \"aku\", \"saranin\", \"rutinin\", \"pakai\", \"ini\", \"krna\", \"sabi\", \"beet\", \"nya\", \"ngaruh\", \"bgt\", \"buat\", \"calming\", \"jerawat\", \"ini\", \"mencerahkan\", \"oke\", \"bgt\", \"cuma\", \"aku\", \"cepet\", \"bgt\", \"oksidasi\", \"nya\", \"tpi\", \"gapapa\", \"itu\", \"hal\", \"normal\", \"dan\", \"msih\", \"aman\", \"pakai\"]', 'gatau lagi udah abis berapa botol untuk niacinamide dari somethinc ini teksturnya thick dan pakai dikit sudah cukup semuka efeknya me