(386, 'IreneKusuma', 'Pake serum ini awalnya karena rekomendasi temen, tapi setelah kurang lebih 3 minggu aku pakai hasilnya bagus banget. Teksturnya yang kayak gel dan kental cepet banget nyerep ke kulitku & bikin kulit wajahku yang kering ini bisa terhidrasi dan ngga keliatan kusam lagi. Serum ini juga bantu perbaiki skin barier aku yang kadang kering dan kasar menjadi agak lebih lembut dan flek hitam juag jadi tersamarkan. Sukak banget pokoknya :)', 'pake serum ini awalnya karena rekomendasi temen, tapi setelah kurang lebih 3 minggu aku pakai hasilnya bagus banget. teksturnya yang kayak gel dan kental cepet banget nyerep ke kulitku & bikin kulit wajahku yang kering ini bisa terhidrasi dan ngga keliatan kusam lagi. serum ini juga bantu perbaiki skin barier aku yang kadang kering dan kasar menjadi agak lebih lembut dan flek hitam juag jadi tersamarkan. sukak banget pokoknya :)', 'pake serum ini awalnya karena rekomendasi temen tapi setelah kurang lebih minggu aku pakai hasilnya bagus banget teksturnya yang kayak gel dan kental cepet banget nyerep ke kulitku bikin kulit wajahku yang kering ini bisa terhidrasi dan ngga keliatan kusam lagi serum ini juga bantu perbaiki skin barier aku yang kadang kering dan kasar menjadi agak lebih lembut dan flek hitam juag jadi tersamarkan sukak banget pokoknya', '[\"pakai\", \"serum\", \"ini\", \"awalnya\", \"karena\", \"rekomendasi\", \"temen\", \"tapi\", \"setelah\", \"kurang\", \"lebih\", \"minggu\", \"aku\", \"pakai\", \"hasilnya\", \"bagus\", \"banget\", \"teksturnya\", \"yang\", \"kayak\", \"gel\", \"dan\", \"kental\", \"cepet\", \"banget\", \"nyerep\", \"kulitku\", \"bikin\", \"kulit\", \"wajahku\", \"yang\", \"kering\", \"ini\", \"bisa\", \"terhidrasi\", \"dan\", \"ngga\", \"keliatan\", \"kusam\", \"lagi\", \"serum\", \"ini\", \"juga\", \"bantu\", \"perbaiki\", \"skin\", \"barier\", \"aku\", \"yang\", \"kadang\", \"kering\", \"dan\", \"kasar\", \"menjadi\", \"agak\", \"lebih\", \"lembut\", \"dan\", \"flek\", \"hitam\", \"juag\", \"jadi\", \"tersamarkan\", \"sukak\", \"banget\", \"pokoknya\"]', 'pakai serum ini awalnya karena rekomendasi temen tapi setelah kurang lebih minggu aku pakai hasilnya bagus banget teksturnya yang kayak gel dan kental cepet banget nyerep kulitku bikin kulit wajahku yang kering ini bisa terhidrasi dan ngga keliatan kusam lagi serum ini juga bantu perbaiki skin barier aku yang kadang kering dan kasar menjadi agak lebih lembut dan flek hitam juag jadi tersamarkan sukak banget pokoknya', '\"pakai serum rekomendasi temen minggu pakai hasilnya bagus banget teksturnya kayak gel kental cepet banget nyerep kulitku bikin kulit wajahku kering terhidrasi ngga keliatan kusam serum bantu perbaiki skin barier kadang kering kasar lembut flek hitam juag tersamarkan sukak banget pokoknya\"', 'pakai serum rekomendasi temen minggu pakai hasil bagus banget tekstur kayak gel kental cepet banget nyerep kulit bikin kulit wajah kering hidrasi ngga liat kusam serum bantu baik skin barier kadang kering kasar lembut flek hitam juag samar sukak banget pokok', 'Negatif', '2024-11-29 06:45:36', '2024-11-29 06:45:36', NULL),
