(389, 'hamasah_uwi', 'Kemasan: Kemasan toner dari plastik. Ukuran 100 ml. Untuk informasi produk, selain ada di box, tapi tertera juga komplit di botolnya, mulai dari ingredient, cara penggunaan, dan kode BPOM. Bentuk kepalanya pump sehingga cairannya mudah untuk digunakan.Tekstur: Cair seperti air, agak lengket awalnya tapi mudah menyerap. Hero Ingredients: VITAMIN C, GLUTATHIONE, WITCH HAZEL EXTRACT, JEJU PROPOLIS EXTRACT, ALLANTOIN, NIACINAMIDE, GRAPE WATER. Hasil Pemakaian:Teksturnya yang seperti air, mudah menyerap dan tidak lengket. Bola-bola kecil di toner ini adalah beads yang ada kandungan Phyto Squalene sebagai anti peradangan dan anti inflamasi sehingga bisa meredakan pembengkakan kulit yang berjerawat. Setelah dipakai ada efek cooling di wajah. Ketika pemakaian awal, saking coolingnya ketika pakai ini aku agak perih terutama di cuping hidung. Tidak ada fragrance, tapi aku merasa tonernya seperti wangi anggur yang soft. PAO 6 bulan', 'kemasan: kemasan toner dari plastik. ukuran 100 ml. untuk informasi produk, selain ada di box, tapi tertera juga komplit di botolnya, mulai dari ingredient, cara penggunaan, dan kode bpom. bentuk kepalanya pump sehingga cairannya mudah untuk digunakan.tekstur: cair seperti air, agak lengket awalnya tapi mudah menyerap. hero ingredients: vitamin c, glutathione, witch hazel extract, jeju propolis extract, allantoin, niacinamide, grape water. hasil pemakaian:teksturnya yang seperti air, mudah menyerap dan tidak lengket. bola-bola kecil di toner ini adalah beads yang ada kandungan phyto squalene sebagai anti peradangan dan anti inflamasi sehingga bisa meredakan pembengkakan kulit yang berjerawat. setelah dipakai ada efek cooling di wajah. ketika pemakaian awal, saking coolingnya ketika pakai ini aku agak perih terutama di cuping hidung. tidak ada fragrance, tapi aku merasa tonernya seperti wangi anggur yang soft. pao 6 bulan', 'kemasan kemasan toner dari plastik ukuran ml untuk informasi produk selain ada di box tapi tertera juga komplit di botolnya mulai dari ingredient cara penggunaan dan kode bpom bentuk kepalanya pump sehingga cairannya mudah untuk digunakantekstur cair seperti air agak lengket awalnya tapi mudah menyerap hero ingredients vitamin c glutathione witch hazel extract jeju propolis extract allantoin niacinamide grape water hasil pemakaianteksturnya yang seperti air mudah menyerap dan tidak lengket bolabola kecil di toner ini adalah beads yang ada kandungan phyto squalene sebagai anti peradangan dan anti inflamasi sehingga bisa meredakan pembengkakan kulit yang berjerawat setelah dipakai ada efek cooling di wajah ketika pemakaian awal saking coolingnya ketika pakai ini aku agak perih terutama di cuping hidung tidak ada fragrance tapi aku merasa tonernya seperti wangi anggur yang soft pao bulan', '[\"kemasan\", \"kemasan\", \"toner\", \"dari\", \"plastik\", \"ukuran\", \"untuk\", \"informasi\", \"produk\", \"selain\", \"ada\", \"box\", \"tapi\", \"tertera\", \"juga\", \"komplit\", \"botolnya\", \"mulai\", \"dari\", \"ingredient\", \"cara\", \"penggunaan\", \"dan\", \"kode\", \"bpom\", \"bentuk\", \"kepalanya\", \"pump\", \"sehingga\", \"cairannya\", \"mudah\", \"untuk\", \"digunakantekstur\", \"cair\", \"seperti\", \"air\", \"agak\", \"lengket\", \"awalnya\", \"tapi\", \"mudah\", \"menyerap\", \"hero\", \"ingredients\", \"vitamin\", \"glutathione\", \"witch\", \"hazel\", \"extract\", \"jeju\", \"propolis\", \"extract\", \"allantoin\", \"niacinamide\", \"grape\", \"water\", \"hasil\", \"pemakaianteksturnya\", \"yang\", \"seperti\", \"air\", \"mudah\", \"menyerap\", \"dan\", \"tidak\", \"lengket\", \"bolabola\", \"kecil\", \"toner\", \"ini\", \"adalah\", \"beads\", \"yang\", \"ada\", \"kandungan\", \"phyto\", \"squalene\", \"sebagai\", \"anti\", \"peradangan\", \"dan\", \"anti\", \"inflamasi\", \"sehingga\", \"bisa\", \"meredakan\", \"pembengkakan\", \"kulit\", \"yang\", \"berjerawat\", \"setelah\", \"dipakai\", \"ada\", \"efek\", \"cooling\", \"wajah\", \"ketika\", \"pemakaian