hione witch hazel extract jeju propolis extract allantoin niacinamide grape water hasil pemakaianteksturnya air mudah serap lengket bolabola toner beads kandung phyto squalene anti adang anti inflamasi reda bengkak kulit jerawat pakai efek cooling wajah pakai saking coolingnya pakai perih cuping hidung fragrance tonernya wangi anggur soft pao', 'Negatif', '2024-11-29 06:45:42', '2024-11-29 06:45:42', NULL),
