(391, 'amalia_annufus', 'tekstur face washnya gel, unik ada butiran dan rose petalnya. minim busa dan cukup gentle ga bikin ketatik atau kering. tetep lembab dan wanginya floral. packagingnya juga suka slim enak dibawa bawa. enal dipegang. overall aku suka produknya ga bikin masalah baru di kulitku', 'tekstur face washnya gel, unik ada butiran dan rose petalnya. minim busa dan cukup gentle ga bikin ketatik atau kering. tetep lembab dan wanginya floral. packagingnya juga suka slim enak dibawa bawa. enal dipegang. overall aku suka produknya ga bikin masalah baru di kulitku', 'tekstur face washnya gel unik ada butiran dan rose petalnya minim busa dan cukup gentle ga bikin ketatik atau kering tetep lembab dan wanginya floral packagingnya juga suka slim enak dibawa bawa enal dipegang overall aku suka produknya ga bikin masalah baru di kulitku', '[\"tekstur\", \"face\", \"washnya\", \"gel\", \"unik\", \"ada\", \"butiran\", \"dan\", \"rose\", \"petalnya\", \"minim\", \"busa\", \"dan\", \"cukup\", \"gentle\", \"bikin\", \"ketatik\", \"atau\", \"kering\", \"tetep\", \"lembab\", \"dan\", \"wanginya\", \"floral\", \"packagingnya\", \"juga\", \"suka\", \"slim\", \"enak\", \"dibawa\", \"bawa\", \"enal\", \"dipegang\", \"overall\", \"aku\", \"suka\", \"produknya\", \"bikin\", \"masalah\", \"baru\", \"kulitku\"]', 'tekstur face washnya gel unik ada butiran dan rose petalnya minim busa dan cukup gentle bikin ketatik atau kering tetep lembab dan wanginya floral packagingnya juga suka slim enak dibawa bawa enal dipegang overall aku suka produknya bikin masalah baru kulitku', '\"tekstur face washnya gel unik butiran rose petalnya minim busa gentle bikin ketatik kering tetep lembab wanginya floral packagingnya suka slim enak dibawa bawa enal dipegang overall suka produknya bikin kulitku\"', 'tekstur face washnya gel unik butir rose petal minim busa gentle bikin ketatik kering tetep lembab wangi floral packagingnya suka slim enak bawa bawa enal pegang overall suka produk bikin kulit', '