(416, 'IrnaAmalia18', 'Serum yang lumayan cepet nyerapnya di kulit wajah,lumayan bikin wajah cerahan ,tpi bekas jerawat di dagu masih belum hilang,mungkin..karena baru pemakaian 2 Minggu jd belum terlihat jelas bngt untuk hasilnya. Tapi overall bagus si ?', 'serum yang lumayan cepet nyerapnya di kulit wajah,lumayan bikin wajah cerahan ,tpi bekas jerawat di dagu masih belum hilang,mungkin..karena baru pemakaian 2 minggu jd belum terlihat jelas bngt untuk hasilnya. tapi overall bagus si ?', 'serum yang lumayan cepet nyerapnya di kulit wajahlumayan bikin wajah cerahan tpi bekas jerawat di dagu masih belum hilangmungkinkarena baru pemakaian minggu jd belum terlihat jelas bngt untuk hasilnya tapi overall bagus si', '[\"serum\", \"yang\", \"lumayan\", \"cepet\", \"nyerapnya\", \"kulit\", \"wajahlumayan\", \"bikin\", \"wajah\", \"cerahan\", \"tpi\", \"bekas\", \"jerawat\", \"dagu\", \"masih\", \"belum\", \"hilangmungkinkarena\", \"baru\", \"pemakaian\", \"minggu\", \"belum\", \"terlihat\", \"jelas\", \"bngt\", \"untuk\", \"hasilnya\", \"tapi\", \"overall\", \"bagus\"]', 'serum yang lumayan cepet nyerapnya kulit wajahlumayan bikin wajah cerahan tpi bekas jerawat dagu masih belum hilangmungkinkarena baru pemakaian minggu belum terlihat jelas bngt untuk hasilnya tapi overall bagus', '\"serum lumayan cepet nyerapnya kulit wajahlumayan bikin wajah cerahan tpi bekas jerawat dagu hilangmungkinkarena pemakaian minggu bngt hasilnya overall bagus\"', 'serum lumayan cepet nyerapnya kulit wajahlumayan bikin wajah cerah tpi bekas jerawat dagu hilangmungkinkarena pakai minggu bngt hasil overall bagus', 'Netral', '2024-11-29 06:46:11', '2024-11-29 06:46:11', NULL),
