(419, 'alqorina2', 'rekomended bgt ini tuhh??, aku udh nyobain selama 2 minggu dan hasilnya memuaskan bgt, dari yg tadinya kulitku kusam dan ada bekas jerawat, sekarang jadi lebih cerah dan bekas jerawat hilang? ingredientnya juga bagus bgt dan teksturnya juga gampang menyerap , pokonya worth it deh??', 'rekomended bgt ini tuhh??, aku udh nyobain selama 2 minggu dan hasilnya memuaskan bgt, dari yg tadinya kulitku kusam dan ada bekas jerawat, sekarang jadi lebih cerah dan bekas jerawat hilang? ingredientnya juga bagus bgt dan teksturnya juga gampang menyerap , pokonya worth it deh??', 'rekomended bgt ini tuhh aku udh nyobain selama minggu dan hasilnya memuaskan bgt dari yg tadinya kulitku kusam dan ada bekas jerawat sekarang jadi lebih cerah dan bekas jerawat hilang ingredientnya juga bagus bgt dan teksturnya juga gampang menyerap pokonya worth it deh', '[\"rekomended\", \"bgt\", \"ini\", \"tuhh\", \"aku\", \"sudah\", \"nyobain\", \"selama\", \"minggu\", \"dan\", \"hasilnya\", \"memuaskan\", \"bgt\", \"dari\", \"tadinya\", \"kulitku\", \"kusam\", \"dan\", \"ada\", \"bekas\", \"jerawat\", \"sekarang\", \"jadi\", \"lebih\", \"cerah\", \"dan\", \"bekas\", \"jerawat\", \"hilang\", \"ingredientnya\", \"juga\", \"bagus\", \"bgt\", \"dan\", \"teksturnya\", \"juga\", \"gampang\", \"menyerap\", \"pokonya\", \"worth\", \"deh\"]', 'rekomended bgt ini tuhh aku sudah nyobain selama minggu dan hasilnya memuaskan bgt dari tadinya kulitku kusam dan ada bekas jerawat sekarang jadi lebih cerah dan bekas jerawat hilang ingredientnya juga bagus bgt dan teksturnya juga gampang menyerap pokonya worth deh', '\"rekomended bgt tuhh nyobain minggu hasilnya memuaskan bgt kulitku kusam bekas jerawat cerah bekas jerawat hilang ingredientnya bagus bgt teksturnya gampang menyerap pokonya worth deh\"', 'rekomended bgt tuhh nyobain minggu hasil muas bgt kulit kusam bekas jerawat cerah bekas jerawat hilang ingredientnya bagus bgt tekstur gampang serap poko worth deh', 'Netral', '2024-11-29 06:46:15', '2024-11-29 06:46:15', NULL),
(420, 'sabilafashln', 'Pas scarlett launch sunscreen bikin penasaran mau checkout terus dicoba. Spf-nya juga lumayan tinggi, lumayan thick dari teksturnya. Pas dibaurkan lumayan blendable, gak perlu effort karena lama-lama meresap. Yang kurang aku suka agak sedikit kerasa sumuk dan bikin kusam kalau dipakai buat olahraga. Kulit aku juga oily jadi setelah dipakai lumayan lama bikin berminyak banget. Kadang suka aku akalin pakai bedak tabur juga. Agak sedikit terasa perih kalau pakai di area sekitar mata', 'pas scarlett launch sunscreen bikin penasaran mau checkout terus dicoba. spf-nya juga lumayan tinggi, lumayan thick dari teksturnya. pas dibaurkan lumayan blendable, gak perlu effort karena lama-lama meresap. yang kurang aku suka agak sedikit kerasa sumuk dan bikin kusam kalau dipakai buat olahraga. kulit aku juga oily jadi setelah dipakai lumayan lama bikin berminyak banget. kadang suka aku akalin pakai bedak tabur juga. agak sedikit terasa perih kalau pakai di area sekitar mata', 'pas scarlett launch sunscreen bikin penasaran mau checkout terus dicoba spfnya juga lumayan tinggi lumayan thick dari teksturnya pas dibaurkan lumayan blendable gak perlu effort karena lamalama meresap yang kurang aku suka agak sedikit kerasa sumuk dan bikin kusam kalau dipakai buat olahraga kulit aku juga oily jadi setelah dipakai lumayan lama bikin berminyak banget kadang suka aku akalin pakai bedak tabur juga agak sedikit terasa perih kalau pakai di area sekitar mata', '[\"pas\", \"scarlett\", \"launch\", \"sunscreen\", \"bikin\", \"penasaran\", \"mau\", \"checkout\", \"terus\", \"dicoba\", \"spfnya\", \"juga\", \"lumayan\", \"tinggi\", \"lumayan\", \"thick\", \"dari\", \"teksturnya\", \"pas\", \"dibaurkan\", \"lumayan\", \"blendable\", \"gak\", \"perlu\", \"effort\", \"karena\", \"lamalama\", \"meresap\", \"yang\", \"kurang\", \"aku\", \"suka\", \"agak\", \"sedikit\", \"kerasa\", \"sumuk\", \"dan\", \"bikin\", \"kusam\", \"kalau\", \"dipakai\", \"buat\", \"olahraga\", \"kulit\", \"aku\", \"juga\", \"oily\", \"jadi\", \"setelah\", \"dipakai\", \"lumayan\", \"lama\", \"bikin\", \"berminyak\", \"banget\", \"kadang\", \"suka\", \"aku\", \"akalin\", \"pakai\", \"bedak\", \"tabur\", \"juga\", \"agak\", \"sedikit\", \"terasa\", \"perih\", \"kalau\", \"pakai\", \"area\", \"sekitar\", \"mata\"]', 'pas scarlett launch sunscreen bikin penasaran mau checkout terus dicoba spfnya juga lumayan tinggi lumayan thick dari teksturnya pas dibaurkan lumayan blendable gak perlu effort karena lamalama meresap yang kurang aku suka agak sedikit kerasa sumuk dan bikin kusam kalau dipakai buat olahraga kulit aku juga oily jadi setelah dipakai lumayan lama bikin berminyak banget kadang suka aku akalin pakai bedak tabur juga agak sedikit terasa perih kalau pakai area sekitar mata', '\"pas scarlett launch sunscreen bikin penasaran checkout dicoba spfnya lumayan lumayan thick teksturnya pas dibaurkan lumayan blendable gak effort lamalama meresap suka kerasa sumuk bikin kusam dipakai olahraga kulit oily dipakai lumayan bikin berminyak banget kadang suka akalin pakai bedak tabur perih pakai area mata\"', 'pas scarlett launch sunscreen bikin penasaran checkout coba spfnya lumayan lumayan thick tekstur pas baur lumayan blendable gak effort lamalama resap suka rasa sumuk bikin kusam pakai olahraga kulit oily pakai lumayan bikin minyak banget kadang suka akalin pakai bedak tabur perih pakai area mata', 'Netral', '2024-11-29 06:46:17', '2024-11-29 06:46:17', NULL),
