(431, 'nadyavelicya', 'Night creamnya bagus bgt soalnya teksturenya kaya watery gt jadi ga bikin pori-pori kesumbat, cepet meresapnya, ga bikin lengket ke kulit. Bangun bangun kulit super plumpy, dan pastinya bikin cerah✨ aku pake serumnya juga biar hasilnya makin nampol?', 'night creamnya bagus bgt soalnya teksturenya kaya watery gt jadi ga bikin pori-pori kesumbat, cepet meresapnya, ga bikin lengket ke kulit. bangun bangun kulit super plumpy, dan pastinya bikin cerah✨ aku pake serumnya juga biar hasilnya makin nampol?', 'night creamnya bagus bgt soalnya teksturenya kaya watery gt jadi ga bikin poripori kesumbat cepet meresapnya ga bikin lengket ke kulit bangun bangun kulit super plumpy dan pastinya bikin cerah aku pake serumnya juga biar hasilnya makin nampol', '[\"night\", \"creamnya\", \"bagus\", \"bgt\", \"soalnya\", \"teksturenya\", \"kaya\", \"watery\", \"jadi\", \"bikin\", \"poripori\", \"kesumbat\", \"cepet\", \"meresapnya\", \"bikin\", \"lengket\", \"kulit\", \"bangun\", \"bangun\", \"kulit\", \"super\", \"plumpy\", \"dan\", \"pastinya\", \"bikin\", \"cerah\", \"aku\", \"pakai\", \"serumnya\", \"juga\", \"biar\", \"hasilnya\", \"makin\", \"nampol\"]', 'night creamnya bagus bgt soalnya teksturenya kaya watery jadi bikin poripori kesumbat cepet meresapnya bikin lengket kulit bangun bangun kulit super plumpy dan pastinya bikin cerah aku pakai serumnya juga biar hasilnya makin nampol', '\"night creamnya bagus bgt teksturenya kaya watery bikin poripori kesumbat cepet meresapnya bikin lengket kulit bangun bangun kulit super plumpy pastinya bikin cerah pakai serumnya biar hasilnya nampol\"', 'night creamnya bagus bgt teksturenya kaya watery bikin poripori sumbat cepet resap bikin lengket kulit bangun bangun kulit super plumpy pasti bikin cerah pakai serum biar hasil nampol', 'Netral', '2024-11-29 06:46:31', '2024-11-29 06:46:31', NULL),
(432, 'Assahmi', 'Jatuh cinta banget sama sunscreen nya MS Glow ini, apalagi emang dari dulu aku percayakan skincare ku ke produk Ms Glow. Dan sunwhite nya ini bikin glowing seharian, ga takut buat aktivitas diluar ruangan. Terrr gak bikin kusam, dan ter bikin glowing wajah??', 'jatuh cinta banget sama sunscreen nya ms glow ini, apalagi emang dari dulu aku percayakan skincare ku ke produk ms glow. dan sunwhite nya ini bikin glowing seharian, ga takut buat aktivitas diluar ruangan. terrr gak bikin kusam, dan ter bikin glowing wajah??', 'jatuh cinta banget sama sunscreen nya ms glow ini apalagi emang dari dulu aku percayakan skincare ku ke produk ms glow dan sunwhite nya ini bikin glowing seharian ga takut buat aktivitas diluar ruangan terrr gak bikin kusam dan ter bikin glowing wajah', '[\"jatuh\", \"cinta\", \"banget\", \"sama\", \"sunscreen\", \"nya\", \"glow\", \"ini\", \"apalagi\", \"emang\", \"dari\", \"dulu\", \"aku\", \"percayakan\", \"skincare\", \"produk\", \"glow\", \"dan\", \"sunwhite\", \"nya\", \"ini\", \"bikin\", \"glowing\", \"seharian\", \"takut\", \"buat\", \"aktivitas\", \"diluar\", \"ruangan\", \"terrr\", \"gak\", \"bikin\", \"kusam\", \"dan\", \"ter\", \"bikin\", \"glowing\", \"wajah\"]', 'jatuh cinta banget sama sunscreen nya glow ini apalagi emang dari dulu aku percayakan skincare produk glow dan sunwhite nya ini bikin glowing seharian takut buat aktivitas diluar ruangan terrr gak bikin kusam dan ter bikin glowing wajah', '\"jatuh cinta banget sunscreen nya glow emang percayakan skincare produk glow sunwhite nya bikin glowing seharian takut aktivitas diluar ruangan terrr gak bikin kusam ter bikin glowing wajah\"', 'jatuh cinta banget sunscreen nya glow emang percaya skincare produk glow sunwhite nya bikin glowing hari takut aktivitas luar ruang terrr gak bikin kusam ter bikin glowing wajah', 'Netral', '2024-11-29 06:46:32', '2024-11-29 06:46:32', NULL),
(433, 'velisias', 'This is the first product of Somethinc that I try and use until now. Berpindah dari The Ordinary setelah berhasil menghabiskan 2 botol and I find kalau kulitku cocok banget sm niacinamide. Akhirnya memutuskan untuk coba produk lokal ini pada Juli 2019 kemarin. Aaaand I totally in love with this product. Dari awal pemakaian gak ada yang namanya break out atau purging, semuanya aman2 aja. Untuk efeknya sendiri di kulitku, dia cukup memberikan hidrasi dan juga ikut membantu menyamarkan bekas jerawat. One thing that I really love about this product adalah dia bisa dijadikan spot treatment untuk jerawat yang baru mau nongol, totol aja malemnya besok pagi pasti gone! HAHA. Sampai sekarang aku sudah di botol ke 10 and will keep using it karna kulitku cocok sekaliii sama produk ini.', 'this is the first product of somethinc that i try and use until now. berpindah dari the ordinary setelah berhasil menghabiskan 2 botol and i find kalau kulitku cocok banget sm niacinamide. akhirnya memutuskan untuk coba produk lokal ini pada juli 2019 kemarin. aaaand i totally in love with this product. dari awal pemakaian gak ada yang namanya break out atau purging, semuanya aman2 aja. untuk efeknya sendiri di kulitku, dia cukup memberikan hidrasi dan juga ikut membantu menyamarkan bekas jerawat. one thing that i really love about this product adalah dia bisa dijadikan spot treatment untuk jerawat yang baru mau nongol, totol aja malemnya besok pagi pasti gone! haha. sampai sekarang aku sudah di botol ke 10 and will keep using it karna kulitku cocok sekaliii sama produk ini.', 'this is the first product of somethinc that i try and use until now berpindah dari the ordinary setelah berhasil menghabiskan botol and i find kalau kulitku cocok banget sm niacinamide akhirnya memutuskan untuk coba produk lokal ini pada juli kemarin aaaand i totally in love with this product dari awal pemakaian gak ada yang namanya break out atau purging semuanya aman aja untuk efeknya sendiri di ku