(436, 'Piaaabrln', 'Serumnya bagus sih mudah meresap dan gak bikin berminyak, tapi di aku tiga hari pemakaian langsung timbul beruntusan, merah dan gatal gatal. Mungkin gak cocok kali ya dengan produk ini, padahal pake skincare lain yang ada niacinamide nya gapapa ', 'serumnya bagus sih mudah meresap dan gak bikin berminyak, tapi di aku tiga hari pemakaian langsung timbul beruntusan, merah dan gatal gatal. mungkin gak cocok kali ya dengan produk ini, padahal pake skincare lain yang ada niacinamide nya gapapa ', 'serumnya bagus sih mudah meresap dan gak bikin berminyak tapi di aku tiga hari pemakaian langsung timbul beruntusan merah dan gatal gatal mungkin gak cocok kali ya dengan produk ini padahal pake skincare lain yang ada niacinamide nya gapapa', '[\"serumnya\", \"bagus\", \"sih\", \"mudah\", \"meresap\", \"dan\", \"gak\", \"bikin\", \"berminyak\", \"tapi\", \"aku\", \"tiga\", \"hari\", \"pemakaian\", \"langsung\", \"timbul\", \"beruntusan\", \"merah\", \"dan\", \"gatal\", \"gatal\", \"mungkin\", \"gak\", \"cocok\", \"kali\", \"dengan\", \"produk\", \"ini\", \"padahal\", \"pakai\", \"skincare\", \"lain\", \"yang\", \"ada\", \"niacinamide\", \"nya\", \"gapapa\"]', 'serumnya bagus sih mudah meresap dan gak bikin berminyak tapi aku tiga hari pemakaian langsung timbul beruntusan merah dan gatal gatal mungkin gak cocok kali dengan produk ini padahal pakai skincare lain yang ada niacinamide nya gapapa', '\"serumnya bagus sih mudah meresap gak bikin berminyak pemakaian langsung timbul beruntusan merah gatal gatal gak cocok kali produk pakai skincare niacinamide nya gapapa\"', 'serum bagus sih mudah resap gak bikin minyak pakai langsung timbul beruntus merah gatal gatal gak cocok kali produk pakai skincare niacinamide nya gapapa', 'Netral', '2024-11-29 06:46:37', '2024-11-29 06:46:37', NULL),
