(493, 'DefaniihsaIzzaty', 'Ini salah satu produk Scarlett yang paling aku suka yaitu Scarlett 7X Ceramide Barrier Up Moisturizer. Pelembab ini teksturnya ringan banget tapi tetep bisa melembabkan dan bisa dikombinasikan sama berbagai serum/skincare products lainnya. Key ingredientsnya pakai 7 jenis Ceramides, 4D Hyaluronic Acid, Acetyl Hexapeptide-8, dan Camelia Leaf Extract. Pelembab ini cocok dikulitku yang oily acne prone skin dan bisa memperkuat skin barrier. Kulit jadi lembab, halus dan lembut kalo rajin pakai ini. Yang bikin suka juga bisa dikombinasikan sama bahan aktif lain misalnya diserum. Paling kekurangannya ini cepet banget abis karena aku pakai cream boros apalagi kalo teksturnya ringan dan packaging jar gini terkadang kurang higienis dibandingkan tube.', 'ini salah satu produk scarlett yang paling aku suka yaitu scarlett 7x ceramide barrier up moisturizer. pelembab ini teksturnya ringan banget tapi tetep bisa melembabkan dan bisa dikombinasikan sama berbagai serum/skincare products lainnya. key ingredientsnya pakai 7 jenis ceramides, 4d hyaluronic acid, acetyl hexapeptide-8, dan camelia leaf extract. pelembab ini cocok dikulitku yang oily acne prone skin dan bisa memperkuat skin barrier. kulit jadi lembab, halus dan lembut kalo rajin pakai ini. yang bikin suka juga bisa dikombinasikan sama bahan aktif lain misalnya diserum. paling kekurangannya ini cepet banget abis karena aku pakai cream boros apalagi kalo teksturnya ringan dan packaging jar gini terkadang kurang higienis dibandingkan tube.', 'ini salah satu produk scarlett yang paling aku suka yaitu scarlett x ceramide barrier up moisturizer pelembab ini teksturnya ringan banget tapi tetep bisa melembabkan dan bisa dikombinasikan sama berbagai serumskincare products lainnya key ingredientsnya pakai jenis ceramides d hyaluronic acid acetyl hexapeptide dan camelia leaf extract pelembab ini cocok dikulitku yang oily acne prone skin dan bisa memperkuat skin barrier kulit jadi lembab halus dan lembut kal