(503, 'celcacel', 'menurutku ini salah satu produk aman yg ingredientnya jelas dan ga macem2, apalagi udah bersetifikat halal jadi udah jelas banget produk yg bisa dipercaya keamanannya. setelah penggunaan satu botol hal yg paling aku notice wajah sedikit lebih cerah, dan cukup membantu mencerahkan bekas jerawat, juga membantu menyembuhkan beberapa jerawat kecil (bruntusan) harganya sangat terjangakau, local product pula. menurutku harus banget dicoba', 'menurutku ini salah satu produk aman yg ingredientnya jelas dan ga macem2, apalagi udah bersetifikat halal jadi udah jelas banget produk yg bisa dipercaya keamanannya. setelah penggunaan satu botol hal yg paling aku notice wajah sedikit lebih cerah, dan cukup membantu mencerahkan bekas jerawat, juga membantu menyembuhkan beberapa jerawat kecil (bruntusan) harganya sangat terjangakau, local product pula. menurutku harus banget dicoba', 'menurutku ini salah satu produk aman yg ingredientnya jelas dan ga macem apalagi udah bersetifikat halal jadi udah jelas banget produk yg bisa dipercaya keamanannya setelah penggunaan satu botol hal yg paling aku notice wajah sedikit lebih cerah dan cukup membantu mencerahkan bekas jerawat juga membantu menyembuhkan beberapa jerawat kecil harganya sangat terjangakau local product pula menurutku harus banget dicoba', '[\"menurutku\", \"ini\", \"salah\", \"satu\", \"produk\", \"aman\", \"ingredientnya\", \"jelas\", \"dan\", \"macem\", \"apalagi\", \"udah\", \"bersetifikat\", \"halal\", \"jadi\", \"udah\", \"jelas\", \"banget\", \"produk\", \"bisa\", \"dipercaya\", \"keamanannya\", \"setelah\", \"penggunaan\", \"satu\", \"botol\", \"hal\", \"paling\", \"aku\", \"notice\", \"wajah\", \"sedikit\", \"lebih\", \"cerah\", \"dan\", \"cukup\", \"membantu\", \"mencerahkan\", \"bekas\", \"jerawat\", \"juga\", \"membantu\", \"menyembuhkan\", \"beberapa\", \"jerawat\", \"kecil\", \"harganya\", \"sangat\", \"terjangakau\", \"local\", \"product\", \"pula\", \"menurutku\", \"harus\", \"banget\", \"dic