(526, 'tirachristy', 'Udahlah ya kayaknya kebanyakan orang emang cocok pake kandungan niacinamide. Serum yg simple tapi manjur banget buat cerahin muka. buat yang baru masuk ke dunia perskincarean lebih baik cobain dulu deh serum ini karena di kulitku yg oily acne prone bagus banget.', 'udahlah ya kayaknya kebanyakan orang emang cocok pake kandungan niacinamide. serum yg simple tapi manjur banget buat cerahin muka. buat yang baru masuk ke dunia perskincarean lebih baik cobain dulu deh serum ini karena di kulitku yg oily acne prone bagus banget.', 'udahlah ya kayaknya kebanyakan orang emang cocok pake kandungan niacinamide serum yg simple tapi manjur banget buat cerahin muka buat yang baru masuk ke dunia perskincarean lebih baik cobain dulu deh serum ini karena di kulitku yg oily acne prone bagus banget', '[\"udahlah\", \"kayaknya\", \"kebanyakan\", \"orang\", \"emang\", \"cocok\", \"pakai\", \"kandungan\", \"niacinamide\", \"serum\", \"simple\", \"tapi\", \"manjur\", \"banget\", \"buat\", \"cerahin\", \"muka\", \"buat\", \"yang\", \"baru\", \"masuk\", \"dunia\", \"perskincarean\", \"lebih\", \"baik\", \"cobain\", \"dulu\", \"deh\", \"serum\", \"ini\", \"karena\", \"kulitku\", \"oily\", \"acne\", \"prone\", \"bagus\", \"banget\"]', 'udahlah kayaknya kebanyakan orang emang cocok pakai kandungan niacinamide serum simple tapi manjur banget buat cerahin muka buat yang baru masuk dunia perskincarean lebih baik cobain dulu deh serum ini karena kulitku oily acne prone bagus banget', '\"udahlah kayaknya kebanyakan orang emang cocok pakai kandungan niacinamide serum simple manjur banget cerahin muka masuk dunia perskincarean cobain deh serum kulitku oily acne prone bagus banget\"', 'udahlah kayak banyak orang emang cocok pakai kandung niacinamide serum simple manjur banget cerahin muka masuk dunia perskincarean cobain deh serum kulit oily acne prone bagus banget', 'Netral', '2024-11-29 06:48:19', '2024-11-29 06:48:19', NULL),
