(529, 'Ellzaday_putri', 'Somethinc niacinamide adalah serum pertamaku yang berbahan aktif niacinamide, waktu aku pertama pakai dia itu teksturnya mudah banget menyerap jd gk ada rasa grissy sama sekali nyaman juga kalo buat tidur, dan yang paling aku sukain itu setelah bangun tidur wajahku jd keliahatan kulit yang sehat halus mulus dan lebih cerah bekas jerawatku juga lumayan memudar. Perbedaan signifikannya ada di tekstur sih jd lebih halus gitu', 'somethinc niacinamide adalah serum pertamaku yang berbahan aktif niacinamide, waktu aku pertama pakai dia itu teksturnya mudah banget menyerap jd gk ada rasa grissy sama sekali nyaman juga kalo buat tidur, dan yang paling aku sukain itu setelah bangun tidur wajahku jd keliahatan kulit yang sehat halus mulus dan lebih cerah bekas jerawatku juga lumayan memudar. perbedaan signifikannya ada di tekstur sih jd lebih halus gitu', 'somethinc niacinamide adalah serum pertamaku yang berbahan aktif niacinamide waktu aku pertama pakai dia itu teksturnya mudah banget menyerap jd gk ada rasa grissy sama sekali nyaman juga kalo buat tidur dan yang paling aku sukain itu setelah bangun tidur wajahku jd keliahatan kulit yang sehat halus mulus dan lebih cerah bekas jerawatku juga lumayan memudar perbedaan signifikannya ada di tekstur sih jd lebih halus gitu', '[\"somethinc\", \"niacinamide\", \"adalah\", \"serum\", \"pertamaku\", \"yang\", \"berbahan\", \"aktif\", \"niacinamide\", \"waktu\", \"aku\", \"pertama\", \"pakai\", \"dia\", \"itu\", \"teksturnya\", \"mudah\", \"banget\", \"menyerap\", \"ada\", \"rasa\", \"grissy\", \"sama\", \"sekali\", \"nyaman\", \"juga\", \"kalo\", \"buat\", \"tidur\", \"dan\", \"yang\", \"paling\", \"aku\", \"sukain\", \"itu\", \"setelah\", \"bangun\", \"tidur\", \"wajahku\", \"keliahatan\", \"kulit\", \"yang\", \"sehat\", \"halus\", \"mulus\", \"dan\", \"lebih\", \"cerah\", \"bekas\", \"jerawatku\", \"juga\", \"lumayan\", \"memudar\", \"perbedaan\", \"signifikannya\", \"ada\", \"tekstur\", \"sih\", \"lebih\", \"halus\", \"gitu\"]', 'somethinc niacinamide adalah serum pertamaku yang berbahan aktif niacinamide waktu aku pertama pakai dia itu teksturnya mudah banget menyerap ada rasa grissy sama sekali nyaman juga kalo buat tidur dan yang paling aku sukain itu setelah bangun tidur wajahku keliahatan kulit yang sehat halus mulus dan lebih cerah bekas jerawatku juga lumayan memudar perbedaan signifikannya ada tekstur sih lebih halus gitu', '\"somethinc niacinamide serum pertamaku berbahan aktif niacinamide pakai teksturnya mudah banget menyerap grissy nyaman kalo tidur sukain bangun tidur wajahku keliahatan kulit sehat halus mulus cerah bekas jerawatku lumayan memudar perbedaan signifikannya tekstur sih halus gitu\"', 'somethinc niacinamide serum pertama bahan aktif niacinamide pakai tekstur mudah banget serap grissy nyaman kalo tidur sukain bangun tidur wajah keliahatan kulit sehat halus mulus cerah bekas jerawat lumayan pudar beda signifikan tekstur sih halus gitu', 'Netral', '2024-11-29 06:48:22', '2024-11-29 06:48:22', NULL),
(530, 'AniceRum', 'Wajah jadi seger..menghilangkan kotoran,cocok untuk semua jenis kulit,tektur cair berbusa..wangi seger banget..gak bikin wajah jadi kering..yang pasti gak bikin iritasi juga.. udh pakai berkali kali..serumah pakai facial wash msglow', 'wajah jadi seger..menghilangkan kotoran,cocok untuk semua jenis kulit,tektur cair berbusa..wangi seger banget..gak bikin wajah jadi kering..yang pasti gak bikin iritasi juga.. udh pakai berkali kali..serumah pakai facial wash msglow', 'wajah jadi segermenghilangkan kotorancocok untuk semua jenis kulittektur cair berbusawangi seger bangetgak bikin wajah jadi keringyang pasti gak bikin iritasi juga udh pakai berkali kaliserumah pakai facial wash msglow', '[\"wajah\", \"jadi\", \"segermenghilangkan\", \"kotorancocok\", \"untuk\", \"semua\", \"jenis\", \"kulittektur\", \"cair\", \"berbusawangi\", \"seger\", \"bangetgak\", \"bikin\", \"wajah\", \"jadi\", \"keringyang\", \"pasti\", \"gak\", \"bikin\", \"iritasi\", \"juga\", \"sudah\", \"pakai\", \"berkali\", \"kaliserumah\", \"pakai\", \"facial\", \"wash\", \"msglow\"]', 'wajah jadi segermenghilangkan kotorancocok untuk semua jenis kulittektur cair berbusawangi seger bangetgak bikin wajah jadi keringyang pasti gak bikin iritasi juga sudah pakai berkali kaliserumah pakai facial wash msglow', '\"wajah segermenghilangkan kotorancocok jenis kulittektur cair berbusawangi seger bangetgak bikin wajah keringyang gak bikin iritasi pakai berkali kaliserumah pakai facial wash msglow\"', 'wajah segermenghilangkan kotorancocok jenis kulittektur cair berbusawangi seger bangetgak bikin wajah keringyang gak bikin iritasi pakai kali kaliserumah pakai facial wash msglow', 'Netral', '2024-11-29 06:48:23', '2024-11-29 06:48:23', NULL),
