nd pakainya ditap tap gitu kalo pengen mudah dibland pemakaian day cream nya pakai moisturizer sayang diwajah creamnya gak gtu dikelopak mata residu putih gtu\"', 'efek tone upnya gitu bikin wajah cerah tekstur nya suka padat gitu susah dibland pakai tap tap gitu kalo ken mudah dibland pakai day cream nya pakai moisturizer sayang wajah creamnya gak gtu kelopak mata residu putih gtu', 'Netral', '2024-11-29 06:48:50', '2024-11-29 06:48:50', NULL),
