(575, 'anikpujiastuti_', 'Bagus bgt? suka teksturnya ringan, galengket dan hasilnya udah bisa dilihat dalam 7hari? kulit lebih cerah&sehat??? flek diwajah juga hilang dan kulit tidak kering lagiii? jadi lembab polll???', 'bagus bgt? suka teksturnya ringan, galengket dan hasilnya udah bisa dilihat dalam 7hari? kulit lebih cerah&sehat??? flek diwajah juga hilang dan kulit tidak kering lagiii? jadi lembab polll???', 'bagus bgt suka teksturnya ringan galengket dan hasilnya udah bisa dilihat dalam hari kulit lebih cerahsehat flek diwajah juga hilang dan kulit tidak kering lagiii jadi lembab polll', '[\"bagus\", \"bgt\", \"suka\", \"teksturnya\", \"ringan\", \"galengket\", \"dan\", \"hasilnya\", \"udah\", \"bisa\", \"dilihat\", \"dalam\", \"hari\", \"kulit\", \"lebih\", \"cerahsehat\", \"flek\", \"diwajah\", \"juga\", \"hilang\", \"dan\", \"kulit\", \"tidak\", \"kering\", \"lagiii\", \"jadi\", \"lembab\", \"polll\"]', 'bagus bgt suka teksturnya ringan galengket dan hasilnya udah bisa dilihat dalam hari kulit lebih cerahsehat flek diwajah juga hilang dan kulit tidak kering lagiii jadi lembab polll', '\"bagus bgt suka teksturnya ringan galengket hasilnya udah kulit cerahsehat flek diwajah hilang kulit kering lagiii lembab polll\"', 'bagus bgt suka tekstur ringan galengket hasil udah kulit cerahsehat flek wajah hilang kulit kering lagiii lembab polll', 'Netral', '2024-11-29 06:49:16', '2024-11-29 06:49:16', NULL),
(576, 'jihanariska', 'Dari segi packaging, tekstur sampai finishnya aku suka banget. Cair tapi bikin kulit jadi lembab. Wanginya lebih ke floral gitu, gak nyengat kok. Kebetulan aku juga gak terlalu masalah sama produk yang ada kandungan fragrancenya. Didalem produknya juga ada butiran-butiran apa ya aku gatau namanya?. Yang aku kurang suka adalah sensasi dingin setelah pake dia. Dinginnya tuh terlalu semriwing mirip kayak abis pake minyak angin aromateraphy. Awa pake kaget banget kirain aku abis megang balsem atau apa. Ternyata emang dari tonernya wkwk. Fix sih ini kalo kena jerawat bakalan perih banget. So far yang aku rasain belum terlalu keliatan banget efek mencerahkannya. Cuma ya itu tadi aku suka efek lembabnya, bikin muka jadi kenyal.', 'dari segi packaging, tekstur sampai finishnya aku suka banget. cair tapi bikin kulit jadi lembab. wanginya lebih ke floral gitu, gak nyengat kok. kebetulan aku juga gak terlalu masalah sama produk yang ada kandungan fragrancenya. didalem produknya juga ada butiran-butiran apa ya aku gatau namanya?. yang aku kurang suka adalah sensasi dingin setelah pake dia. dinginnya tuh terlalu semriwing mirip kayak abis pake minyak angin aromateraphy. awa pake kaget banget kirain aku abis megang balsem atau apa. ternyata emang dari tonernya wkwk. fix sih ini kalo kena jerawat bakalan perih banget. so far yang aku rasain belum terlalu keliatan banget efek mencerahkannya. cuma ya itu tadi aku suka efek lembabnya, bikin muka jadi kenyal.', 'dari segi packaging tekstur sampai finishnya aku suka banget cair tapi bikin kulit jadi lembab wanginya lebih ke floral gitu gak nyengat kok kebetulan aku juga gak terlalu masalah sama produk yang ada kandungan fragrancenya didalem produknya juga ada butiranbutiran apa ya aku gatau namanya yang aku kurang suka adalah sensasi dingin setelah pake dia dinginnya tuh terlalu semriwing mirip kayak abis pake minyak angin aromateraphy awa pake kaget banget kirain aku abis megang balsem atau apa ternyata emang dar