(592, 'melyraaa', 'Rajin pakai sunscreen tiap hari tapi bukannya kinclong malah makin kusam ? untung nemu Sunwhite Daily Cream dari MS GLOW. Ada kandungan SPF 50 PA++++ nya, tekstur lightweight, non greasy, non comedogenic. Menurutku sunscreen bebas kusam tapi hasil glowing maksimal ya cuma dari MS GLOW.', 'rajin pakai sunscreen tiap hari tapi bukannya kinclong malah makin kusam ? untung nemu sunwhite daily cream dari ms glow. ada kandungan spf 50 pa++++ nya, tekstur lightweight, non greasy, non comedogenic. menurutku sunscreen bebas kusam tapi hasil glowing maksimal ya cuma dari ms glow.', 'rajin pakai sunscreen tiap hari tapi bukannya kinclong malah makin kusam untung nemu sunwhite daily cream dari ms glow ada kandungan spf pa nya tekstur lightweight non greasy non comedogenic menurutku sunscreen bebas kusam tapi hasil glowing maksimal ya cuma dari ms glow', '[\"rajin\", \"pakai\", \"sunscreen\", \"tiap\", \"hari\", \"tapi\", \"bukannya\", \"kinclong\", \"malah\", \"makin\", \"kusam\", \"untung\", \"nemu\", \"sunwhite\", \"daily\", \"cream\", \"dari\", \"glow\", \"ada\", \"kandungan\", \"spf\", \"nya\", \"tekstur\", \"lightweight\", \"non\", \"greasy\", \"non\", \"comedogenic\", \"menurutku\", \"sunscreen\", \"bebas\", \"kusam\", \"tapi\", \"hasil\", \"glowing\", \"maksimal\", \"cuma\", \"dari\", \"glow\"]', 'rajin pakai sunscreen tiap hari tapi bukannya kinclong malah makin kusam untung nemu sunwhite daily cream dari glow ada kandungan spf nya tekstur lightweight non greasy non comedogenic menurutku sunscreen bebas kusam tapi hasil glowing maksimal cuma dari glow', '\"rajin pakai sunscreen kinclong kusam untung nemu sunwhite daily cream glow kandungan spf nya tekstur lightweight non greasy non comedogenic menurutku sunscreen bebas kusam hasil glowing maksimal glow\"', 'rajin pakai sunscreen kinclong kusam untung nemu sunwhite daily cream glow kandung spf nya tekstur lightweight non greasy non comedogenic turut sunscreen bebas kusam hasil glowing maksimal glow', 'Netral', '2024-11-29 06:49:38', '2024-11-29 06:49:38', NULL),
(593, 'autumnken', 'Aku nemu ini pada saat aku cari niacinamide dengan harga yang murah, lalu ini reviewnya banyak bgt dan bagus-bagus jadi aku beraniin buat coba sama hyaluronicnya, 1 bulan langsung kerasa efeknya loh, botol yg kecil ini di aku abis 1bulan, mukaku lembut dan sukurnya ga ada efek aneh2 pada saat pertama cobain, cuma ya awalnya ada rasa tingle/gatel2 dikit, cm lama-lama udh nggak lg, sekarang aku langsung beli botol gedenya dan tetep lanjutin pake. Efek di wajahnya itu keliatan pori-poriku yg mulai mengecil dan skincare ini ga nambahin komedo baru di hidungku, dan memperbaiki tekstur wajah jd lebih halusan', 'aku nemu ini pada saat aku cari niacinamide dengan harga yang murah, lalu ini reviewnya banyak bgt dan bagus-bagus jadi aku beraniin buat coba sama hyaluronicnya, 1 bulan langsung kerasa efeknya loh, botol yg kecil ini di aku abis 1bulan, mukaku lembut dan sukurnya ga ada efek aneh2 pada saat pertama cobain, cuma ya awalnya ada rasa tingle/gatel2 dikit, cm lama-lama udh nggak lg, sekarang aku langsung beli botol gedenya dan tetep lanjutin pake. efek di wajahnya itu keliatan pori-poriku yg mulai mengecil dan skincare ini ga nambahin komedo baru di hidungku, dan memperbaiki tekstur wajah jd lebih halusan', 'aku nemu ini pada saat aku cari niacinamide dengan harga yang murah lalu ini reviewnya banyak bgt dan bagusbagus jadi aku beraniin buat coba sama hyaluronicnya bulan langsung kerasa efeknya loh botol yg kecil ini di aku abis bulan mukaku lembut dan sukurnya ga ada efek aneh pada saat pertama cobain cuma ya awalnya ada rasa tinglegatel dikit cm lamalama udh nggak lg sekarang aku langsung beli botol gedenya dan tetep lanjutin pake efek di wajahnya itu keliatan poriporiku yg mulai mengecil dan skincare ini ga nambahin komedo baru di hidungku dan memperbaiki tekstur wajah jd lebih halusan', '[\"aku\", \"nemu\", \"ini\", \"pada\", \"saat\", \"aku\", \"cari\", \"niacinamide\", \"dengan\", \"harga\", \"yang\", \"murah\", \"lalu\", \"ini\", \"reviewnya