(594, 'KurniaDliki', 'setelah ngerasa cocok sama yg varian acne, aku pengen coba yg varian ini.. untungnya sih cocok2 aja. cuma awal2 pake ini aku ngerasa agak sedikit lebih kering & ketarik daripada yg varian acne. tapi setelah aku habisin 1 botol rasa kering itu udh ga ada, kulitku pun fine2 aja, ga ada bruntusan atau iritasi.. teksturnya cair warna bening ada butiran2 scrub pink & rose petals warna pink, wanginya aku suka dia ga begitu nyengat.. abis pake ini muka berasa bersih, keset ga licin', 'setelah ngerasa cocok sama yg varian acne, aku pengen coba yg varian ini.. untungnya sih cocok2 aja. cuma awal2 pake ini aku ngerasa agak sedikit lebih kering & ketarik daripada yg varian acne. tapi setelah aku habisin 1 botol rasa kering itu udh ga ada, kulitku pun fine2 aja, ga ada bruntusan atau iritasi.. teksturnya cair warna bening ada butiran2 scrub pink & rose petals warna pink, wanginya aku suka dia ga begitu nyengat.. abis pake ini muka berasa bersih, keset ga licin', 'setelah ngerasa cocok sama yg varian acne aku pengen coba yg varian ini untungnya sih cocok aja cuma awal pake ini aku ngerasa agak sedikit lebih kering ketarik daripada yg varian acne tapi setelah aku habisin botol rasa kering itu udh ga ada kulitku pun fine aja ga ada bruntusan atau iritasi teksturnya cair warna bening ada butiran scrub pink rose petals warna pink wanginya aku suka dia ga begitu nyengat abis pake ini muka berasa bersih keset ga licin', '[\"setelah\", \"ngerasa\", \"cocok\", \"sama\", \"varian\", \"acne\", \"aku\", \"pengen\", \"coba\", \"varian\", \"ini\", \"untungnya\", \"sih\", \"cocok\", \"aja\", \"cuma\", \"awal\", \"pakai\", \"ini\", \"aku\", \"ngerasa\", \"agak\", \"sedikit\", \"lebih\", \"kering\", \"ketarik\", \"daripada\", \"varian\", \"acne\", \"tapi\", \"setelah\", \"aku\", \"habisin\", \"botol\", \"rasa\", \"kering\", \"itu\", \"sudah\", \"ada\", \"kulitku\", \"pun\", \"fine\", \"aja\", \"ada\", \"bruntusan\", \"atau\", \"iritasi\", \"teksturnya\", \"cair\", \"warna\