(597, 'noviaah', 'Aromanya cukup menyengat ya tapi buat aku gak ganggu sih dan lagi cepat menyerap juga di kulit dan sesuai sama keterangannya dapet menyerahkan dalam 7 hari walau sedikit tapi ini udah progres yang bagus banget di pakai rutin selama 3 bulan hasilnya keliatan cerah apik gitu, sebelumnya sih pakai yang luminos tapi pakai yang dna cell ternyata lebih bagus.', 'aromanya cukup menyengat ya tapi buat aku gak ganggu sih dan lagi cepat menyerap juga di kulit dan sesuai sama keterangannya dapet menyerahkan dalam 7 hari walau sedikit tapi ini udah progres yang bagus banget di pakai rutin selama 3 bulan hasilnya keliatan cerah apik gitu, sebelumnya sih pakai yang luminos tapi pakai yang dna cell ternyata lebih bagus.', 'aromanya cukup menyengat ya tapi buat aku gak ganggu sih dan lagi cepat menyerap juga di kulit dan sesuai sama keterangannya dapet menyerahkan dalam hari walau sedikit tapi ini udah progres yang bagus banget di pakai rutin selama bulan hasilnya keliatan cerah apik gitu sebelumnya sih pakai yang luminos tapi pakai yang dna cell ternyata lebih bagus', '[\"aromanya\", \"cukup\", \"menyengat\", \"tapi\", \"buat\", \"aku\", \"gak\", \"ganggu\", \"sih\", \"dan\", \"lagi\", \"cepat\", \"menyerap\", \"juga\", \"kulit\", \"dan\", \"sesuai\", \"sama\", \"keterangannya\", \"dapet\", \"menyerahkan\", \"dalam\", \"hari\", \"walau\", \"sedikit\", \"tapi\", \"ini\", \"udah\", \"progres\", \"yang\", \"bagus\", \"banget\", \"pakai\", \"rutin\", \"selama\", \"bulan\", \"hasilnya\", \"keliatan\", \"cerah\", \"apik\", \"gitu\", \"sebelumnya\", \"sih\", \"pakai\", \"yang\", \"luminos\", \"tapi\", \"pakai\", \"yang\", \"dna\", \"cell\", \"ternyata\", \"lebih\", \"bagus\"]', 'aromanya cukup menyengat tapi buat aku gak ganggu sih dan lagi cepat menyerap juga kulit dan sesuai sama keterangannya dapet menyerahkan dalam hari walau sedikit tapi ini udah progres yang bagus banget pakai rutin selama bulan hasilnya keliatan cerah apik gitu sebelumnya sih pakai yang luminos t