(618, 'spring23', 'Dikulit saya biasa aja. Ga ada efek yang gimana2.... bikin jerawat engga, mempengaruhi tekstur wajah tidak, memudarkan bekas jerawat enggaaaa, cerah juga tidak. Bikin kulit kenyal atau lembab? Kenyal iya, lembab b aja. Repurchase? No......', 'dikulit saya biasa aja. ga ada efek yang gimana2.... bikin jerawat engga, mempengaruhi tekstur wajah tidak, memudarkan bekas jerawat enggaaaa, cerah juga tidak. bikin kulit kenyal atau lembab? kenyal iya, lembab b aja. repurchase? no......', 'dikulit saya biasa aja ga ada efek yang gimana bikin jerawat engga mempengaruhi tekstur wajah tidak memudarkan bekas jerawat enggaaaa cerah juga tidak bikin kulit kenyal atau lembab kenyal iya lembab b aja repurchase no', '[\"dikulit\", \"saya\", \"biasa\", \"aja\", \"ada\", \"efek\", \"yang\", \"gimana\", \"bikin\", \"jerawat\", \"engga\", \"mempengaruhi\", \"tekstur\", \"wajah\", \"tidak\", \"memudarkan\", \"bekas\", \"jerawat\", \"enggaaaa\", \"cerah\", \"juga\", \"tidak\", \"bikin\", \"kulit\", \"kenyal\", \"atau\", \"lembab\", \"kenyal\", \"iya\", \"lembab\", \"aja\", \"repurchase\"]', 'dikulit saya biasa aja ada efek yang gimana bikin jerawat engga mempengaruhi tekstur wajah tidak memudarkan bekas jerawat enggaaaa cerah juga tidak bikin kulit kenyal atau lembab kenyal iya lembab aja repurchase', '\"dikulit aja efek gimana bikin jerawat engga mempengaruhi tekstur wajah memudarkan bekas jerawat enggaaaa cerah bikin kulit kenyal lembab kenyal iya lembab aja repurchase\"', 'kulit aja efek gimana bikin jerawat engga pengaruh tekstur wajah pudar bekas jerawat enggaaaa cerah bikin kulit kenyal lembab kenyal iya lembab aja repurchase', 'Netral', '2024-11-29 06:50:11', '2024-11-29 06:50:11', NULL),
