(637, 'Nenglia25', 'Jujur ini tuh tekstur nya kental lengket gitu yaa, berasa nemplok dikulit kalo gini ceritanya. Di aku ga enak banget kalo dipake semuka muka, tapi ini works banget kalo kita make nya dengan cara hanya dijadikan sebagai spot acne treatment. Cukup ditotolin aja ke jerawat nya, besok nya langsung mateng. Tapi ini bukan jerawat tipikal yang mendem ya. Tp gatau kenapa ketika works di totolin di spot2 tertentu, besok besok nya kadang malah nambah jerawat baru, dan malah ninggali bekas PIH wkwk. ', 'jujur ini tuh tekstur nya kental lengket gitu yaa, berasa nemplok dikulit kalo gini ceritanya. di aku ga enak banget kalo dipake semuka muka, tapi ini works banget kalo kita make nya dengan cara hanya dijadikan sebagai spot acne treatment. cukup ditotolin aja ke jerawat nya, besok nya langsung mateng. tapi ini bukan jerawat tipikal yang mendem ya. tp gatau kenapa ketika works di totolin di spot2 tertentu, besok besok nya kadang malah nambah jerawat baru, dan malah ninggali bekas pih wkwk. ', 'jujur ini tuh tekstur nya kental lengket gitu yaa berasa nemplok dikulit kalo gini ceritanya di aku ga enak banget kalo dipake semuka muka tapi ini works banget kalo kita make nya dengan cara hanya dijadikan sebagai spot acne treatment cukup ditotolin aja ke jerawat nya besok nya langsung mateng tapi ini bukan jerawat tipikal yang mendem ya tp gatau kenapa ketika works di totolin di spot tertentu besok besok nya kadang malah nambah jerawat baru dan malah ninggali bekas pih wkwk', '[\"jujur\", \"ini\", \"tuh\", \"tekstur\", \"nya\", \"kental\", \"lengket\", \"gitu\", \"yaa\", \"berasa\", \"nemplok\", \"dikulit\", \"kalo\", \"gini\", \"ceritanya\", \"aku\", \"enak\", \"banget\", \"kalo\", \"dipakai\", \"semuka\", \"muka\", \"tapi\", \"ini\", \"works\", \"banget\", \"kalo\", \"kita\", \"make\", \"nya\", \"dengan\", \"cara\", \"hanya\", \"dijadikan\", \"sebagai\", \"spot\", \"acne\", \"treatment\", \"cukup\", \"ditotolin\", \"aja\", \"jerawat\", \"nya\", \"besok\", \"nya\",