(649, 'mariaagis', 'Asli ini sunscreen super ringan deh. Apa lagi kalau kalian oily skin pasti bakalan suka sama sunscreen ini. Dia itu tipe yg water based kan ya makanya cepat buat ngeblendnya dan waktu untuk meresapnya juga gak begitu lama. Yang paling penting buat aku ini sunscreen gak bikin kulitku jerawatan dan gak memperparah juga. Sejauh ini masih terbaik di tahun 2023, but…..', 'asli ini sunscreen super ringan deh. apa lagi kalau kalian oily skin pasti bakalan suka sama sunscreen ini. dia itu tipe yg water based kan ya makanya cepat buat ngeblendnya dan waktu untuk meresapnya juga gak begitu lama. yang paling penting buat aku ini sunscreen gak bikin kulitku jerawatan dan gak memperparah juga. sejauh ini masih terbaik di tahun 2023, but…..', 'asli ini sunscreen super ringan deh apa lagi kalau kalian oily skin pasti bakalan suka sama sunscreen ini dia itu tipe yg water based kan ya makanya cepat buat ngeblendnya dan waktu untuk meresapnya juga gak begitu lama yang paling penting buat aku ini sunscreen gak bikin kulitku jerawatan dan gak memperparah juga sejauh ini masih terbaik di tahun but', '[\"asli\", \"ini\", \"sunscreen\", \"super\", \"ringan\", \"deh\", \"apa\", \"lagi\", \"kalau\", \"kalian\", \"oily\", \"skin\", \"pasti\", \"bakalan\", \"suka\", \"sama\", \"sunscreen\", \"ini\", \"dia\", \"itu\", \"tipe\", \"water\", \"based\", \"kan\", \"makanya\", \"cepat\", \"buat\", \"ngeblendnya\", \"dan\", \"waktu\", \"untuk\", \"meresapnya\", \"juga\", \"gak\", \"begitu\", \"lama\", \"yang\", \"paling\", \"penting\", \"buat\", \"aku\", \"ini\", \"sunscreen\", \"gak\", \"bikin\", \"kulitku\", \"jerawatan\", \"dan\", \"gak\", \"memperparah\", \"juga\", \"sejauh\", \"ini\", \"masih\", \"terbaik\", \"tahun\", \"but\"]', 'asli ini sunscreen super ringan deh apa lagi kalau kalian oily skin pasti bakalan suka sama sunscreen ini dia itu tipe water based kan makanya cepat buat ngeblendnya dan waktu untuk meresapnya juga gak begitu lama yang paling penting buat aku ini sunscreen gak bikin kulitku jerawatan dan gak memperparah juga sejauh ini masih terbaik tahun but', '\"asli sunscreen super ringan deh oily skin suka sunscreen tipe water based cepat ngeblendnya meresapnya gak sunscreen gak bikin kulitku jerawatan gak memperparah terbaik but\"', 'asli sunscreen super ringan deh oily skin suka sunscreen tipe water based cepat ngeblendnya resap gak sunscreen gak bikin kulit jerawat gak parah baik but', 'Netral', '2024-11-29 06:50:46', '2024-11-29 06:50:46', NULL),
(650, 'gabriellarasati', 'So luvv with this serum!Serum somethinc yang ini bikin bekas jerawatku memudar walaupun efeknya ga kilat ya, but it works on my skin. Selain itu juga serum ini bikin kulitku ga kusam dan bikin mulus alus :))', 'so luvv with this serum!serum somethinc yang ini bikin bekas jerawatku memudar walaupun efeknya ga kilat ya, but it works on my skin. selain itu juga serum ini bikin kulitku ga kusam dan bikin mulus alus :))', 'so luvv with this serumserum somethinc yang ini bikin bekas jerawatku memudar walaupun efeknya ga kilat ya but it works on my skin selain itu juga serum ini bikin kulitku ga kusam dan bikin mulus alus', '[\"luvv\", \"with\", \"this\", \"serumserum\", \"somethinc\", \"yang\", \"ini\", \"bikin\", \"bekas\", \"jerawatku\", \"memudar\", \"walaupun\", \"efeknya\", \"kilat\", \"but\", \"works\", \"skin\", \"selain\", \"itu\", \"juga\", \"serum\", \"ini\", \"bikin\", \"kulitku\", \"kusam\", \"dan\", \"bikin\", \"mulus\", \"alus\"]', 'luvv with this serumserum somethinc yang ini bikin bekas jerawatku memudar walaupun efeknya kilat but works skin selain itu juga serum ini bikin kulitku kusam dan bikin mulus alus', '\"luvv with this serumserum somethinc bikin bekas jerawatku memudar efeknya kilat but works skin serum bikin kulitku kusam bikin mulus alus\"', 'luvv with this serumserum somethinc bikin bekas jerawat pudar efek kilat but works skin serum bikin kulit kusam bikin mulus alus', 'Netral', '2024-11-29 06:50:47', '2024-11-29 06:50:47', NULL),
