(699, 'Ceacillia', 'Tbh di aku belum ada efek apa sih untuk serum niacinamidenya. Awal pemakaian, aku notice timbul beruntusan dan jerawat yang mendem gitu. Tapi setelah dipake berkali\" kulitku udah mulai menyesuaikan sama kandungan serum ini. Untuk efek mencerahkannya belum terlihat, but efek melembapkannya terasa banget❤ Serum ini gada wanginya, dan ingredientsnya juga ga macem\". Repurchase? sepertinya ngga dulu, karna mau cari niacin lebih mantul efeknya hehe. But this serum not bad buat kalian yang mau coba.', 'tbh di aku belum ada efek apa sih untuk serum niacinamidenya. awal pemakaian, aku notice timbul beruntusan dan jerawat yang mendem gitu. tapi setelah dipake berkali\" kulitku udah mulai menyesuaikan sama kandungan serum ini. untuk efek mencerahkannya belum terlihat, but efek melembapkannya terasa banget❤ serum ini gada wanginya, dan ingredientsnya juga ga macem\". repurchase? sepertinya ngga dulu, karna mau cari niacin lebih mantul efeknya hehe. but this serum not bad buat kalian yang mau coba.', 'tbh di aku belum ada efek apa sih untuk serum niacinamidenya awal pemakaian aku notice timbul beruntusan dan jerawat yang mendem gitu tapi setelah dipake berkali kulitku udah mulai menyesuaikan sama kandungan serum ini untuk efek mencerahkannya belum terlihat but efek melembapkannya terasa banget serum ini gada wanginya dan ingredientsnya juga ga macem repurchase sepertinya ngga dulu karna mau cari niacin lebih mantul efeknya hehe but this serum not bad buat kalian yang mau coba', '[\"tbh\", \"aku\", \"belum\", \"ada\", \"efek\", \"apa\", \"sih\", \"untuk\", \"serum\", \"niacinamidenya\", \"awal\", \"pemakaian\", \"aku\", \"notice\", \"timbul\", \"beruntusan\", \"dan\", \"jerawat\", \"yang\", \"mendem\", \"gitu\", \"tapi\", \"setelah\", \"dipakai\", \"berkali\", \"kulitku\", \"udah\", \"mulai\", \"menyesuaikan\", \"sama\", \"kandungan\", \"serum\", \"ini\", \"untuk\", \"efek\", \"mencerahkannya\", \"belum\", \"terlihat\", \"but\", \"efek\", \"melembapkannya\",