(760, 'cicialvio022', 'Bagus banget sumpah buat muka cerah bruntusan berkurang, sesuai dengan iklannya ga buat breakout dimukaku yang sensitif ini ngurangin minyak berlebih juga next mau nyobain aha+bhanya semogo cocok juga kayak niacinemidenya suka banget', 'bagus banget sumpah buat muka cerah bruntusan berkurang, sesuai dengan iklannya ga buat breakout dimukaku yang sensitif ini ngurangin minyak berlebih juga next mau nyobain aha+bhanya semogo cocok juga kayak niacinemidenya suka banget', 'bagus banget sumpah buat muka cerah bruntusan berkurang sesuai dengan iklannya ga buat breakout dimukaku yang sensitif ini ngurangin minyak berlebih juga next mau nyobain ahabhanya semogo cocok juga kayak niacinemidenya suka banget', '[\"bagus\", \"banget\", \"sumpah\", \"buat\", \"muka\", \"cerah\", \"bruntusan\", \"berkurang\", \"sesuai\", \"dengan\", \"iklannya\", \"buat\", \"breakout\", \"dimukaku\", \"yang\", \"sensitif\", \"ini\", \"ngurangin\", \"minyak\", \"berlebih\", \"juga\", \"next\", \"mau\", \"nyobain\", \"ahabhanya\", \"semogo\", \"cocok\", \"juga\", \"kayak\", \"niacinemidenya\", \"suka\", \"banget\"]', 'bagus banget sumpah buat muka cerah bruntusan berkurang sesuai dengan iklannya buat breakout dimukaku yang sensitif ini ngurangin minyak berlebih juga next mau nyobain ahabhanya semogo cocok juga kayak niacinemidenya suka banget', '\"bagus banget sumpah muka cerah bruntusan berkurang sesuai iklannya breakout dimukaku sensitif ngurangin minyak berlebih next nyobain ahabhanya semogo cocok kayak niacinemidenya suka banget\"', 'bagus banget sumpah muka cerah bruntusan kurang sesuai iklan breakout muka sensitif ngurangin minyak lebih next nyobain ahabhanya semogo cocok kayak niacinemidenya suka banget', 'Netral', '2024-11-29 06:52:59', '2024-11-29 06:52:59', NULL),
