(764, 'nisrinasals', 'Ini kalo digabungin sm moisturizer yg mengandung niacinamide juga bakalan powerful utk ngilangin bekas jerawat yg hitam cuma dalam sebulan aja. Bener2 hilang tak bersisa. Serum ini cepet bgt meresap ke kulit tanpa bikin greasy. Hal pertama yg lgsung terlihat dlm 1-3x pemakaian adl bikin muka glowing dan terlihat sehat. Biasanya dipake pas malem hari biar khasiatnya bekerja optimal sembari tidur', 'ini kalo digabungin sm moisturizer yg mengandung niacinamide juga bakalan powerful utk ngilangin bekas jerawat yg hitam cuma dalam sebulan aja. bener2 hilang tak bersisa. serum ini cepet bgt meresap ke kulit tanpa bikin greasy. hal pertama yg lgsung terlihat dlm 1-3x pemakaian adl bikin muka glowing dan terlihat sehat. biasanya dipake pas malem hari biar khasiatnya bekerja optimal sembari tidur', 'ini kalo digabungin sm moisturizer yg mengandung niacinamide juga bakalan powerful utk ngilangin bekas jerawat yg hitam cuma dalam sebulan aja bener hilang tak bersisa serum ini cepet bgt meresap ke kulit tanpa bikin greasy hal pertama yg lgsung terlihat dlm x pemakaian adl bikin muka glowing dan terlihat sehat biasanya dipake pas malem hari biar khasiatnya bekerja optimal sembari tidur', '[\"ini\", \"kalo\", \"digabungin\", \"moisturizer\", \"mengandung\", \"niacinamide\", \"juga\", \"bakalan\", \"powerful\", \"utk\", \"ngilangin\", \"bekas\", \"jerawat\", \"hitam\", \"cuma\", \"dalam\", \"sebulan\", \"aja\", \"bener\", \"hilang\", \"tak\", \"bersisa\", \"serum\", \"ini\", \"cepet\", \"bgt\", \"meresap\", \"kulit\", \"tanpa\", \"bikin\", \"greasy\", \"hal\", \"pertama\", \"lgsung\", \"terlihat\", \"dlm\", \"pemakaian\", \"adl\", \"bikin\", \"muka\", \"glowing\", \"dan\", \"terlihat\", \"sehat\", \"biasanya\", \"dipakai\", \"pas\", \"malem\", \"hari\", \"biar\", \"khasiatnya\", \"bekerja\", \"optimal\", \"sembari\", \"tidur\"]', 'ini kalo digabungin moisturizer mengandung niacinamide juga bakalan powerful utk ngilangin bekas jerawat hitam cuma dalam sebulan aja bener hilang tak bersisa serum ini cepet bgt meresap kulit tanpa bikin greasy hal pertama lgsung terlihat dlm pemakaian adl bikin muka glowing dan terlihat sehat biasanya dipakai pas malem hari biar khasiatnya bekerja optimal sembari tidur', '\"kalo digabungin moisturizer mengandung niacinamide powerful utk ngilangin bekas jerawat hitam sebulan aja bener hilang bersisa serum cepet bgt meresap kulit bikin greasy lgsung dlm pemakaian adl bikin muka glowing sehat dipakai pas malem biar khasiatnya optimal sembari tidur\"', 'kalo digabungin moisturizer kandung niacinamide powerful utk ngilangin bekas jerawat hitam bulan aja bener hilang sisa serum cepet bgt resap kulit bikin greasy lgsung dlm pakai adl bikin muka glowing sehat pakai pas malem biar khasiat optimal sembari tidur', 'Netral', '2024-11-29 06:53:02', '2024-11-29 06:53:02', NULL),
