(766, 'tita_fintasari', 'Ini teksturnya enak banget light, terus ngasih kesan glow seketika. formulasinya buat skin barrier, tapi kalo kulit lagi iritasi dia lumayan perih dipakenya, tapi untuk efek calmingnya tetep dapet. isinya dikit ya tapi packagingnya berat, agak kuramg ideal.', 'ini teksturnya enak banget light, terus ngasih kesan glow seketika. formulasinya buat skin barrier, tapi kalo kulit lagi iritasi dia lumayan perih dipakenya, tapi untuk efek calmingnya tetep dapet. isinya dikit ya tapi packagingnya berat, agak kuramg ideal.', 'ini teksturnya enak banget light terus ngasih kesan glow seketika formulasinya buat skin barrier tapi kalo kulit lagi iritasi dia lumayan perih dipakenya tapi untuk efek calmingnya tetep dapet isinya dikit ya tapi packagingnya berat agak kuramg ideal', '[\"ini\", \"teksturnya\", \"enak\", \"banget\", \"light\", \"terus\", \"ngasih\", \"kesan\", \"glow\", \"seketika\", \"formulasinya\", \"buat\", \"skin\", \"barrier\", \"tapi\", \"kalo\", \"kulit\", \"lagi\", \"iritasi\", \"dia\", \"lumayan\", \"perih\", \"dipakenya\", \"tapi\", \"untuk\", \"efek\", \"calmingnya\", \"tetep\", \"dapet\", \"isinya\", \"dikit\", \"tapi\", \"packagingnya\", \"berat\", \"agak\", \"kuramg\", \"ideal\"]', 'ini teksturnya enak banget light terus ngasih kesan glow seketika formulasinya buat skin barrier tapi kalo kulit lagi iritasi dia lumayan perih dipakenya tapi untuk efek calmingnya tetep dapet isinya dikit tapi packagingnya berat agak kuramg ideal', '\"teksturnya enak banget light ngasih kesan glow formulasinya skin barrier kalo kulit iritasi lumayan perih dipakenya efek calmingnya tetep dapet isinya dikit packagingnya berat kuramg ideal\"', 'tekstur enak banget light ngasih kesan glow formulasi skin barrier kalo kulit iritasi lumayan perih dipakenya efek calmingnya tetep dapet isi dikit packagingnya berat kuramg ideal', 'Netral', '2024-11-29 06:53:05', '2024-11-29 06:53:05', NULL),
