(781, 'Denaranny', 'pas di pake ada efek tone up nya tapi sayang bikin muka kerasa berminyak banget padahal kulitku normal to dray. bener2 ga nyaman. pas dipake juga rada2 kerasa panas gitu. kalo pake bedak menurutku bikin bedak cepat menggumpal. untuk efek mencerahkan ga kerasa sama sekali di aku. tapi jangan takut coba produk ini karena review ku, kita punya tipe kulit yang beda2?', 'pas di pake ada efek tone up nya tapi sayang bikin muka kerasa berminyak banget padahal kulitku normal to dray. bener2 ga nyaman. pas dipake juga rada2 kerasa panas gitu. kalo pake bedak menurutku bikin bedak cepat menggumpal. untuk efek mencerahkan ga kerasa sama sekali di aku. tapi jangan takut coba produk ini karena review ku, kita punya tipe kulit yang beda2?', 'pas di pake ada efek tone up nya tapi sayang bikin muka kerasa berminyak banget padahal kulitku normal to dray bener ga nyaman pas dipake juga rada kerasa panas gitu kalo pake bedak menurutku bikin bedak cepat menggumpal untuk efek mencerahkan ga kerasa sama sekali di aku tapi jangan takut coba produk ini karena review ku kita punya tipe kulit yang beda', '[\"pas\", \"pakai\", \"ada\", \"efek\", \"tone\", \"nya\", \"tapi\", \"sayang\", \"bikin\", \"muka\", \"kerasa\", \"berminyak\", \"banget\", \"padahal\", \"kulitku\", \"normal\", \"dray\", \"bener\", \"nyaman\", \"pas\", \"dipakai\", \"juga\", \"rada\", \"kerasa\", \"panas\", \"gitu\", \"kalo\", \"pakai\", \"bedak\", \"menurutku\", \"bikin\", \"bedak\", \"cepat\", \"menggumpal\", \"untuk\", \"efek\", \"mencerahkan\", \"kerasa\", \"sama\", \"sekali\", \"aku\", \"tapi\", \"jangan\", \"takut\", \"coba\", \"produk\", \"ini\", \"karena\", \"review\", \"kita\", \"punya\", \"tipe\", \"kulit\", \"yang\", \"beda\"]', 'pas pakai ada efek tone nya tapi sayang bikin muka kerasa berminyak banget padahal kulitku normal dray bener nyaman pas dipakai juga rada kerasa panas gitu kalo pakai bedak menurutku bikin bedak cepat menggumpal untuk efek mencerahkan kerasa sama sekali aku tapi jangan takut coba produk ini karena review kita punya tipe kulit yang beda', '\"pas pakai efek tone nya sayang bikin muka kerasa berminyak banget kulitku normal dray bener nyaman pas dipakai rada kerasa panas gitu kalo pakai bedak menurutku bikin bedak cepat menggumpal efek mencerahkan kerasa takut coba produk review tipe kulit beda\"', 'pas pakai efek tone nya sayang bikin muka rasa minyak banget kulit normal dray bener nyaman pas pakai rada rasa panas gitu kalo pakai bedak turut bikin bedak cepat gumpal efek cerah rasa takut coba produk review tipe kulit beda', 'Positif', '2024-11-29 06:53:22', '2024-11-29 06:53:22', NULL),
(782, 'alysa_by', 'harganya cukup mahal tapi buat hasilnya worth it ko, muka aku jadi cerahan pakai ini, di aku hasilnya keliatan pas 5x pemakaian sih, tapi harus dibantu sama skincare yang lain, teksturnya enak ada wanginnya dikit, packagenya 8,5/10 ngga beleberan kemana mana', 'harganya cukup mahal tapi buat hasilnya worth it ko, muka aku jadi cerahan pakai ini, di aku hasilnya keliatan pas 5x pemakaian sih, tapi harus dibantu sama skincare yang lain, teksturnya enak ada wanginnya dikit, packagenya 8,5/10 ngga beleberan kemana mana', 'harganya cukup mahal tapi buat hasilnya worth it ko muka aku jadi cerahan pakai ini di aku hasilnya keliatan pas x pemakaian sih tapi harus dibantu sama skincare yang lain teksturnya enak ada wanginnya dikit packagenya ngga beleberan kemana mana', '[\"harganya\", \"cukup\", \"mahal\", \"tapi\", \"buat\", \"hasilnya\", \"worth\", \"muka\", \"aku\", \"jadi\", \"cerahan\", \"pakai\", \"ini\", \"aku\", \"hasilnya\", \"keliatan\", \"pas\", \"pemakaian\", \"sih\", \"tapi\", \"harus\", \"dibantu\", \"sama\", \"skincare\", \"yang\", \"lain\", \"teksturnya\", \"enak\", \"ada\", \"wanginnya\", \"dikit\", \"packagenya\", \"ngga\", \"beleberan\", \"kemana\", \"mana\"]', 'harganya cukup mahal tapi buat hasilnya worth muka aku jadi cerahan pakai ini aku hasilnya keliatan pas pemakaian sih tapi harus dibantu sama skincare yang lain teksturnya enak ada wanginnya dikit packagenya ngga beleberan kemana mana', '\"harganya mahal hasilnya worth muka cerahan pakai hasilnya keliatan pas pemakaian sih dibantu skincare teksturnya enak wanginnya dikit packagenya ngga beleberan kemana\"', 'harga mahal hasil worth muka cerah pakai hasil liat pas pakai sih bantu skincare tekstur enak wanginnya dikit packagenya ngga beber mana', 'Positif', '2024-11-29 06:53:23', '2024-11-29 06:53:23', NULL),
(783, 'ViraSungkar', 'Buat kulit combinasi sensitif aman, ga buat breakout . Tp gada prubahan cerahan gt d muka. Efeknya blm ngerasain banget atau krna ak pakai yg 5% mungkn klau udh abs cobain yg 10% kali yaa. Mungkn lbh kliatan, sukanya ga buat bruntus sih jd aman.', 'buat kulit combinasi sensitif aman, ga buat breakout . tp gada prubahan cerahan gt d muka. efeknya blm ngerasain banget atau krna ak pakai yg 5% mungkn klau udh abs cobain yg 10% kali yaa. mungkn lbh kliatan, sukanya ga buat bruntus sih jd aman.', 'buat kulit combinasi sensitif aman ga buat breakout tp gada prubahan cerahan gt d muka efeknya blm ngerasain banget atau krna ak pakai yg mungkn klau udh abs cobain yg kali yaa mungkn lbh kliatan sukanya ga buat bruntus sih jd aman', '[\"buat\", \"kulit\", \"combinasi\", \"sensitif\", \"aman\", \"buat\", \"breakout\", \"gada\", \"prubahan\", \"cerahan\", \"muka\", \"efeknya\", \"blm\", \"ngerasain\", \"banget\", \"atau\", \"krna\", \"pakai\", \"mungkn\", \"klau\", \"sudah\", \"abs\", \"cobain\", \"kali\", \"yaa\", \"mungkn\", \"lbh\", \"kliatan\", \"sukanya\", \"buat\", \"bruntus\", \"sih\", \"aman\"]', 'buat kulit combinasi sensitif aman buat breakout gada prubahan cerahan muka efeknya blm ngerasain banget atau krna pakai mungkn klau sudah abs cobain kali yaa mungkn lbh kliatan sukanya buat bruntus sih aman', '\"kulit combinasi sensitif aman breakout gada prubahan cerahan muka efeknya blm ngerasain banget krna pakai mungkn klau abs cobain kali yaa mungkn lbh kliatan sukanya bruntus sih aman\"', 'kulit combinasi sensitif aman breakout gada prubahan cerah muka efek blm ngerasain banget krna pakai mungkn klau abs cobain kali yaa mungkn lbh kliatan suka bruntus sih aman', 'Positif', '2024-11-29 06:53:25', '2024-11-29 06:53:25', NULL),
(784, 'zilvia28', 'Sulit untuk meresap dikulitku, untuk wangi sih ada ya cuma ga strong banget persis bau obat. Uda mau 3 bulan cobain ini produk, entah kulitku aja yang ga cocok atau gimana. Ini produk cuma beberapa kali aku pakai karena tiap kali pakai ujungnya pasti breakout, sementara jerawat yang lama aja belum sembuh betul. Alhasil kulitku sekarang kayak gradakan gitu ?', 'sulit untuk meresap dikulitku, untuk wangi sih ada ya cuma ga strong banget persis bau obat. uda mau 3 bulan cobain ini produk, entah kulitku aja yang ga cocok atau gimana. ini produk cuma beberapa kali aku pakai karena tiap kali pakai ujungnya pasti breakout, sementara jerawat yang lama aja belum sembuh betul. alhasil kulitku sekarang kayak gradakan gitu ?', 'sulit untuk meresap dikulitku untuk wangi sih ada ya cuma ga strong banget persis bau obat uda mau bulan cobain ini produk entah kulitku aja yang ga cocok atau gimana ini produk cuma beberapa kali aku pakai karena tiap kali pakai ujungnya pasti breakout sementara jerawat yang lama aja belum sembuh betul alhasil kulitku sekarang kayak gradakan gitu', '[\"sulit\", \"untuk\", \"meresap\", \"dikulitku\", \"untuk\", \"wangi\", \"sih\", \"ada\", \"cuma\", \"strong\", \"banget\", \"persis\", \"bau\", \"obat\", \"uda\", \"mau\", \"bulan\", \"cobain\", \"ini\", \"produk\", \"entah\", \"kulitku\", \"aja\", \"yang\", \"cocok\", \"atau\", \"gimana\", \"ini\", \"produk\", \"cuma\", \"beberapa\", \"kali\", \"aku\", \"pakai\", \"karena\", \"tiap\", \"kali\", \"pakai\", \"ujungnya\", \"pasti\", \"breakout\", \"sementara\", \"jerawat\", \"yang\", \"lama\", \"aja\", \"belum\", \"sembuh\", \"betul\", \"alhasil\", \"kulitku\", \"sekarang\", \"kayak\", \"gradakan\", \"gitu\"]', 'sulit untuk meresap dikulitku untuk wangi sih ada cuma strong banget persis bau obat uda mau bulan cobain ini produk entah kulitku aja yang cocok atau gimana ini produk cuma beberapa kali aku pakai karena tiap kali pakai ujungnya pasti breakout sementara jerawat yang lama aja belum sembuh betul alhasil kulitku sekarang kayak gradakan gitu', '\"sulit meresap dikulitku wangi sih strong banget persis bau obat uda cobain produk kulitku aja cocok gimana produk kali pakai kali pakai ujungnya breakout jerawat aja sembuh alhasil kulitku kayak gradakan gitu\"', 'sulit resap kulit wangi sih strong banget persis bau obat uda cobain produk kulit aja cocok gimana produk kali pakai kali pakai ujung breakout jerawat aja sembuh alhasil kulit kayak gradakan gitu', 'Positif', '2024-11-29 06:53:26', '2024-11-29 06:53:26', NULL),
(785, 'cutsalwaaa', 'BENERAN DEH, aku coba pakai 7 hari ini beneran dong bikin mencerahkan + mukaku jadi lebih glowing, dulunya kusam bgtt, sekarang pake white cell dna moght cream ditambah serumnya baguss pollll, yg mau cerahin kulit aku saranin banget sih inii?', 'beneran deh, aku coba pakai 7 hari ini beneran dong bikin mencerahkan + mukaku jadi lebih glowing, dulunya kusam bgtt, sekarang pake white cell dna moght cream ditambah serumnya baguss pollll, yg mau cerahin kulit aku saranin banget sih inii?', 'beneran deh aku coba pakai hari ini beneran dong bikin mencerahkan mukaku jadi lebih glowing dulunya kusam bgtt sekarang pake white cell dna moght cream ditambah serumnya baguss pollll yg mau cerahin kulit aku saranin banget sih inii', '[\"beneran\", \"deh\", \"aku\", \"coba\", \"pakai\", \"hari\", \"ini\", \"beneran\", \"dong\", \"bikin\", \"mencerahkan\", \"mukaku\", \"jadi\", \"lebih\", \"glowing\", \"dulunya\", \"kusam\", \"bgtt\", \"sekarang\", \"pakai\", \"white\", \"cell\", \"dna\", \"moght\", \"cream\", \"ditambah\", \"serumnya\", \"baguss\", \"pollll\", \"mau\", \"cerahin\", \"kulit\", \"aku\", \"saranin\", \"banget\", \"sih\", \"inii\"]', 'beneran deh aku coba pakai hari ini beneran dong bikin mencerahkan mukaku jadi lebih glowing dulunya kusam bgtt sekarang pakai white cell dna moght cream ditambah serumnya baguss pollll mau cerahin kulit aku saranin banget sih inii', '\"beneran deh coba pakai beneran bikin mencerahkan mukaku glowing dulunya kusam bgtt pakai white cell dna moght cream ditambah serumnya baguss pollll cerahin kulit saranin banget sih inii\"', 'beneran deh coba pakai beneran bikin cerah muka glowing dulunya kusam bgtt pakai white cell dna moght cream tambah serum baguss pollll cerahin kulit saranin banget sih ini', 'Positif', '2024-11-29 06:53:28', '2024-11-29 06:53:28', NULL);
