(787, 'irmarismay', 'Dapet rekomendasi pake produk ini dari sahabat aku. Katanya pas banget buat yg mau memperbaikin skin barier. Di aku bikin kulit lembab, lebih cerah, ngurangin kemerahan pada jerawat. Teksturnya agak kental dibanding serum lain, tapi cepet meresap.', 'dapet rekomendasi pake produk ini dari sahabat aku. katanya pas banget buat yg mau memperbaikin skin barier. di aku bikin kulit lembab, lebih cerah, ngurangin kemerahan pada jerawat. teksturnya agak kental dibanding serum lain, tapi cepet meresap.', 'dapet rekomendasi pake produk ini dari sahabat aku katanya pas banget buat yg mau memperbaikin skin barier di aku bikin kulit lembab lebih cerah ngurangin kemerahan pada jerawat teksturnya agak kental dibanding serum lain tapi cepet meresap', '[\"dapet\", \"rekomendasi\", \"pakai\", \"produk\", \"ini\", \"dari\", \"sahabat\", \"aku\", \"katanya\", \"pas\", \"banget\", \"buat\", \"mau\", \"memperbaikin\", \"skin\", \"barier\", \"aku\", \"bikin\", \"kulit\", \"lembab\", \"lebih\", \"cerah\", \"ngurangin\", \"kemerahan\", \"pada\", \"jerawat\", \"teksturnya\", \"agak\", \"kental\", \"dibanding\", \"serum\", \"lain\", \"tapi\", \"cepet\", \"meresap\"]', 'dapet rekomendasi pakai produk ini dari sahabat aku katanya pas banget buat mau memperbaikin skin barier aku bikin kulit lembab lebih cerah ngurangin kemerahan pada jerawat teksturnya agak kental dibanding serum lain tapi cepet meresap', '\"dapet rekomendasi pakai produk sahabat pas banget memperbaikin skin barier bikin kulit lembab cerah ngurangin kemerahan jerawat teksturnya kental dibanding serum cepet meresap\"', 'dapet rekomendasi pakai produk sahabat pas banget memperbaikin skin barier bikin kulit lembab cerah ngurangin merah jerawat tekstur kental banding serum cepet resap', 'Positif', '2024-11-29 06:53:30', '2024-11-29 06:53:30', NULL),
(788, 'nelarosalinaa', 'ringann banget ga perih di mataaa, mukaku yang sensitif jugaa aman banget pakee ini, teruss gampang di blend jugaaa wahh asli sih ni produk titisann dari surgaaa benerbenerr bakal aku beli lagi bulan depan ', 'ringann banget ga perih di mataaa, mukaku yang sensitif jugaa aman banget pakee ini, teruss gampang di blend jugaaa wahh asli sih ni produk titisann dari surgaaa benerbenerr bakal aku beli lagi bulan depan ', 'ringann banget ga perih di mataaa mukaku yang sensitif jugaa aman banget pakee ini teruss gampang di blend jugaaa wahh asli sih ni produk titisann dari surgaaa benerbenerr bakal aku beli lagi bulan depan', '[\"ringann\", \"banget\", \"perih\", \"mataaa\", \"mukaku\", \"yang\", \"sensitif\", \"jugaa\", \"aman\", \"banget\", \"pakee\", \"ini\", \"teruss\", \"gampang\", \"blend\", \"jugaaa\", \"wahh\", \"asli\", \"sih\", \"produk\", \"titisann\", \"dari\", \"surgaaa\", \"benerbenerr\", \"bakal\", \"aku\", \"beli\", \"lagi\", \"bulan\", \"depan\"]', 'ringann banget perih mataaa mukaku yang sensitif jugaa aman banget pakee ini teruss gampang blend jugaaa wahh asli sih produk titisann dari surgaaa benerbenerr bakal aku beli lagi bulan depan', '\"ringann banget perih mataaa mukaku sensitif jugaa aman banget pakee teruss gampang blend jugaaa wahh asli sih produk titisann surgaaa benerbenerr beli\"', 'ringann banget perih mataaa muka sensitif jugaa aman banget pakee teruss gampang blend jugaaa wahh asli sih produk titisann surgaaa benerbenerr beli', 'Positif', '2024-11-29 06:53:32', '2024-11-29 06:53:32', NULL),
(789, 'Ditajuwita', 'Seneng banget sama serum ini karena bikin lembab tapi ga bikin muka jadi berminyak. Dia juga teksturnya cair banget dan cepeeet banget menyerap. Untuk efek mencerahkan, dia ini ada banget mirip-mirip brand sebelah. Dia juga cukup oke untuk menghilangkan darkspot bekas jerawat.', 'seneng banget sama serum ini karena bikin lembab tapi ga bikin muka jadi berminyak. dia juga teksturnya cair banget dan cepeeet banget menyerap. untuk efek mencerahkan, dia ini ada banget mirip-mirip brand sebelah. dia juga cukup oke untuk menghilangkan darkspot bekas jerawat.', 'seneng banget sama serum ini karena bikin lembab tapi ga bikin muka jadi berminyak dia juga teksturnya cair banget dan cepeeet banget menyerap untuk efek mencerahkan dia ini ada banget miripmirip brand sebelah dia juga cukup oke untuk menghilangkan darkspot bekas jerawat', '[\"seneng\", \"banget\", \"sama\", \"serum\", \"ini\", \"karena\", \"bikin\", \"lembab\", \"tapi\", \"bikin\", \"muka\", \"jadi\", \"berminyak\", \"dia\", \"juga\", \"teksturnya\", \"cair\", \"banget\", \"dan\", \"cepeeet\", \"banget\", \"menyerap\", \"untuk\", \"efek\", \"mencerahkan\", \"dia\", \"ini\", \"ada\", \"banget\", \"miripmirip\", \"brand\", \"sebelah\", \"dia\", \"juga\", \"cukup\", \"oke\", \"untuk\", \"menghilangkan\", \"darkspot\", \"bekas\", \"jerawat\"]', 'seneng banget sama serum ini karena bikin lembab tapi bikin muka jadi berminyak dia juga teksturnya cair banget dan cepeeet banget menyerap untuk efek mencerahkan dia ini ada banget miripmirip brand sebelah dia juga cukup oke untuk menghilangkan darkspot bekas jerawat', '\"seneng banget serum bikin lembab bikin muka berminyak teksturnya cair banget cepeeet banget menyerap efek mencerahkan banget miripmirip brand sebelah oke menghilangkan darkspot bekas jerawat\"', 'neng banget serum bikin lembab bikin muka minyak tekstur cair banget cepeeet banget serap efek cerah banget miripmirip brand belah oke hilang darkspot bekas jerawat', 'Positif', '2024-11-29 06:53:33', '2024-11-29 06:53:33', NULL),
(790, 'marine_blue', 'Suka dengan produk ini, dia ampuh untuk hydrating kulit dan memperbaiki tekstur kulit yang kasar karna kering. Untuk Efek mencerahkannya belum terlihat padahal udah botol ke-2, tapi tetap lanjut pakai', 'suka dengan produk ini, dia ampuh untuk hydrating kulit dan memperbaiki tekstur kulit yang kasar karna kering. untuk efek mencerahkannya belum terlihat padahal udah botol ke-2, tapi tetap lanjut pakai', 'suka dengan produk ini dia ampuh untuk hydrating kulit dan memperbaiki tekstur kulit yang kasar karna kering untuk efek mencerahkannya belum terlihat padahal udah botol ke tapi tetap lanjut pakai', '[\"suka\", \"dengan\", \"produk\", \"ini\", \"dia\", \"ampuh\", \"untuk\", \"hydrating\", \"kulit\", \"dan\", \"memperbaiki\", \"tekstur\", \"kulit\", \"yang\", \"kasar\", \"karna\", \"kering\", \"untuk\", \"efek\", \"mencerahkannya\", \"belum\", \"terlihat\", \"padahal\", \"udah\", \"botol\", \"tapi\", \"tetap\", \"lanjut\", \"pakai\"]', 'suka dengan produk ini dia ampuh untuk hydrating kulit dan memperbaiki tekstur kulit yang kasar karna kering untuk efek mencerahkannya belum terlihat padahal udah botol tapi tetap lanjut pakai', '\"suka produk ampuh hydrating kulit memperbaiki tekstur kulit kasar karna kering efek mencerahkannya udah botol pakai\"', 'suka produk ampuh hydrating kulit baik tekstur kulit kasar karna kering efek cerah udah botol pakai', 'Positif', '2024-11-29 06:53:33', '2024-11-29 06:53:33', NULL),
(791, 'Safitriiiii', 'Gatau lagi buat produk yg satu ini. Ini bagus banget buat cerahin wajah, mudarin darkspot, dan ada anti agingnya juga. Packagingnya juga kuerennn... Cuman aku agak kurang suka sama wanginya. But, efek di wajah keliatan bgt after before pemakaian serum ini.', 'gatau lagi buat produk yg satu ini. ini bagus banget buat cerahin wajah, mudarin darkspot, dan ada anti agingnya juga. packagingnya juga kuerennn... cuman aku agak kurang suka sama wanginya. but, efek di wajah keliatan bgt after before pemakaian serum ini.', 'gatau lagi buat produk yg satu ini ini bagus banget buat cerahin wajah mudarin darkspot dan ada anti agingnya juga packagingnya juga kuerennn cuman aku agak kurang suka sama wanginya but efek di wajah keliatan bgt after before pemakaian serum ini', '[\"gatau\", \"lagi\", \"buat\", \"produk\", \"satu\", \"ini\", \"ini\", \"bagus\", \"banget\", \"buat\", \"cerahin\", \"wajah\", \"mudarin\", \"darkspot\", \"dan\", \"ada\", \"anti\", \"agingnya\", \"juga\", \"packagingnya\", \"juga\", \"kuerennn\", \"cuman\", \"aku\", \"agak\", \"kurang\", \"suka\", \"sama\", \"wanginya\", \"but\", \"efek\", \"wajah\", \"keliatan\", \"bgt\", \"after\", \"before\", \"pemakaian\", \"serum\", \"ini\"]', 'gatau lagi buat produk satu ini ini bagus banget buat cerahin wajah mudarin darkspot dan ada anti agingnya juga packagingnya juga kuerennn cuman aku agak kurang suka sama wanginya but efek wajah keliatan bgt after before pemakaian serum ini', '\"gatau produk bagus banget cerahin wajah mudarin darkspot anti agingnya packagingnya kuerennn cuman suka wanginya but efek wajah keliatan bgt after before pemakaian serum\"', 'gatau produk bagus banget cerahin wajah mudarin darkspot anti agingnya packagingnya kuerennn cuman suka wangi but efek wajah liat bgt after before pakai serum', 'Positif', '2024-11-29 06:53:34', '2024-11-29 06:53:34', NULL),
(792, 'qorinaab', 'Serum ini bagus bgt buat yang pgn wajahnya lebih lembab dan cerah tapi baru coba2 pake skincare. Feelsnya di aku ga berat samsek, lembabnya dapet, cerahnya juga dapet bgt dong dan ga lengket di muka. Awalnya aku pake yg 5% dulu, trs baru naik tingkat pakai yg 10%.', 'serum ini bagus bgt buat yang pgn wajahnya lebih lembab dan cerah tapi baru coba2 pake skincare. feelsnya di aku ga berat samsek, lembabnya dapet, cerahnya juga dapet bgt dong dan ga lengket di muka. awalnya aku pake yg 5% dulu, trs baru naik tingkat pakai yg 10%.', 'serum ini bagus bgt buat yang pgn wajahnya lebih lembab dan cerah tapi baru coba pake skincare feelsnya di aku ga berat samsek lembabnya dapet cerahnya juga dapet bgt dong dan ga lengket di muka awalnya aku pake yg dulu trs baru naik tingkat pakai yg', '[\"serum\", \"ini\", \"bagus\", \"bgt\", \"buat\", \"yang\", \"pgn\", \"wajahnya\", \"lebih\", \"lembab\", \"dan\", \"cerah\", \"tapi\", \"baru\", \"coba\", \"pakai\", \"skincare\", \"feelsnya\", \"aku\", \"berat\", \"samsek\", \"lembabnya\", \"dapet\", \"cerahnya\", \"juga\", \"dapet\", \"bgt\", \"dong\", \"dan\", \"lengket\", \"muka\", \"awalnya\", \"aku\", \"pakai\", \"dulu\", \"trs\", \"baru\", \"naik\", \"tingkat\", \"pakai\"]', 'serum ini bagus bgt buat yang pgn wajahnya lebih lembab dan cerah tapi baru coba pakai skincare feelsnya aku berat samsek lembabnya dapet cerahnya juga dapet bgt dong dan lengket muka awalnya aku pakai dulu trs baru naik tingkat pakai', '\"serum bagus bgt pgn wajahnya lembab cerah coba pakai skincare feelsnya berat samsek lembabnya dapet cerahnya dapet bgt lengket muka pakai trs tingkat pakai\"', 'serum bagus bgt pgn wajah lembab cerah coba pakai skincare feelsnya berat samsek lembabnya dapet cerah dapet bgt lengket muka pakai trs tingkat pakai', 'Positif', '2024-11-29 06:53:36', '2024-11-29 06:53:36', NULL),
(793, 'kardus', 'Aku pake ini kurang lebih udah 3 bulan hasilnya bagus di muka ku aku suka pake ini, keliatan lebih bersih muka ku dan jadi lebih glowing wkwkwk aku ngerasanya, tapi overall aku suka produk ini next bakal aku beli lagi sih kalo yg stok ku ini udah habis', 'aku pake ini kurang lebih udah 3 bulan hasilnya bagus di muka ku aku suka pake ini, keliatan lebih bersih muka ku dan jadi lebih glowing wkwkwk aku ngerasanya, tapi overall aku suka produk ini next bakal aku beli lagi sih kalo yg stok ku ini udah habis', 'aku pake ini kurang lebih udah bulan hasilnya bagus di muka ku aku suka pake ini keliatan lebih bersih muka ku dan jadi lebih glowing wkwkwk aku ngerasanya tapi overall aku suka produk ini next bakal aku beli lagi sih kalo yg stok ku ini udah habis', '[\"aku\", \"pakai\", \"ini\", \"kurang\", \"lebih\", \"udah\", \"bulan\", \"hasilnya\", \"bagus\", \"muka\", \"aku\", \"suka\", \"pakai\", \"ini\", \"keliatan\", \"lebih\", \"bersih\", \"muka\", \"dan\", \"jadi\", \"lebih\", \"glowing\", \"wkwkwk\", \"aku\", \"ngerasanya\", \"tapi\", \"overall\", \"aku\", \"suka\", \"produk\", \"ini\", \"next\", \"bakal\", \"aku\", \"beli\", \"lagi\", \"sih\", \"kalo\", \"stok\", \"ini\", \"udah\", \"habis\"]', 'aku pakai ini kurang lebih udah bulan hasilnya bagus muka aku suka pakai ini keliatan lebih bersih muka dan jadi lebih glowing wkwkwk aku ngerasanya tapi overall aku suka produk ini next bakal aku beli lagi sih kalo stok ini udah habis', '\"pakai udah hasilnya bagus muka suka pakai keliatan bersih muka glowing wkwkwk ngerasanya overall suka produk next beli sih kalo stok udah habis\"', 'pakai udah hasil bagus muka suka pakai liat bersih muka glowing wkwkwk ngerasanya overall suka produk next beli sih kalo stok udah habis', 'Positif', '2024-11-29 06:53:36', '2024-11-29 06:53:36', NULL),
(794, 'Nikennuryw', 'Saya rutin pake yang somethinc 5% selama 3 bulan-an dan alhamdulillah mukaku jadi lebih cerahan, bersih dan memperbaiki skin barier jadi tidak gampang jerawatan muka jadi mulus gitu. thanks somethinc ', 'saya rutin pake yang somethinc 5% selama 3 bulan-an dan alhamdulillah mukaku jadi lebih cerahan, bersih dan memperbaiki skin barier jadi tidak gampang jerawatan muka jadi mulus gitu. thanks somethinc ', 'saya rutin pake yang somethinc selama bulanan dan alhamdulillah mukaku jadi lebih cerahan bersih dan memperbaiki skin barier jadi tidak gampang jerawatan muka jadi mulus gitu thanks somethinc', '[\"saya\", \"rutin\", \"pakai\", \"yang\", \"somethinc\", \"selama\", \"bulanan\", \"dan\", \"alhamdulillah\", \"mukaku\", \"jadi\", \"lebih\", \"cerahan\", \"bersih\", \"dan\", \"memperbaiki\", \"skin\", \"barier\", \"jadi\", \"tidak\", \"gampang\", \"jerawatan\", \"muka\", \"jadi\", \"mulus\", \"gitu\", \"thanks\", \"somethinc\"]', 'saya rutin pakai yang somethinc selama bulanan dan alhamdulillah mukaku jadi lebih cerahan bersih dan memperbaiki skin barier jadi tidak gampang jerawatan muka jadi mulus gitu thanks somethinc', '\"rutin pakai somethinc bulanan alhamdulillah mukaku cerahan bersih memperbaiki skin barier gampang jerawatan muka mulus gitu thanks somethinc\"', 'rutin pakai somethinc bulan alhamdulillah muka cerah bersih baik skin barier gampang jerawat muka mulus gitu thanks somethinc', 'Positif', '2024-11-29 06:53:37', '2024-11-29 06:53:37', NULL),
(795, 'ecanandatsy', 'Teksturnya cair kayak air, ada boba pink gitu didalamnya, gak ada wanginya, cepat meresap, untuk 100 ml botolnya pas gak kegedean maupun kekebalan bahkan bisa dipake sampai 6 bulan. Tapi klaim melembabkan dan mencerahkan gak terlihat di aku meskipun sudah pakai satu paket', 'teksturnya cair kayak air, ada boba pink gitu didalamnya, gak ada wanginya, cepat meresap, untuk 100 ml botolnya pas gak kegedean maupun kekebalan bahkan bisa dipake sampai 6 bulan. tapi klaim melembabkan dan mencerahkan gak terlihat di aku meskipun sudah pakai satu paket', 'teksturnya cair kayak air ada boba pink gitu didalamnya gak ada wanginya cepat meresap untuk ml botolnya pas gak kegedean maupun kekebalan bahkan bisa dipake sampai bulan tapi klaim melembabkan dan mencerahkan gak terlihat di aku meskipun sudah pakai satu paket', '[\"teksturnya\", \"cair\", \"kayak\", \"air\", \"ada\", \"boba\", \"pink\", \"gitu\", \"didalamnya\", \"gak\", \"ada\", \"wanginya\", \"cepat\", \"meresap\", \"untuk\", \"botolnya\", \"pas\", \"gak\", \"kegedean\", \"maupun\", \"kekebalan\", \"bahkan\", \"bisa\", \"dipakai\", \"sampai\", \"bulan\", \"tapi\", \"klaim\", \"melembabkan\", \"dan\", \"mencerahkan\", \"gak\", \"terlihat\", \"aku\", \"meskipun\", \"sudah\", \"pakai\", \"satu\", \"paket\"]', 'teksturnya cair kayak air ada boba pink gitu didalamnya gak ada wanginya cepat meresap untuk botolnya pas gak kegedean maupun kekebalan bahkan bisa dipakai sampai bulan tapi klaim melembabkan dan mencerahkan gak terlihat aku meskipun sudah pakai satu paket', '\"teksturnya cair kayak air boba pink gitu didalamnya gak wanginya cepat meresap botolnya pas gak kegedean kekebalan dipakai klaim melembabkan mencerahkan gak pakai paket\"', 'tekstur cair kayak air boba pink gitu dalam gak wangi cepat resap botol pas gak gede kebal pakai klaim melembabkan cerah gak pakai paket', 'Positif', '2024-11-29 06:53:38', '2024-11-29 06:53:38', NULL),
