(808, 'angela_firdaus', 'Coba produk ini direkomendasiin sama member fd katanya niacin bisa mencerahkan wajah, jadi aku coba si somethinc ini. Teksturnya gampang menyerap dan wanginya juga gak aneh-aneh. Aku pakai ini cuma satu botol aja karena aku merasa efek mencerahkannya kurang signifikan yaa.. Di wajahku ini cenderung lebih mengontrol minyak di wajah, dan gak ada efek yang buruk sih. Cuma untuk mencerahkan ya itu tadi, hasilnya mungkin lama.', 'coba produk ini direkomendasiin sama member fd katanya niacin bisa mencerahkan wajah, jadi aku coba si somethinc ini. teksturnya gampang menyerap dan wanginya juga gak aneh-aneh. aku pakai ini cuma satu botol aja karena aku merasa efek mencerahkannya kurang signifikan yaa.. di wajahku ini cenderung lebih mengontrol minyak di wajah, dan gak ada efek yang buruk sih. cuma untuk mencerahkan ya itu tadi, hasilnya mungkin lama.', 'coba produk ini direkomendasiin sama member fd katanya niacin bisa mencerahkan wajah jadi aku coba si somethinc ini teksturnya gampang menyerap dan wanginya juga gak anehaneh aku pakai ini cuma satu botol aja karena aku merasa efek mencerahkannya kurang signifikan yaa di wajahku ini cenderung lebih mengontrol minyak di wajah dan gak ada efek yang buruk sih cuma untuk mencerahkan ya itu tadi hasilnya mungkin lama', '[\"coba\", \"produk\", \"ini\", \"direkomendasiin\", \"sama\", \"member\", \"katanya\", \"niacin\", \"bisa\", \"mencerahkan\", \"wajah\", \"jadi\", \"aku\", \"coba\", \"somethinc\", \"ini\", \"teksturnya\", \"gampang\", \"menyerap\", \"dan\", \"wanginya\", \"juga\", \"gak\", \"anehaneh\", \"aku\", \"pakai\", \"ini\", \"cuma\", \"satu\", \"botol\", \"aja\", \"karena\", \"aku\", \"merasa\", \"efek\", \"mencerahkannya\", \"kurang\", \"signifikan\", \"yaa\", \"wajahku\", \"ini\", \"cenderung\", \"lebih\", \"mengontrol\", \"minyak\", \"wajah\", \"dan\", \"gak\", \"ada\", \"efek\", \"yang\", \"buruk\", \"sih\", \"cuma\", \"untuk\", \"mencerahkan\", \"itu\", \"tadi\", \"hasilnya\", \"mungkin\", \