(810, 'Arumpm', 'Dulu takut cobain produk ini. Tapi, memberanikan diri coba. Sekarang, entah udah botol ke berapa yang aku habiskan untuk produk ini. Secinta ituu lah. Teksturnya gak cair banget, tapi mudah menyerap dan gak lengket kalau dilayer pake serum jenis lain. Yang kulitnya kusam, wajib cobain sih!', 'dulu takut cobain produk ini. tapi, memberanikan diri coba. sekarang, entah udah botol ke berapa yang aku habiskan untuk produk ini. secinta ituu lah. teksturnya gak cair banget, tapi mudah menyerap dan gak lengket kalau dilayer pake serum jenis lain. yang kulitnya kusam, wajib cobain sih!', 'dulu takut cobain produk ini tapi memberanikan diri coba sekarang entah udah botol ke berapa yang aku habiskan untuk produk ini secinta ituu lah teksturnya gak cair banget tapi mudah menyerap dan gak lengket kalau dilayer pake serum jenis lain yang kulitnya kusam wajib cobain sih', '[\"dulu\", \"takut\", \"cobain\", \"produk\", \"ini\", \"tapi\", \"memberanikan\", \"diri\", \"coba\", \"sekarang\", \"entah\", \"udah\", \"botol\", \"berapa\", \"yang\", \"aku\", \"habiskan\", \"untuk\", \"produk\", \"ini\", \"secinta\", \"ituu\", \"lah\", \"teksturnya\", \"gak\", \"cair\", \"banget\", \"tapi\", \"mudah\", \"menyerap\", \"dan\", \"gak\", \"lengket\", \"kalau\", \"dilayer\", \"pakai\", \"serum\", \"jenis\", \"lain\", \"yang\", \"kulitnya\", \"kusam\", \"wajib\", \"cobain\", \"sih\"]', 'dulu takut cobain produk ini tapi memberanikan diri coba sekarang entah udah botol berapa yang aku habiskan untuk produk ini secinta ituu lah teksturnya gak cair banget tapi mudah menyerap dan gak lengket kalau dilayer pakai serum jenis lain yang kulitnya kusam wajib cobain sih', '\"takut cobain produk memberanikan coba udah botol habiskan produk secinta ituu teksturnya gak cair banget mudah menyerap gak lengket dilayer pakai serum jenis kulitnya kusam wajib cobain sih\"', 'takut cobain produk berani coba udah botol habis produk cinta ituu tekstur gak cair banget mudah serap gak lengket layer pak