(811, 'hamasah_uwi', 'Pelembab ini teksturnya lembut banget. Mengandung 7 jenis ceramides, 4dhyaluronic acid, acetyl hexapeptide dan camellia leaf extract. Pakai ini kulit terasa lembab dan lembut. Kurangnya di ukurannya yang mini, jadi rasanya cepat habis gitu. ', 'pelembab ini teksturnya lembut banget. mengandung 7 jenis ceramides, 4dhyaluronic acid, acetyl hexapeptide dan camellia leaf extract. pakai ini kulit terasa lembab dan lembut. kurangnya di ukurannya yang mini, jadi rasanya cepat habis gitu. ', 'pelembab ini teksturnya lembut banget mengandung jenis ceramides dhyaluronic acid acetyl hexapeptide dan camellia leaf extract pakai ini kulit terasa lembab dan lembut kurangnya di ukurannya yang mini jadi rasanya cepat habis gitu', '[\"pelembab\", \"ini\", \"teksturnya\", \"lembut\", \"banget\", \"mengandung\", \"jenis\", \"ceramides\", \"dhyaluronic\", \"acid\", \"acetyl\", \"hexapeptide\", \"dan\", \"camellia\", \"leaf\", \"extract\", \"pakai\", \"ini\", \"kulit\", \"terasa\", \"lembab\", \"dan\", \"lembut\", \"kurangnya\", \"ukurannya\", \"yang\", \"mini\", \"jadi\", \"rasanya\", \"cepat\", \"habis\", \"gitu\"]', 'pelembab ini teksturnya lembut banget mengandung jenis ceramides dhyaluronic acid acetyl hexapeptide dan camellia leaf extract pakai ini kulit terasa lembab dan lembut kurangnya ukurannya yang mini jadi rasanya cepat habis gitu', '\"pelembab teksturnya lembut banget mengandung jenis ceramides dhyaluronic acid acetyl hexapeptide camellia leaf extract pakai kulit lembab lembut kurangnya ukurannya mini cepat habis gitu\"', 'pelembab tekstur lembut banget kandung jenis ceramides dhyaluronic acid acetyl hexapeptide camellia leaf extract pakai kulit lembab lembut kurang ukur mini cepat habis gitu', 'Positif', '2024-11-29 06:53:58', '2024-11-29 06:53:58', NULL),
(812, 'eka_j123', 'Di wajahku yg sensitif produk ini nggak cocok, untuk wanginya pertama kali aku nggak suka, tapi pas beberapa kali nyoba jd suka dengan wanginya :) karna cocok dengan serumnya jadi aku coba night cream ini, berharap banyak sih karna merasa cocok dgn serumnya, tapiii setelah pemakaian 2 hari wajahku jd gradakan, bruntusan dan bintik2 merah yg gatal :\") jd aku tetap lanjutin sampai 3 atau 4 hari kalau nggk salah, eh malah tambah makin parah, jadi aku stopin dan kembali ke basic skinker aku setelah membaik aku coba lg night cream ini dan hasilnya tetep saja, aku coba ini selama 4 kali dan yg percobaan trkh aku pakai selama 3 hari wajah makin kasar aku nggak pernah coba ini selama seminggu sih soalnya sampai 4 hari aja udah nggak kuat aku, makin gradakan kasar+bintik2 merah, jd aku akalin, aku cukup totolin di jerawat aku yg aktif, untuk di jerawatku yg aktf cukup ngaruhsih tp jd nya merah banget :\")', 'di wajahku yg sensitif produk ini nggak cocok, untuk wanginya pertama kali aku nggak suka, tapi pas beberapa kali nyoba jd suka dengan wanginya :) karna cocok dengan serumnya jadi aku coba night cream ini, berharap banyak sih karna merasa cocok dgn serumnya, tapiii setelah pemakaian 2 hari wajahku jd gradakan, bruntusan dan bintik2 merah yg gatal :\") jd aku tetap lanjutin sampai 3 atau 4 hari kalau nggk salah, eh malah tambah makin parah, jadi aku stopin dan kembali ke basic skinker aku setelah membaik aku coba lg night cream ini dan hasilnya tetep saja, aku coba ini selama 4 kali dan yg percobaan trkh aku pakai selama 3 hari wajah makin kasar aku nggak pernah coba ini selama seminggu sih soalnya sampai 4 hari aja udah nggak kuat aku, makin gradakan kasar+bintik2 merah, jd aku akalin, aku cukup totolin di jerawat aku yg aktif, untuk di jerawatku yg aktf cukup ngaruhsih tp jd nya merah banget :\")', 'di wajahku yg sensitif produk ini nggak cocok untuk wanginya pertama kali aku nggak suka tapi pas beberapa kali nyoba jd suka dengan wanginya karna cocok