(854, 'karinafortunata_', 'pertama coba, dan langsung cocok dong ❤❤❤❤❤ cepet bgd keliatan efeknya loh ini. muka jadi lebih bersih ? padabal pakenya ga rutin, kadang suka lupa. kalo rutin harusnya lebih bagus lg hasilnya. ga sampe 1 botol udh keliatan hasil sih kalo di ak', 'pertama coba, dan langsung cocok dong ❤❤❤❤❤ cepet bgd keliatan efeknya loh ini. muka jadi lebih bersih ? padabal pakenya ga rutin, kadang suka lupa. kalo rutin harusnya lebih bagus lg hasilnya. ga sampe 1 botol udh keliatan hasil sih kalo di ak', 'pertama coba dan langsung cocok dong cepet bgd keliatan efeknya loh ini muka jadi lebih bersih padabal pakenya ga rutin kadang suka lupa kalo rutin harusnya lebih bagus lg hasilnya ga sampe botol udh keliatan hasil sih kalo di ak', '[\"pertama\", \"coba\", \"dan\", \"langsung\", \"cocok\", \"dong\", \"cepet\", \"bgd\", \"keliatan\", \"efeknya\", \"loh\", \"ini\", \"muka\", \"jadi\", \"lebih\", \"bersih\", \"padabal\", \"pakenya\", \"rutin\", \"kadang\", \"suka\", \"lupa\", \"kalo\", \"rutin\", \"harusnya\", \"lebih\", \"bagus\", \"hasilnya\", \"sampe\", \"botol\", \"sudah\", \"keliatan\", \"hasil\", \"sih\", \"kalo\"]', 'pertama coba dan langsung cocok dong cepet bgd keliatan efeknya loh ini muka jadi lebih bersih padabal pakenya rutin kadang suka lupa kalo rutin harusnya lebih bagus hasilnya sampe botol sudah keliatan hasil sih kalo', '\"coba langsung cocok cepet bgd keliatan efeknya loh muka bersih padabal pakenya rutin kadang suka lupa kalo rutin bagus hasilnya sampe botol keliatan hasil sih kalo\"', 'coba langsung cocok cepet bgd liat efek loh muka bersih padabal pakenya rutin kadang suka lupa kalo rutin bagus hasil sampe botol liat hasil sih kalo', 'Positif', '2024-11-29 06:54:51', '2024-11-29 06:54:51', NULL),
(855, 'nurlailanisdn', 'isinya ga kentel banget, mudah menyerap juga, jd ga ninggalin rasa greasy, dipakai pas sebelum tidur abis itu ditinggal tidur, pagi-pagi langsung berasa kenyal kulitnya, halus juga, menghilangkan kemerahan juga kalo di aku, harganya juga murah', 'isinya ga kentel banget, mudah menyerap juga, jd ga ninggalin rasa greasy, dipakai pas sebelum tidur abis itu ditinggal tidur, pagi-pagi langsung berasa kenyal kulitnya, halus juga, menghilangkan kemerahan juga kalo di aku, harganya juga murah', 'isinya ga kentel banget mudah menyerap juga jd ga ninggalin rasa greasy dipakai pas sebelum tidur abis itu ditinggal tidur pagipagi langsung berasa kenyal kulitnya halus juga menghilangkan kemerahan juga kalo di aku harganya juga murah', '[\"isinya\", \"kentel\", \"banget\", \"mudah\", \"menyerap\", \"juga\", \"ninggalin\", \"rasa\", \"greasy\", \"dipakai\", \"pas\", \"sebelum\", \"tidur\", \"abis\", \"itu\", \"ditinggal\", \"tidur\", \"pagipagi\", \"langsung\", \"berasa\", \"kenyal\", \"kulitnya\", \"halus\", \"juga\", \"menghilangkan\", \"kemerahan\", \"juga\", \"kalo\", \"aku\", \"harganya\", \"juga\", \"murah\"]', 'isinya kentel banget mudah menyerap juga ninggalin rasa greasy dipakai pas sebelum tidur abis itu ditinggal tidur pagipagi langsung berasa kenyal kulitnya halus juga menghilangkan kemerahan juga kalo aku harganya juga murah', '\"isinya kentel banget mudah menyerap ninggalin greasy dipakai pas tidur abis ditinggal tidur pagipagi langsung berasa kenyal kulitnya halus menghilangkan kemerahan kalo harganya murah\"', 'isi kentel banget mudah serap ninggalin greasy pakai pas tidur abis tinggal tidur pagipagi langsung asa kenyal kulit halus hilang merah kalo harga murah', 'Positif', '2024-11-29 06:54:52', '2024-11-29 06:54:52', NULL),
(856, 'yuniaanindra', 'Pas dipake besoknya langsung bruntusan dan merah-merah semuka jadi stop pemakaiannya, mungkin emang kurang cocok, aku nyoba Karena banyak banget review bagus tapi di Aku malah kurang cocok dan juga susah banget ngilangin bruntusan nyaa', 'pas dipake besoknya langsung bruntusan dan merah-merah semuka jadi stop pemakaiannya, mungkin emang kurang cocok, aku nyoba karena banyak banget review bagus tapi di aku malah kurang cocok dan juga susah banget ngilangin bruntusan nyaa', 'pas dipake besoknya langsung bruntusan dan merahmerah semuka jadi stop pemakaiannya mungkin emang kurang cocok aku nyoba karena banyak banget review bagus tapi di aku malah kurang cocok dan juga susah banget ngilangin bruntusan nyaa', '[\"pas\", \"dipakai\", \"besoknya\", \"langsung\", \"bruntusan\", \"dan\", \"merahmerah\", \"semuka\", \"jadi\", \"stop\", \"pemakaiannya\", \"mungkin\", \"emang\", \"kurang\", \"cocok\", \"aku\", \"nyoba\", \"karena\", \"banyak\", \"banget\", \"review\", \"bagus\", \"tapi\", \"aku\", \"malah\", \"kurang\", \"cocok\", \"dan\", \"juga\", \"susah\", \"banget\", \"ngilangin\", \"bruntusan\", \"nyaa\"]', 'pas dipakai besoknya langsung bruntusan dan merahmerah semuka jadi stop pemakaiannya mungkin emang kurang cocok aku nyoba karena banyak banget review bagus tapi aku malah kurang cocok dan juga susah banget ngilangin bruntusan nyaa', '\"pas dipakai besoknya langsung bruntusan merahmerah semuka stop pemakaiannya emang cocok nyoba banget review bagus cocok susah banget ngilangin bruntusan nyaa\"', 'pas pakai besok langsung bruntusan merahmerah muka stop pakai emang cocok nyoba banget review bagus cocok susah banget ngilangin bruntusan nyaa', 'Positif', '2024-11-29 06:54:52', '2024-11-29 06:54:52', NULL),
(857, 'nindyarani', 'Mungkin reviewnya berbeda dengan kebanyakan orang, tapi kebetulan ini kurang cocok sama kulitku. Konsistensinya cukup cair tapi bukan yg langsung ngalir, wanginya juga oke gak menyengat. Setelah aplikasi menyerap dengan baik tapi gak langsung hilang gitu. Efeknya sesuai klaim untuk mencerahkan warna kulit dan yes setuju banget sejak hari pertama pemakaian pun bisa notice langsung kelihatan efeknya dapat bekerja dengan baik. Tapi entah kenapa di kulitku rasanya panas dan pedih banget cekit-cekit. Awalnya aku kira mungkin karena baru \"kenalan\" sama ingredients nya jadi kaget. Tapi ternyata setelah cukup lama pakai masih terasa cekit terus padahal setelahnya selalu pakai moisturizer yg cukup heavy. Jadi memutuskan untuk stop dan sepertinya kurang cocok di kulit sensitif, sorry.', 'mungkin reviewnya berbeda dengan kebanyakan orang, tapi kebetulan ini kurang cocok sama kulitku. konsistensinya cukup cair tapi bukan yg langsung ngalir, wanginya juga oke gak menyengat. setelah aplikasi menyerap dengan baik tapi gak langsung hilang gitu. efeknya sesuai klaim untuk mencerahkan warna kulit dan yes setuju banget sejak hari pertama pemakaian pun bisa notice langsung kelihatan efeknya dapat bekerja dengan baik. tapi entah kenapa di kulitku rasanya panas dan pedih banget cekit-cekit. awalnya aku kira mungkin karena baru \"kenalan\" sama ingredients nya jadi kaget. tapi ternyata setelah cukup lama pakai masih terasa cekit terus padahal setelahnya selalu pakai moisturizer yg cukup heavy. jadi memutuskan untuk stop dan sepertinya kurang cocok di kulit sensitif, sorry.', 'mungkin reviewnya berbeda dengan kebanyakan orang tapi kebetulan ini kurang cocok sama kulitku konsistensinya cukup cair tapi bukan yg langsung ngalir wanginya juga oke gak menyengat setelah aplikasi menyerap dengan baik tapi gak langsung hilang gitu efeknya sesuai klaim untuk mencerahkan warna kulit dan yes setuju banget sejak hari pertama pemakaian pun bisa notice langsung kelihatan efeknya d