etuju banget sejak hari pertama pemakaian pun bisa notice langsung kelihatan efeknya dapat bekerja dengan baik tapi entah kenapa kulitku rasanya panas dan pedih banget cekitcekit awalnya aku kira mungkin karena baru kenalan sama ingredients nya jadi kaget tapi ternyata setelah cukup lama pakai masih terasa cekit terus padahal setelahnya selalu pakai moisturizer cukup heavy jadi memutuskan untuk stop dan sepertinya kurang cocok kulit sensitif sorry', '\"reviewnya berbeda kebanyakan orang cocok kulitku konsistensinya cair langsung ngalir wanginya oke gak menyengat aplikasi menyerap gak langsung hilang gitu efeknya sesuai klaim mencerahkan warna kulit yes setuju banget pemakaian notice langsung efeknya kulitku panas pedih banget cekitcekit kenalan ingredients nya kaget pakai cekit setelahnya pakai moisturizer heavy memutuskan stop cocok kulit sensitif sorry\"', 'reviewnya beda banyak orang cocok kulit konsistensi cair langsung ngalir wangi oke gak sengat aplikasi serap gak langsung hilang gitu efek sesuai klaim cerah warna kulit yes tuju banget pakai notice langsung efek kulit panas pedih banget cekitcekit kenal ingredients nya kaget pakai cekit telah pakai moisturizer heavy putus stop cocok kulit sensitif sorry', 'Positif', '2024-11-29 06:54:54', '2024-11-29 06:54:54', NULL),
