(875, 'nblksm', 'Seneng banget bisa try product ini berkat FD Try n Review heheh. Awalnya emang agak skeptis sama skincare dari brand ini, tapi begitu kemarin dapet paket ini terus aku checking ingredientsnya juga puji tuhan ga ada ingredients yang ngetrigger fungal acne aku. Buat produknya teksturnya cair cuma wanginya menurut aku agak kurang enak, semacam kayak wangi obat campur asem gitu. Hasil pemakaian ini setelah dipakai sampai habis dia bagus untuk memudarkan bekas jerawat, kalau buat kulit cerah kayaknya gak terlalu pengaruh banget. Sensasi pakai serum ini dikulit aku awalnya agak sedikit celekit celekit dan after applynya agak greasy.', 'seneng banget bisa try product ini berkat fd try n review heheh. awalnya emang agak skeptis sama skincare dari brand ini, tapi begitu kemarin dapet paket ini terus aku checking ingredientsnya juga puji tuhan ga ada ingredients yang ngetrigger fungal acne aku. buat produknya teksturnya cair cuma wanginya menurut aku agak kurang enak, semacam kayak wangi obat campur asem gitu. hasil pemakaian ini setelah dipakai sampai habis dia bagus untuk memudarkan bekas jerawat, kalau buat kulit cerah kayaknya gak terlalu pengaruh banget. sensasi pakai serum ini dikulit aku awalnya agak sedikit celekit celekit dan after applynya agak greasy.', 'seneng banget bisa try product ini berkat fd try n review heheh awalnya emang agak skeptis sama skincare dari brand ini tapi begitu kemarin dapet paket ini terus aku checking ingredientsnya juga puji tuhan ga ada ingredients yang ngetrigger fungal acne aku buat produknya teksturnya cair cuma wanginya menurut aku agak kurang enak semacam kayak wangi obat campur asem gitu hasil pemakaian ini setelah dipakai sampai habis dia bagus untuk memudarkan bekas jerawat kalau buat kulit cerah kayaknya gak terlalu pengaruh banget sensasi pakai serum ini dikulit aku awalnya agak sedikit celekit celekit dan after applynya agak greasy', '[\"seneng\", \"banget\", \"bisa\", \"try\", \"product\", \"ini\", \"berkat\",