kai serum dikulit celekit celekit after applynya greasy\"', 'neng banget try product berkat try review heheh emang skeptis skincare brand kemarin dapet paket checking ingredientsnya puji tuhan ingredients ngetrigger fungal acne produk tekstur cair wangi enak kayak wangi obat campur asem gitu hasil pakai pakai habis bagus pudar bekas jerawat kulit cerah kayak gak pengaruh banget sensasi pakai serum kulit cekit cekit after applynya greasy', 'Positif', '2024-11-29 06:55:15', '2024-11-29 06:55:15', NULL),
