(887, 'skinjournaling', 'produk niacinamide serum cinta pertamaku hihi. mutusin buat beli ini gara gara waktu itu abis kena cacar dan di muka lagi banyak bekasnya kayak PIH gitu. untuk teksturnya kental dan bening, terus gampang di ratain. wanginya agak sedikit ganggu (asem) tapi karna serum ini fragrance free aku gapapa ? awal pake ini agak cekit2 soalnya baru pertama kali pake niacinamide. tapi masih bisa ditolerir. finishnya dia tacky tapi ga greasy. di layer sama basic gel atau cream moisturizer oke di aku. seminggu pake ini yang paling keliatan pori pori aku jadi lebih samar dan kulit keliatan sehat. untuk efek mencerahkannya udah keliatan pas mau habis sebotol. bukan cerah yang gimana gimana tapi menurut aku cukup oke.', 'produk niacinamide serum cinta pertamaku hihi. mutusin buat beli ini gara gara waktu itu abis kena cacar dan di muka lagi banyak bekasnya kayak pih gitu. untuk teksturnya kental dan bening, terus gampang di ratain. wanginya agak sedikit ganggu (asem) tapi karna serum ini fragrance free aku gapapa ? awal pake ini agak cekit2 soalnya baru pertama kali pake niacinamide. tapi masih bisa ditolerir. finishnya dia tacky tapi ga greasy. di layer sama basic gel atau cream moisturizer oke di aku. seminggu pake ini yang paling keliatan pori pori aku jadi lebih samar dan kulit keliatan sehat. untuk efek mencerahkannya udah keliatan pas mau habis sebotol. bukan cerah yang gimana gimana tapi menurut aku cukup oke.', 'produk niacinamide serum cinta pertamaku hihi mutusin buat beli ini gara gara waktu itu abis kena cacar dan di muka lagi banyak bekasnya kayak pih gitu untuk teksturnya kental dan bening terus gampang di ratain wanginya agak sedikit ganggu tapi karna serum ini fragrance free aku gapapa awal pake ini agak cekit soalnya baru pertama kali pake niacinamide tapi masih bisa ditolerir finishnya dia tacky tapi ga greasy di layer sama basic gel atau cream moisturizer oke di aku seminggu pake ini yang paling keliatan pori pori aku jadi lebih samar dan k