(893, 'Xenanuriana', 'Salah satu produk scarlett yang kurang aku suka ): Kurang sukanya karena gak sesuai dengan skin type aku sih karena emang produk ini untuk yang dry skin. Waktu awal make langsung pake di 2 jari, kaget banget karena lumayan susah di blend. Teksturnya cream, mirip banget moisturizer yang bisa bikin muka kering overmoist gitu. DI aku, finishnya berminyak banget dan bikin muka keliatan abu-abu kusem gitu ): Untuk yang dry skin mungkin bisa nyoba sih karena emang untuk dry skin. So so~', 'salah satu produk scarlett yang kurang aku suka ): kurang sukanya karena gak sesuai dengan skin type aku sih karena emang produk ini untuk yang dry skin. waktu awal make langsung pake di 2 jari, kaget banget karena lumayan susah di blend. teksturnya cream, mirip banget moisturizer yang bisa bikin muka kering overmoist gitu. di aku, finishnya berminyak banget dan bikin muka keliatan abu-abu kusem gitu ): untuk yang dry skin mungkin bisa nyoba sih karena emang untuk dry skin. so so~', 'salah satu produk scarlett yang kurang aku suka kurang sukanya karena gak sesuai dengan skin type aku sih karena emang produk ini untuk yang dry skin waktu awal make langsung pake di jari kaget banget karena lumayan susah di blend teksturnya cream mirip banget moisturizer yang bisa bikin muka kering overmoist gitu di aku finishnya berminyak banget dan bikin muka keliatan abuabu kusem gitu untuk yang dry skin mungkin bisa nyoba sih karena emang untuk dry skin so so', '[\"salah\", \"satu\", \"produk\", \"scarlett\", \"yang\", \"kurang\", \"aku\", \"suka\", \"kurang\", \"sukanya\", \"karena\", \"gak\", \"sesuai\", \"dengan\", \"skin\", \"type\", \"aku\", \"sih\", \"karena\", \"emang\", \"produk\", \"ini\", \"untuk\", \"yang\", \"dry\", \"skin\", \"waktu\", \"awal\", \"make\", \"langsung\", \"pakai\", \"jari\", \"kaget\", \"banget\", \"karena\", \"lumayan\", \"susah\", \"blend\", \"teksturnya\", \"cream\", \"mirip\", \"banget\", \"moisturizer\", \"yang\", \"bisa\", \"bikin\", \"muka\", \"k