(895, 'naylain', 'Kulit wajah aku sebelum make produk ini masih keliatan banget bekas jerawat yang gak banget, tapi pas direkomendasiin produk ini sama temen, dan aku coba, hasilnya bener-bener wah. Beberapa bekas jerawat aku mulai memudar, dan kulit wajah aku yang tadinya bertekstur banget (banyak bruntus) lumayan jadi merata dan haluss.', 'kulit wajah aku sebelum make produk ini masih keliatan banget bekas jerawat yang gak banget, tapi pas direkomendasiin produk ini sama temen, dan aku coba, hasilnya bener-bener wah. beberapa bekas jerawat aku mulai memudar, dan kulit wajah aku yang tadinya bertekstur banget (banyak bruntus) lumayan jadi merata dan haluss.', 'kulit wajah aku sebelum make produk ini masih keliatan banget bekas jerawat yang gak banget tapi pas direkomendasiin produk ini sama temen dan aku coba hasilnya benerbener wah beberapa bekas jerawat aku mulai memudar dan kulit wajah aku yang tadinya bertekstur banget lumayan jadi merata dan haluss', '[\"kulit\", \"wajah\", \"aku\", \"sebelum\", \"make\", \"produk\", \"ini\", \"masih\", \"keliatan\", \"banget\", \"bekas\", \"jerawat\", \"yang\", \"gak\", \"banget\", \"tapi\", \"pas\", \"direkomendasiin\", \"produk\", \"ini\", \"sama\", \"temen\", \"dan\", \"aku\", \"coba\", \"hasilnya\", \"benerbener\", \"wah\", \"beberapa\", \"bekas\", \"jerawat\", \"aku\", \"mulai\", \"memudar\", \"dan\", \"kulit\", \"wajah\", \"aku\", \"yang\", \"tadinya\", \"bertekstur\", \"banget\", \"lumayan\", \"jadi\", \"merata\", \"dan\", \"haluss\"]', 'kulit wajah aku sebelum make produk ini masih keliatan banget bekas jerawat yang gak banget tapi pas direkomendasiin produk ini sama temen dan aku coba hasilnya benerbener wah beberapa bekas jerawat aku mulai memudar dan kulit wajah aku yang tadinya bertekstur banget lumayan jadi merata dan haluss', '\"kulit wajah make produk keliatan banget bekas jerawat gak banget pas direkomendasiin produk temen coba hasilnya benerbener bekas jerawat memudar kulit wajah bertekstur banget lumayan mer