(938, 'sitapuspitasari', 'Sudah sebulan lebih nih aku pakai serumnya, awal pemakaian aman dan aku rutin pakai setiap hari. Sekarang wajahku makin cerah lembab, kenyal dan sehat. Ini sangat cocok di kulit wajahku. Harga juga bersahabat dikantong ku. sangat rekomended banget!', 'sudah sebulan lebih nih aku pakai serumnya, awal pemakaian aman dan aku rutin pakai setiap hari. sekarang wajahku makin cerah lembab, kenyal dan sehat. ini sangat cocok di kulit wajahku. harga juga bersahabat dikantong ku. sangat rekomended banget!', 'sudah sebulan lebih nih aku pakai serumnya awal pemakaian aman dan aku rutin pakai setiap hari sekarang wajahku makin cerah lembab kenyal dan sehat ini sangat cocok di kulit wajahku harga juga bersahabat dikantong ku sangat rekomended banget', '[\"sudah\", \"sebulan\", \"lebih\", \"nih\", \"aku\", \"pakai\", \"serumnya\", \"awal\", \"pemakaian\", \"aman\", \"dan\", \"aku\", \"rutin\", \"pakai\", \"setiap\", \"hari\", \"sekarang\", \"wajahku\", \"makin\", \"cerah\", \"lembab\", \"kenyal\", \"dan\", \"sehat\", \"ini\", \"sangat\", \"cocok\", \"kulit\", \"wajahku\", \"harga\", \"juga\", \"bersahabat\", \"dikantong\", \"sangat\", \"rekomended\", \"banget\"]', 'sudah sebulan lebih nih aku pakai serumnya awal pemakaian aman dan aku rutin pakai setiap hari sekarang wajahku makin cerah lembab kenyal dan sehat ini sangat cocok kulit wajahku harga juga bersahabat dikantong sangat rekomended banget', '\"sebulan nih pakai serumnya pemakaian aman rutin pakai wajahku cerah lembab kenyal sehat cocok kulit wajahku harga bersahabat dikantong rekomended banget\"', 'bulan nih pakai serum pakai aman rutin pakai wajah cerah lembab kenyal sehat cocok kulit wajah harga sahabat kantong rekomended banget', 'Positif', '2024-11-29 06:56:34', '2024-11-29 06:56:34', NULL),
(939, 'Clara_Helena', 'Lihat review banyak yg cocok, akhirnya aku berani coba karena lihat claim yg bisa untuk all skin type. Sayang banget gak cocok sama sekali, bikin tumbuh bruntusan baru. Padahal kulitku ini muncul jerawat hanya pas pms aja. Kukira purging, tapi setelah 3 minggu juga gak mereda. Ketika stop pake di wajah dan coba dikit di leher, muncul kemerahan dan gatal. Pasahal suka sama kombinasi ingredients seperti centela, sabi white dan lainnya.', 'lihat review banyak yg cocok, akhirnya aku berani coba karena lihat claim yg bisa untuk all skin type. sayang banget gak cocok sama sekali, bikin tumbuh bruntusan baru. padahal kulitku ini muncul jerawat hanya pas pms aja. kukira purging, tapi setelah 3 minggu juga gak mereda. ketika stop pake di wajah dan coba dikit di leher, muncul kemerahan dan gatal. pasahal suka sama kombinasi ingredients seperti centela, sabi white dan lainnya.', 'lihat review banyak yg cocok akhirnya aku berani coba karena lihat claim yg bisa untuk all skin type sayang banget gak cocok sama sekali bikin tumbuh bruntusan baru padahal kulitku ini muncul jerawat hanya pas pms aja kukira purging tapi setelah minggu juga gak mereda ketika stop pake di wajah dan coba dikit di leher muncul kemerahan dan gatal pasahal suka sama kombinasi ingredients seperti centela sabi white dan lainnya', '[\"lihat\", \"review\", \"banyak\", \"cocok\", \"akhirnya\", \"aku\", \"berani\", \"coba\", \"karena\", \"lihat\", \"claim\", \"bisa\", \"untuk\", \"all\", \"skin\", \"type\", \"sayang\", \"banget\", \"gak\", \"cocok\", \"sama\", \"sekali\", \"bikin\", \"tumbuh\", \"bruntusan\", \"baru\", \"padahal\", \"kulitku\", \"ini\", \"muncul\", \"jerawat\", \"hanya\", \"pas\", \"pms\", \"aja\", \"kukira\", \"purging\", \"tapi\", \"setelah\", \"minggu\", \"juga\", \"gak\", \"mereda\", \"ketika\", \"stop\", \"pakai\", \"wajah\", \"dan\", \"coba\", \"dikit\", \"leher\", \"muncul\", \"kemerahan\", \"dan\", \"gatal\", \"pasahal\", \"suka\", \"sama\", \"kombinasi\", \"ingred