(944, 'Sikaaa', 'Pertama kali cobain retinol dan langsung cocok dengan produk ini. Beberapa kali pake aja udah ada efek dikulitku, jerawat jadi lebih cepat hilang. Aku pakai ini diselingi dengan serum niacinamide dan moiz phyto nya scarlet, bikin kulit jadi glowing dan berasa kenyal plus kurangi kusam. In love with this product, sekarang udah pake botol kedua dan udah stok satu botol lagi buat cadangan. Dengan harga nya cukup afford untuk anak kuliahan, serum ini juara banget. Btw aku umur 19 tahun, dan tipe kulit ku normal ke kering.', 'pertama kali cobain retinol dan langsung cocok dengan produk ini. beberapa kali pake aja udah ada efek dikulitku, jerawat jadi lebih cepat hilang. aku pakai ini diselingi dengan serum niacinamide dan moiz phyto nya scarlet, bikin kulit jadi glowing dan berasa kenyal plus kurangi kusam. in love with this product, sekarang udah pake botol kedua dan udah stok satu botol lagi buat cadangan. dengan harga nya cukup afford untuk anak kuliahan, serum ini juara banget. btw aku umur 19 tahun, dan tipe kulit ku normal ke kering.', 'pertama kali cobain retinol dan langsung cocok dengan produk ini beberapa kali pake aja udah ada efek dikulitku jerawat jadi lebih cepat hilang aku pakai ini diselingi dengan serum niacinamide dan moiz phyto nya scarlet bikin kulit jadi glowing dan berasa kenyal plus kurangi kusam in love with this product sekarang udah pake botol kedua dan udah stok satu botol lagi buat cadangan dengan harga nya cukup afford untuk anak kuliahan serum ini juara banget btw aku umur tahun dan tipe kulit ku normal ke kering', '[\"pertama\", \"kali\", \"cobain\", \"retinol\", \"dan\", \"langsung\", \"cocok\", \"dengan\", \"produk\", \"ini\", \"beberapa\", \"kali\", \"pakai\", \"aja\", \"udah\", \"ada\", \"efek\", \"dikulitku\", \"jerawat\", \"jadi\", \"lebih\", \"cepat\", \"hilang\", \"aku\", \"pakai\", \"ini\", \"diselingi\", \"dengan\", \"serum\", \"niacinamide\", \"dan\", \"moiz\", \"phyto\", \"nya\", \"scarlet\", \"bikin\", \"kulit\