(954, 'naysskincare', 'Yang night cream nya ini punya tekstur yang lebih enak dibanding yang day cream nya. Tapi finishnya sih sama di kulit, tipe moisturizer yang emollient dan bikin glowing gitu. Ada kandungan squalane, hexapeptide-8 dan triceramide. Rasanya pas pake ini melembabkan banget, kerasa diatas permukaan kulit. Bukan tipe moisturizer yang thick atau creamy. Di kulit aku yang oily kerasa pas dan nyaman buat dipake. Btw moisturizer ini cocoook banget dimix sama face oil, karena bener bener yang bisa kecampur rata. Dan kalau ditimpa face oil/ sunscreen gak bikin pilling. Wanginya kaya lemon gitu? plus ada wangi floral kaya face oil. Aku kira night cream nya ini bakal punya tekstur yang \'gel\', krn kebanyakan day& night cream yang sepaket itu pasti day creamnya punya tekstur yang padet& creamy, dan night creamnya lebih ke gel gitu?. Bisa dibilang night creamnya ini moisturizing banget, dan finishnya emang kerasa kaya ada oil nya sedikit. Efek dr ada squalane mungkin ya?. Dari segi finish mungkin bakal kerasa heavy bagi yang emang gak suka moisturizer yang agak rich gitu. Tapi bagi aku ini udah pas!. Bikin area pinggir mulut yang kering2 jd lebih lembab, dan bikin kulit jadi sehat. Dan di cream ini jg ada ceramide nya! bagus buat skin barrier. Aku pun pas pake ini hampir 3 minggu cuman muncul jerawat 2, biasanya padahal keroyokan', 'yang night cream nya ini punya tekstur yang lebih enak dibanding yang day cream nya. tapi finishnya sih sama di kulit, tipe moisturizer yang emollient dan bikin glowing gitu. ada kandungan squalane, hexapeptide-8 dan triceramide. rasanya pas pake ini melembabkan banget, kerasa diatas permukaan kulit. bukan tipe moisturizer yang thick atau creamy. di kulit aku yang oily kerasa pas dan nyaman buat dipake. btw moisturizer ini cocoook banget dimix sama face oil, karena bener bener yang bisa kecampur rata. dan kalau ditimpa face oil/ sunscreen gak bikin pilling. wanginya kaya lemon gitu? plus ada wangi floral kaya face oil. aku kira night cream nya ini bakal punya tekstur yang \'gel\', krn kebanyakan day& night cream yang sepaket itu pasti day creamnya punya tekstur yang padet& creamy, dan night creamnya lebih ke gel gitu?. bisa dibilang night creamnya ini moisturizing banget, dan finishnya emang kerasa kaya ada oil nya sedikit. efek dr ada squalane mungkin ya?. dari segi finish mungkin bakal kerasa heavy bagi yang emang gak suka moisturizer yang agak rich gitu. tapi bagi aku ini udah pas!. bikin area pinggir mulut yang kering2 jd lebih lembab, dan bikin kulit jadi sehat. dan di cream ini jg ada ceramide nya! bagus buat skin barrier. aku pun pas pake ini hampir 3 minggu cuman muncul jerawat 2, biasanya padahal keroyokan', 'yang night cream nya ini punya tekstur yang lebih enak dibanding yang day cream nya tapi finishnya sih sama di kulit tipe moisturizer yang emollient dan bikin glowing gitu ada kandungan squalane hexapeptide dan triceramide rasanya pas pake ini melembabkan banget kerasa diatas permukaan kulit bukan tipe moisturizer yang thick atau creamy di kulit aku yang oily kerasa pas dan nyaman buat dipake btw moisturizer ini cocoook banget dimix sama face oil karena bener bener yang bisa kecampur rata dan kalau ditimpa face oil sunscreen gak bikin pilling wanginya kaya lemon gitu plus ada wangi floral kaya face oil aku kira night cream nya ini bakal punya tekstur yang gel krn kebanyakan day night cream yang sepaket itu pasti day creamnya punya tekstur yang padet creamy dan night creamnya lebih ke gel gitu bisa dibilang night creamnya ini moisturizing banget dan finishnya emang kerasa kaya ada oil nya sedikit efek dr ada squalane mungkin ya dari segi finish mungkin bakal kerasa heavy bagi yang emang gak suka moisturizer yang agak rich gitu tapi bagi aku ini udah pas bikin area pinggir mulut yang kering jd lebih lembab dan bikin kulit jadi sehat dan di cream ini jg ada ceramide nya bagus buat skin barrier aku pun pas pake ini hampir minggu cuman muncul jerawat biasanya padahal keroyokan', '[