(955, 'firyalane', 'telat banget baru cobain karena lg belajar lepas dari krim dokter muka lgsg kusam jadi beralih ke serum ini, efeknya awalnya sih kulit lebih lembab terus lama kelamaan jadi agak cerah pelan pelan. buat mudarin dark spot mungkin perlu perawatan dokter juga kali ya karena sepengalaman aku sih cuma ngefek sedikit aja ga terlalu yg waw bgt. so far aku tetep rekomendasi bagi kalian yg kulitnya lg kusam karena baru lepas krim dokter kulit masih sensitif tapi mau cerah aku rekomen serum ini sih', 'telat banget baru cobain karena lg belajar lepas dari krim dokter muka lgsg kusam jadi beralih ke serum ini, efeknya awalnya sih kulit lebih lembab terus lama kelamaan jadi agak cerah pelan pelan. buat mudarin dark spot mungkin perlu perawatan dokter juga kali ya karena sepengalaman aku sih cuma ngefek sedikit aja ga terlalu yg waw bgt. so far aku tetep rekomendasi bagi kalian yg kulitnya lg kusam karena baru lepas krim dokter kulit masih sensitif tapi mau cerah aku rekomen serum ini sih', 'telat banget baru cobain karena lg belajar lepas dari krim dokter muka lgsg kusam jadi beralih ke serum ini efeknya awalnya sih kulit lebih lembab terus lama kelamaan jadi agak cerah pelan pelan buat mudarin dark spot mungkin perlu perawatan dokter juga kali ya karena sepengalaman aku sih cuma ngefek sedikit aja ga terlalu yg waw bgt so far aku tetep rekomendasi bagi kalian yg kulitnya lg kusam karena baru lepas krim dokter kulit masih sensitif tapi mau cerah aku rekomen serum ini sih', '[\"telat\", \"banget\", \"baru\", \"cobain\", \"karena\", \"belajar\", \"lepas\", \"dari\", \"krim\", \"dokter\", \"muka\", \"lgsg\", \"kusam\", \"jadi\", \"beralih\", \"serum\", \"ini\", \"efeknya\", \"awalnya\", \"sih\", \"kulit\", \"lebih\", \"lembab\", \"terus\", \"lama\", \"kelamaan\", \"jadi\", \"agak\", \"cerah\", \"pelan\", \"pelan\", \"buat\", \"mudarin\", \"dark\", \"spot\", \"mungkin\", \"perlu\", \"perawatan\", \"dokter\", \"juga\", \"kali\", \"karena\", \"sepengalaman\", \"aku\