(956, 'amadeaferty', 'My very first local Niacinamide serum (pertama kali nyoba yang brand \"The O\" itu).Karena menyadari kulitku yang sensitif, aku jadi start dari patch test dulu, dan pemakaiannya 1x seminggu, terus aku naikin jadi 3x seminggu sampai akhirnya tiap hari tapi hanya untuk PM routine-ku saja.No purging di aku, nyaman banget apalagi dipakai setelah aku pakai Hyaluronic Serum.Aku pakai ini dari jaman 2020 dikeluarin sampai akhir 2020 karena akhirnya aku switch ke 5% Niacin + Sabi white yang lebih ramah di kulitku & sesuai dengan kebutuhanku.Overall, buat yang udah cocok sama Niacin, ini recommended, tapi untuk pemula aku saranin pakai yang 5% Niacin Barrier atau 5% Niacin + Sabi White', 'my very first local niacinamide serum (pertama kali nyoba yang brand \"the o\" itu).karena menyadari kulitku yang sensitif, aku jadi start dari patch test dulu, dan pemakaiannya 1x seminggu, terus aku naikin jadi 3x seminggu sampai akhirnya tiap hari tapi hanya untuk pm routine-ku saja.no purging di aku, nyaman banget apalagi dipakai setelah aku pakai hyaluronic serum.aku pakai ini dari jaman 2020 dikeluarin sampai akhir 2020 karena akhirnya aku switch ke 5% niacin + sabi white yang lebih ramah di kulitku & sesuai dengan kebutuhanku.overall, buat yang udah cocok sama niacin, ini recommended, tapi untuk pemula aku saranin pakai yang 5% niacin barrier atau 5% niacin + sabi white', 'my very first local niacinamide serum karena menyadari kulitku yang sensitif aku jadi start dari patch test dulu dan pemakaiannya x seminggu terus aku naikin jadi x seminggu sampai akhirnya tiap hari tapi hanya untuk pm routineku sajano purging di aku nyaman banget apalagi dipakai setelah aku pakai hyaluronic serumaku pakai ini dari jaman dikeluarin sampai akhir karena akhirnya aku switch ke niacin sabi white yang lebih ramah di kulitku sesuai dengan kebutuhankuoverall buat yang udah cocok sama niacin ini recommended tapi untuk pemula aku saranin pakai yang niacin barrier atau niacin sabi white', '[\"very\", \"first\", \"local\", \"niacinamide\", \"serum\", \"karena\", \"menyadari\", \"kulitku\", \"yang\", \"sensitif\", \"aku\", \"jadi\", \"start\", \"dari\", \"patch\", \"test\", \"dulu\", \"dan\", \"pemakaiannya\", \"seminggu\", \"terus\", \"aku\", \"naikin\", \"jadi\", \"seminggu\", \"sampai\", \"akhirnya\", \"tiap\", \"hari\", \"tapi\", \"hanya\", \"untuk\", \"routineku\", \"sajano\", \"purging\", \"aku\", \"nyaman\", \"banget\", \"apalagi\", \"dipakai\", \"setelah\", \"aku\", \"pakai\", \"hyaluronic\", \"serumaku\", \"pakai\", \"ini\", \"dari\", \"jaman\", \"dikeluarin\", \"sampai\", \"akhir\", \"karena\", \"akhirnya\", \"aku\", \"switch\", \"niacin\", \"sabi\", \"white\", \"yang\", \"lebih\", \"ramah\", \"kulitku\", \"sesuai\", \"dengan\", \"kebutuhankuoverall\", \"buat\", \"yang\", \"udah\", \"cocok\", \"sama\", \"niacin\", \"ini\", \"recommended\", \"tapi\", \"untuk\", \"pemula\", \"aku\", \"saranin\", \"pakai\", \"yang\", \"niacin\", \"barrier\", \"atau\", \"niacin\", \"sabi\", \"white\"]', 'very first local niacinamide serum karena menyadari kulitku yang sensitif aku jadi start dari patch test dulu dan pemakaiannya seminggu terus aku naikin jadi seminggu sampai akhirnya tiap hari tapi hanya untuk routineku sajano purging aku nyaman banget apalagi dipakai setelah aku pakai hyaluronic serumaku pakai ini dari jaman dikeluarin sampai akhir karena akhirnya aku switch niacin sabi white yang lebih ramah kulitku sesuai dengan kebutuhankuoverall buat yang udah cocok sama niacin ini recommended tapi untuk pemula aku saranin pakai yang niacin barrier atau niacin sabi white', '\"very first local niacinamide serum menyadari kulitku sensitif start patch test pemakaiannya seminggu naikin seminggu routineku sajano purging nyaman banget dipakai pakai hyaluronic serumaku pakai jaman dikeluarin switch niacin sabi white ramah kulitku sesuai kebutuhankuoverall udah cocok niacin recommended pemula saranin pakai niacin barrier niacin sabi white\"', 'very first local niacinamide serum sadar kulit sensitif start patch test pakai minggu naikin minggu routineku sajano purging nyaman banget pakai pakai hyaluronic serumaku pakai jaman dikeluarin switch niacin sabi white ramah kulit sesuai kebutuhankuoverall udah cocok niacin recommended mula saranin pakai niacin barrier niacin sabi white', 'Positif', '2024-11-29 06:56:58', '2024-11-29 06:56:58', NULL),
