(975, 'AnnaIlmika', 'Kulitku tipe yg rewel sekali, blackhead ada, jerawat hormon ada, berutusan ada, bekas jerawat juga adaa..Nah, dalam memilih skincare, aku ada beberapa list untuk menetapkan hati. Selain komposisi, yg aku perhatikan adalah efeknya pas beberapa jam dipake. Karena, kebanyakan skin care itu, pas awal2nya glowing, pas 2 jam pake malah kusam sekaliiii.. Nah, di scarlett ini komposisinya oke banget, trus efeknya di kulit itu awal2nya berminyak tapi lama kelamaan glowing. Makin lama makin bagus di muka.. Ini udah hari ke 3.. komedo berkurang, jerawat pada mateng, berutusan hilang, fungal acne menghilang.. nnti aku review lagi pas sebulan pemakaian.. btw, aku pake cream siang, malam, dan serum', 'kulitku tipe yg rewel sekali, blackhead ada, jerawat hormon ada, berutusan ada, bekas jerawat juga adaa..nah, dalam memilih skincare, aku ada beberapa list untuk menetapkan hati. selain komposisi, yg aku perhatikan adalah efeknya pas beberapa jam dipake. karena, kebanyakan skin care itu, pas awal2nya glowing, pas 2 jam pake malah kusam sekaliiii.. nah, di scarlett ini komposisinya oke banget, trus efeknya di kulit itu awal2nya berminyak tapi lama kelamaan glowing. makin lama makin bagus di muka.. ini udah hari ke 3.. komedo berkurang, jerawat pada mateng, berutusan hilang, fungal acne menghilang.. nnti aku review lagi pas sebulan pemakaian.. btw, aku pake cream siang, malam, dan serum', 'kulitku tipe yg rewel sekali blackhead ada jerawat hormon ada berutusan ada bekas jerawat juga adaanah dalam memilih skincare aku ada beberapa list untuk menetapkan hati selain komposisi yg aku perhatikan adalah efeknya pas beberapa jam dipake karena kebanyakan skin care itu pas awal nya glowing pas jam pake malah kusam sekaliiii nah di scarlett ini komposisinya oke banget trus efeknya di kulit itu awal nya berminyak tapi lama kelamaan glowing makin lama makin bagus di muka ini udah hari ke komedo berkurang jerawat pada mateng berutusan hilang fungal acne menghilang nnti aku review lagi pas sebulan pemakaian btw aku pake cream siang malam dan serum', '[\"kulitku\", \"tipe\", \"rewel\", \"sekali\", \"blackhead\", \"ada\", \"jerawat\", \"hormon\", \"ada\", \"berutusan\", \"ada\", \"bekas\", \"jerawat\", \"juga\", \"adaanah\", \"dalam\", \"memilih\", \"skincare\", \"aku\", \"ada\", \"beberapa\", \"list\", \"untuk\", \"menetapkan\", \"hati\", \"selain\", \"komposisi\", \"aku\", \"perhatikan\", \"adalah\", \"efeknya\", \"pas\", \"beberapa\", \"jam\", \"dipakai\", \"karena\", \"kebanyakan\", \"skin\", \"care\", \"itu\", \"pas\", \"awal\", \"nya\", \"glowing\", \"pas\", \"jam\", \"pakai\", \"malah\", \"kusam\", \"sekaliiii\", \"nah\", \"scarlett\", \"ini\", \"komposisinya\", \"oke\", \"banget\", \"trus\", \"efeknya\", \"kulit\", \"itu\", \"awal\", \"nya\", \"berminyak\", \"tapi\", \"lama\", \"kelamaan\", \"glowing\", \"makin\", \"lama\", \"makin\", \"bagus\", \"muka\", \"ini\", \"udah\", \"hari\", \"komedo\", \"berkurang\", \"jerawat\", \"pada\", \"mateng\", \"berutusan\", \"hilang\", \"fungal\", \"acne\", \"menghilang\", \"nnti\", \"aku\", \"review\", \"lagi\", \"pas\", \"sebulan\", \"pemakaian\", \"btw\", \"aku\", \"pakai\", \"cream\", \"siang\", \"malam\", \"dan\", \"serum\"]', 'kulitku tipe rewel sekali blackhead ada jerawat hormon ada berutusan ada bekas jerawat juga adaanah dalam memilih skincare aku ada beberapa list untuk menetapkan hati selain komposisi aku perhatikan adalah efeknya pas beberapa jam dipakai karena kebanyakan skin care itu pas awal nya glowing pas jam pakai malah kusam sekaliiii nah scarlett ini komposisinya oke banget trus efeknya kulit itu awal nya berminyak tapi lama kelamaan glowing makin lama makin bagus muka ini udah hari komedo berkurang jerawat pada mateng berutusan hilang fungal acne menghilang nnti aku review lagi pas sebulan pemakaian btw aku pakai cream siang malam dan serum', '\"kulitku tipe rewel blackhead jerawat hormon berutusan bekas jerawat adaanah memilih skincare list menetapkan hati komposisi perhatik