carlett\", \"yang\", \"ini\", \"karena\", \"teksturnya\", \"benarbenar\", \"seenak\", \"itu\", \"blended\"]', 'aku coba produk ini awalnya dikasih tau sama temen kantor karena wajah aku sering banget kering yang mengelupas gitu dan akhirnya aku coba produk scarlett day cream brightly setelah menggunakan produk ini wajah aku jadi lebih lembab gitu kek kenyel gitu terus aku udah coba bulanan jadinya wajah aku yang dulunya kering udah gak ada suka banget sama produk scarlett yang ini karena teksturnya benarbenar seenak itu blended', '\"coba produk dikasih tau temen kantor wajah banget kering mengelupas gitu coba produk scarlett day cream brightly produk wajah lembab gitu kek kenyel gitu udah coba bulanan wajah dulunya kering udah gak suka banget produk scarlett teksturnya benarbenar seenak blended\"', 'coba produk kasih tau temen kantor wajah banget kering kelupas gitu coba produk scarlett day cream brightly produk wajah lembab gitu kek kenyel gitu udah coba bulan wajah dulunya kering udah gak suka banget produk scarlett tekstur benarbenar enak blended', 'Positif', '2024-11-29 06:57:28', '2024-11-29 06:57:28', NULL),
(983, 'ikasr09', 'Aku rekomendasiin buat kalian yang suka sama spf yg tinggi. Bagus buat melindungi wajah kalau lagi aktivitas di luar. Cuma, aku kurang sukanya tektur krim dia itu lebih ke cair. Pas diaplikasikan ke wajah aku, rasanya jadi kayak berminyak, kalau ngeblend harus sabar biar merata ke seluruh wajah. Aku coba dulu deh abisin.', 'aku rekomendasiin buat kalian yang suka sama spf yg tinggi. bagus buat melindungi wajah kalau lagi aktivitas di luar. cuma, aku kurang sukanya tektur krim dia itu lebih ke cair. pas diaplikasikan ke wajah aku, rasanya jadi kayak berminyak, kalau ngeblend harus sabar biar merata ke seluruh wajah. aku coba dulu deh abisin.', 'aku rekomendasiin buat kalian yang suka sama spf yg tinggi bagus buat melindungi wajah kalau lagi aktivitas di luar cuma aku kurang sukanya tektur krim dia itu lebih ke cair pas diaplikasikan ke wajah aku rasanya jadi kayak berminyak kalau ngeblend harus sabar biar merata ke seluruh wajah aku coba dulu deh abisin', '[\"aku\", \"rekomendasiin\", \"buat\", \"kalian\", \"yang\", \"suka\", \"sama\", \"spf\", \"tinggi\", \"bagus\", \"buat\", \"melindungi\", \"wajah\", \"kalau\", \"lagi\", \"aktivitas\", \"luar\", \"cuma\", \"aku\", \"kurang\", \"sukanya\", \"tektur\", \"krim\", \"dia\", \"itu\", \"lebih\", \"cair\", \"pas\", \"diaplikasikan\", \"wajah\", \"aku\", \"rasanya\", \"jadi\", \"kayak\", \"berminyak\", \"kalau\", \"ngeblend\", \"harus\", \"sabar\", \"biar\", \"merata\", \"seluruh\", \"wajah\", \"aku\", \"coba\", \"dulu\", \"deh\", \"abisin\"]', 'aku rekomendasiin buat kalian yang suka sama spf tinggi bagus buat melindungi wajah kalau lagi aktivitas luar cuma aku kurang sukanya tektur krim dia itu lebih cair pas diaplikasikan wajah aku rasanya jadi kayak berminyak kalau ngeblend harus sabar biar merata seluruh wajah aku coba dulu deh abisin', '\"rekomendasiin suka spf bagus melindungi wajah aktivitas sukanya tektur krim cair pas diaplikasikan wajah kayak berminyak ngeblend sabar biar merata wajah coba deh abisin\"', 'rekomendasiin suka spf bagus lindung wajah aktivitas suka tektur krim cair pas aplikasi wajah kayak minyak ngeblend sabar biar rata wajah coba deh abisin', 'Positif', '2024-11-29 06:57:29', '2024-11-29 06:57:29', NULL);
