(984, 'arumdwns', 'Gak nyangka ternyata face wash dari Scarlett ini gentle dan cocok di kulitku! Kemasannya biasa tapi khas bgt Scarlett dengan warna lilac plus ada petals nya. Ada sedikit aroma, tapi hampir fragrance-free. Teksturnya gel dan busanya juga gak terlalu banyak. Ampuh banget bersihin wajah dan effortless! Habis dibilas kulit jadi lebih bersih dan gak meninggalkan rasa keset juga. Recommended banget!', 'gak nyangka ternyata face wash dari scarlett ini gentle dan cocok di kulitku! kemasannya biasa tapi khas bgt scarlett dengan warna lilac plus ada petals nya. ada sedikit aroma, tapi hampir fragrance-free. teksturnya gel dan busanya juga gak terlalu banyak. ampuh banget bersihin wajah dan effortless! habis dibilas kulit jadi lebih bersih dan gak meninggalkan rasa keset juga. recommended banget!', 'gak nyangka ternyata face wash dari scarlett ini gentle dan cocok di kulitku kemasannya biasa tapi khas bgt scarlett dengan warna lilac plus ada petals nya ada sedikit aroma tapi hampir fragrancefree teksturnya gel dan busanya juga gak terlalu banyak ampuh banget bersihin wajah dan effortless habis dibilas kulit jadi lebih bersih dan gak meninggalkan rasa keset juga recommended banget', '[\"gak\", \"nyangka\", \"ternyata\", \"face\", \"wash\", \"dari\", \"scarlett\", \"ini\", \"gentle\", \"dan\", \"cocok\", \"kulitku\", \"kemasannya\", \"biasa\", \"tapi\", \"khas\", \"bgt\", \"scarlett\", \"dengan\", \"warna\", \"lilac\", \"plus\", \"ada\", \"petals\", \"nya\", \"ada\", \"sedikit\", \"aroma\", \"tapi\", \"hampir\", \"fragrancefree\", \"teksturnya\", \"gel\", \"dan\", \"busanya\", \"juga\", \"gak\", \"terlalu\", \"banyak\", \"ampuh\", \"banget\", \"bersihin\", \"wajah\", \"dan\", \"effortless\", \"habis\", \"dibilas\", \"kulit\", \"jadi\", \"lebih\", \"bersih\", \"dan\", \"gak\", \"meninggalkan\", \"rasa\", \"keset\", \"juga\", \"recommended\", \"banget\"]', 'gak nyangka ternyata face wash dari scarlett ini gentle dan cocok kulitku kemasannya biasa tapi khas bgt s