(994, 'virnaad', 'Ini produk pelembab yang cukup rekomended, teksturnya gak begitu thick, mudah menyerap, ga ada whitecasenya dan gak bikin berminyak. Udah mengandung spf. Cukup cepat juga buat ngilangin bekas jerawat. Ada aromanya tapi gak begitu menggangu.', 'ini produk pelembab yang cukup rekomended, teksturnya gak begitu thick, mudah menyerap, ga ada whitecasenya dan gak bikin berminyak. udah mengandung spf. cukup cepat juga buat ngilangin bekas jerawat. ada aromanya tapi gak begitu menggangu.', 'ini produk pelembab yang cukup rekomended teksturnya gak begitu thick mudah menyerap ga ada whitecasenya dan gak bikin berminyak udah mengandung spf cukup cepat juga buat ngilangin bekas jerawat ada aromanya tapi gak begitu menggangu', '[\"ini\", \"produk\", \"pelembab\", \"yang\", \"cukup\", \"rekomended\", \"teksturnya\", \"gak\", \"begitu\", \"thick\", \"mudah\", \"menyerap\", \"ada\", \"whitecasenya\", \"dan\", \"gak\", \"bikin\", \"berminyak\", \"udah\", \"mengandung\", \"spf\", \"cukup\", \"cepat\", \"juga\", \"buat\", \"ngilangin\", \"bekas\", \"jerawat\", \"ada\", \"aromanya\", \"tapi\", \"gak\", \"begitu\", \"menggangu\"]', 'ini produk pelembab yang cukup rekomended teksturnya gak begitu thick mudah menyerap ada whitecasenya dan gak bikin berminyak udah mengandung spf cukup cepat juga buat ngilangin bekas jerawat ada aromanya tapi gak begitu menggangu', '\"produk pelembab rekomended teksturnya gak thick mudah menyerap whitecasenya gak bikin berminyak udah mengandung spf cepat ngilangin bekas jerawat aromanya gak menggangu\"', 'produk pelembab rekomended tekstur gak thick mudah serap whitecasenya gak bikin minyak udah kandung spf cepat ngilangin bekas jerawat aroma gak menggangu', 'Positif', '2024-11-29 06:57:42', '2024-11-29 06:57:42', NULL),
