(998, 'Robbileo', 'Aku udah pakai 2 tube, aku pakai lebih sering di indoor. Sunscreen ini gampang diblend karna tekstur ringan, cocok dipakai saat cuaca panas. Untuk aroma bisa diterima, dan finish nya semi matte. Kandungan niacinamide bikin kulit ku cerah dan oil control nya dapat, selain itu ceramide serta hyaluronic acid buat jaga skin barrier. Oily dan kombinasi bakal suka.', 'aku udah pakai 2 tube, aku pakai lebih sering di indoor. sunscreen ini gampang diblend karna tekstur ringan, cocok dipakai saat cuaca panas. untuk aroma bisa diterima, dan finish nya semi matte. kandungan niacinamide bikin kulit ku cerah dan oil control nya dapat, selain itu ceramide serta hyaluronic acid buat jaga skin barrier. oily dan kombinasi bakal suka.', 'aku udah pakai tube aku pakai lebih sering di indoor sunscreen ini gampang diblend karna tekstur ringan cocok dipakai saat cuaca panas untuk aroma bisa diterima dan finish nya semi matte kandungan niacinamide bikin kulit ku cerah dan oil control nya dapat selain itu ceramide serta hyaluronic acid buat jaga skin barrier oily dan kombinasi bakal suka', '[\"aku\", \"udah\", \"pakai\", \"tube\", \"aku\", \"pakai\", \"lebih\", \"sering\", \"indoor\", \"sunscreen\", \"ini\", \"gampang\", \"diblend\", \"karna\", \"tekstur\", \"ringan\", \"cocok\", \"dipakai\", \"saat\", \"cuaca\", \"panas\", \"untuk\", \"aroma\", \"bisa\", \"diterima\", \"dan\", \"finish\", \"nya\", \"semi\", \"matte\", \"kandungan\", \"niacinamide\", \"bikin\", \"kulit\", \"cerah\", \"dan\", \"oil\", \"control\", \"nya\", \"dapat\", \"selain\", \"itu\", \"ceramide\", \"serta\", \"hyaluronic\", \"acid\", \"buat\", \"jaga\", \"skin\", \"barrier\", \"oily\", \"dan\", \"kombinasi\", \"bakal\", \"suka\"]', 'aku udah pakai tube aku pakai lebih sering indoor sunscreen ini gampang diblend karna tekstur ringan cocok dipakai saat cuaca panas untuk aroma bisa diterima dan finish nya semi matte kandungan niacinamide bikin kulit cerah dan oil control nya dapat selain itu ceramide ser