(1003, 'krismathilda', 'somethinc niacinamide serum ini ampuh banget di aku untuk mencerahkan dan melembabkan. gak bikin breakout / iritasi juga!! di aku yang ukuran 40ml tahan sampai 3,5 bulan. aku saranin kalau udah terbiasa pakai niacinamide, pilih yang 10% aja karna lebih ampuh☺️', 'somethinc niacinamide serum ini ampuh banget di aku untuk mencerahkan dan melembabkan. gak bikin breakout / iritasi juga!! di aku yang ukuran 40ml tahan sampai 3,5 bulan. aku saranin kalau udah terbiasa pakai niacinamide, pilih yang 10% aja karna lebih ampuh☺️', 'somethinc niacinamide serum ini ampuh banget di aku untuk mencerahkan dan melembabkan gak bikin breakout iritasi juga di aku yang ukuran ml tahan sampai bulan aku saranin kalau udah terbiasa pakai niacinamide pilih yang aja karna lebih ampuh', '[\"somethinc\", \"niacinamide\", \"serum\", \"ini\", \"ampuh\", \"banget\", \"aku\", \"untuk\", \"mencerahkan\", \"dan\", \"melembabkan\", \"gak\", \"bikin\", \"breakout\", \"iritasi\", \"juga\", \"aku\", \"yang\", \"ukuran\", \"tahan\", \"sampai\", \"bulan\", \"aku\", \"saranin\", \"kalau\", \"udah\", \"terbiasa\", \"pakai\", \"niacinamide\", \"pilih\", \"yang\", \"aja\", \"karna\", \"lebih\", \"ampuh\"]', 'somethinc niacinamide serum ini ampuh banget aku untuk mencerahkan dan melembabkan gak bikin breakout iritasi juga aku yang ukuran tahan sampai bulan aku saranin kalau udah terbiasa pakai niacinamide pilih yang aja karna lebih ampuh', '\"somethinc niacinamide serum ampuh banget mencerahkan melembabkan gak bikin breakout iritasi ukuran tahan saranin udah terbiasa pakai niacinamide pilih aja karna ampuh\"', 'somethinc niacinamide serum ampuh banget cerah melembabkan gak bikin breakout iritasi ukur tahan saranin udah biasa pakai niacinamide pilih aja karna ampuh', 'Positif', '2024-11-29 06:57:53', '2024-11-29 06:57:53', NULL),
(1004, 'nailull', 'Sejauh ini efeknya bikin kulit aku gak kusam dan cerahan. Tekstur creamnya ringan, cepet meresap, gak greasyy, dan gampang di apply di wajah. Dari packagingnya bagus sih, kokoh, aku suka, ada lapisan pengamannya biar higienis. Menurut aku day cream brightly ever after dari scarlett ini emang bisa nyerahin wajahh, intinya gak nyesel repurchase ini berkali-kali', 'sejauh ini efeknya bikin kulit aku gak kusam dan cerahan. tekstur creamnya ringan, cepet meresap, gak greasyy, dan gampang di apply di wajah. dari packagingnya bagus sih, kokoh, aku suka, ada lapisan pengamannya biar higienis. menurut aku day cream brightly ever after dari scarlett ini emang bisa nyerahin wajahh, intinya gak nyesel repurchase ini berkali-kali', 'sejauh ini efeknya bikin kulit aku gak kusam dan cerahan tekstur creamnya ringan cepet meresap gak greasyy dan gampang di apply di wajah dari packagingnya bagus sih kokoh aku suka ada lapisan pengamannya biar higienis menurut aku day cream brightly ever after dari scarlett ini emang bisa nyerahin wajahh intinya gak nyesel repurchase ini berkalikali', '[\"sejauh\", \"ini\", \"efeknya\", \"bikin\", \"kulit\", \"aku\", \"gak\", \"kusam\", \"dan\", \"cerahan\", \"tekstur\", \"creamnya\", \"ringan\", \"cepet\", \"meresap\", \"gak\", \"greasyy\", \"dan\", \"gampang\", \"apply\", \"wajah\", \"dari\", \"packagingnya\", \"bagus\", \"sih\", \"kokoh\", \"aku\", \"suka\", \"ada\", \"lapisan\", \"pengamannya\", \"biar\", \"higienis\", \"menurut\", \"aku\", \"day\", \"cream\", \"brightly\", \"ever\", \"after\", \"dari\", \"scarlett\", \"ini\", \"emang\", \"bisa\", \"nyerahin\", \"wajahh\", \"intinya\", \"gak\", \"nyesel\", \"repurchase\", \"ini\", \"berkalikali\"]', 'sejauh ini efeknya bikin kulit aku gak kusam dan cerahan tekstur creamnya ringan cepet meresap gak greasyy dan gampang apply wajah dari packagingnya bagus sih kokoh aku suka ada lapisan pengamannya biar higienis menurut aku day cream brightly ever after dari scarlett ini emang bisa nyerahin wajahh intinya gak nyesel repurchase ini berkalikali', '\"efeknya bikin kulit gak kusam cerahan tekstur creamnya ringan cepet meresap gak greasyy gampang apply wajah packagingnya bagus sih kokoh suka lapisan pengamannya biar higienis day cream brightly ever after scarlett emang nyerahin wajahh intinya gak nyesel repurchase berkalikali\"', 'efek bikin kulit gak kusam cerah tekstur creamnya ringan cepet resap gak greasyy gampang apply wajah packagingnya bagus sih kokoh suka lapis kam biar higienis day cream brightly ever after scarlett emang nyerahin wajahh inti gak nyesel repurchase berkalikali', 'Positif', '2024-11-29 06:57:55', '2024-11-29 06:57:55', NULL),
