(1006, 'dararizkyamalia', 'sunscreen scarlett pertama yg aku coba yg ulta light dapet dari SxB dan waktu beli di Jelita, ternyata ultra lightnya abis, dan kucoba lah yg sun bright ini. betapa terkejutnya aku ternyata ini jauh berbeda sama ultra light ? di aku, ini lumayan greasy dan berasa lebih berat dari yg ultra light, gacocok banget buar re-apply atas makeup, auto kegeser! ? dibanding dengan ultra light ini kurang blendable banget. need a second to absorb perfectly!! yang paling ga suka ini produk ada aroma yg super ganggu ahaha, menyebalkan sekali!! well said, ultra light is so much more better version of this sun bright ? one good thing, ini minim banget whitecastnya!', 'sunscreen scarlett pertama yg aku coba yg ulta light dapet dari sxb dan waktu beli di jelita, ternyata ultra lightnya abis, dan kucoba lah yg sun bright ini. betapa terkejutnya aku ternyata ini jauh berbeda sama ultra light ? di aku, ini lumayan greasy dan berasa lebih berat dari yg ultra light, gacocok banget buar re-apply atas makeup, auto kegeser! ? dibanding dengan ultra light ini kurang blendable banget. need a second to absorb perfectly!! yang paling ga suka ini produk ada aroma yg super ganggu ahaha, menyebalkan sekali!! well said, ultra light is so much more better version of this sun bright ? one good thing, ini minim banget whitecastnya!', 'sunscreen scarlett pertama yg aku coba yg ulta light dapet dari sxb dan waktu beli di jelita ternyata ultra lightnya abis dan kucoba lah yg sun bright ini betapa terkejutnya aku ternyata ini jauh berbeda sama ultra light di aku ini lumayan greasy dan berasa lebih berat dari yg ultra light gacocok banget buar reapply atas makeup auto kegeser dibanding dengan ultra light ini kurang blendable banget need a second to absorb perfectly yang paling ga suka ini produk ada aroma yg super ganggu ahaha menyebalkan sekali well said ultra light is so much more better version of this sun bright one good thing ini minim banget whitecastnya', '[\"sunscreen\", \"scarlett\", \"pertama\", \"aku\", \"coba\", \"ulta\", \"light\", \"dapet\", \"dari\", \"sxb\", \"dan\", \"waktu\", \"beli\", \"jelita\", \"ternyata\", \"ultra\", \"lightnya\", \"abis\", \"dan\", \"kucoba\", \"lah\", \"sun\", \"bright\", \"ini\", \"betapa\", \"terkejutnya\", \"aku\", \"ternyata\", \"ini\", \"jauh\", \"berbeda\", \"sama\", \"ultra\", \"light\", \"aku\", \"ini\", \"lumayan\", \"greasy\", \"dan\", \"berasa\", \"lebih\", \"berat\", \"dari\", \"ultra\", \"light\", \"gacocok\", \"banget\", \"buar\", \"reapply\", \"atas\", \"makeup\", \"auto\", \"kegeser\", \"dibanding\", \"dengan\", \"ultra\", \"light\", \"ini\", \"kurang\", \"blendable\", \"banget\", \"need\", \"second\", \"absorb\", \"perfectly\", \"yang\", \"paling\", \"suka\", \"ini\", \"produk\", \"ada\", \"aroma\", \"super\", \"ganggu\", \"ahaha\", \"menyebalkan\", \"sekali\", \"well\", \"said\", \"ultra\", \"light\", \"much\", \"more\", \"better\", \"version\", \"this\", \"sun\", \"bright\", \"one\", \"good\", \"thing\", \"ini\", \"minim\", \"banget\", \"whitecastnya\"]', 'sunscreen scarlett pertama aku coba ulta light dapet dari sxb dan waktu beli jelita ternyata ultra lightnya abis dan kucoba lah sun bright ini betapa terkejutnya aku ternyata ini jauh berbeda sama ultra light aku ini lumayan greasy dan berasa lebih berat dari ultra light gacocok banget buar reapply atas makeup auto kegeser dibanding dengan ultra light ini kurang blendable banget need second absorb perfectly yang paling suka ini produk ada aroma super ganggu ahaha menyebalkan sekali well said ultra light much more better version this sun bright one good thing ini minim banget whitecastnya', '\"sunscreen scarlett coba ulta light dapet sxb beli jelita ultra lightnya abis kucoba sun bright betapa terkejutnya berbeda ultra light lumayan greasy berasa berat ultra light gacocok banget buar reapply makeup auto kegeser dibanding ultra light blendable banget need second absorb perfectly suka produk aroma super ganggu ahaha menyebalkan well said ultra light much more better version this sun bright one good thing minim banget whitecastnya\"', 'sunscreen scarlett coba ulta light dapet sxb beli jelita ultra lightnya abis coba sun bright betapa kejut beda ultra light lumayan greasy asa berat ultra light gacocok banget buar reapply makeup auto geser banding ultra light blendable banget need second absorb perfectly suka produk aroma super ganggu ahaha sebal well said ultra light much more better version this sun bright one good thing minim banget whitecastnya', 'Positif', '2024-11-29 06:58:01', '2024-11-29 06:58:01', NULL),
(1007, 'Shofiah01', 'Skincare MS Glow emng produknya gak pernah gagal buat bantu masalah kulitku, apalagi si MS Glow WhiteCell DNA, sejak pake serum ini kulitku makin sehat kenyal dan glowing, bakal jadi produk kecintaan dan dipake terus-terusan, makasih MS Glow', 'skincare ms glow emng produknya gak pernah gagal buat bantu masalah kulitku, apalagi si ms glow whitecell dna, sejak pake serum ini kulitku makin sehat kenyal dan glowing, bakal jadi produk kecintaan dan dipake terus-terusan, makasih ms glow', 'skincare ms glow emng produknya gak pernah gagal buat bantu masalah kulitku apalagi si ms glow whitecell dna sejak pake serum ini kulitku makin sehat kenyal dan glowing bakal jadi produk kecintaan dan dipake terusterusan makasih ms glow', '[\"skincare\", \"glow\", \"emng\", \"produknya\", \"gak\", \"pernah\", \"gagal\", \"buat\", \"bantu\", \"masalah\", \"kulitku\", \"apalagi\", \"glow\", \"whitecell\", \"dna\", \"sejak\", \"pakai\", \"serum\", \"ini\", \"kulitku\", \"makin\", \"sehat\", \"kenyal\", \"dan\", \"glowing\", \"bakal\", \"jadi\", \"produk\", \"kecintaan\", \"dan\", \"dipakai\", \"terusterusan\", \"makasih\", \"glow\"]', 'skincare glow emng produknya gak pernah gagal buat bantu masalah kulitku apalagi glow whitecell dna sejak pakai serum ini kulitku makin sehat kenyal dan glowing bakal jadi produk kecintaan dan dipakai terusterusan makasih glow', '\"skincare glow emng produknya gak gagal bantu kulitku glow whitecell dna pakai serum kulitku sehat kenyal glowing produk kecintaan dipakai terusterusan makasih glow\"', 'skincare glow emng produk gak gagal bantu kulit glow whitecell dna pakai serum kulit sehat kenyal glowing produk cinta pakai terusterusan makasih glow', 'Positif', '2024-11-29 06:58:02', '2024-11-29 06:58:02', NULL),
(1008, 'dyahlupita', 'Aku suka bgt. Dia cepet bgt menyerap di kulit. Hasilnya juga bikin kulit jadi lebih glowing dan plumpy. Dan dia bikin kulit kita jadi keliatan bgt halus dan lembab. Pas bangun tidur kulir keliatan bgt perubahannya dan bikin kulit keliatan sehat bgt.', 'aku suka bgt. dia cepet bgt menyerap di kulit. hasilnya juga bikin kulit jadi lebih glowing dan plumpy. dan dia bikin kulit kita jadi keliatan bgt halus dan lembab. pas bangun tidur kulir keliatan bgt perubahannya dan bikin kulit keliatan sehat bgt.', 'aku suka bgt dia cepet bgt menyerap di kulit hasilnya juga bikin kulit jadi lebih glowing dan plumpy dan dia bikin kulit kita jadi keliatan bgt halus dan lembab pas bangun tidur kulir keliatan bgt perubahannya dan bikin kulit keliatan sehat bgt', '[\"aku\", \"suka\", \"bgt\", \"dia\", \"cepet\", \"bgt\", \"menyerap\", \"kulit\", \"hasilnya\", \"juga\", \"bikin\", \"kulit\", \"jadi\", \"lebih\", \"glowing\", \"dan\", \"plumpy\", \"dan\", \"dia\", \"bikin\", \"kulit\", \"kita\", \"jadi\", \"keliatan\", \"bgt\", \"halus\", \"dan\", \"lembab\", \"pas\", \"bangun\", \"tidur\", \"kulir\", \"keliatan\", \"bgt\", \"perubahannya\", \"dan\", \"bikin\", \"kulit\", \"keliatan\", \"sehat\", \"bgt\"]', 'aku suka bgt dia cepet bgt menyerap kulit hasilnya juga bikin kulit jadi lebih glowing dan plumpy dan dia bikin kulit kita jadi keliatan bgt halus dan lembab pas bangun tidur kulir keliatan bgt perubahannya dan bikin kulit keliatan sehat bgt', '\"suka bgt cepet bgt menyerap kulit hasilnya bikin kulit glowing plumpy bikin kulit keliatan bgt halus lembab pas bangun tidur kulir keliatan bgt perubahannya bikin kulit keliatan sehat bgt\"', 'suka bgt cepet bgt serap kulit hasil bikin kulit glowing plumpy bikin kulit liat bgt halus lembab pas bangun tidur kulir liat bgt ubah bikin kulit liat sehat bgt', 'Positif', '2024-11-29 06:58:03', '2024-11-29 06:58:03', NULL),
(1009, 'giayyy__', 'Awalnya coba-coba untuk produk somethinc ini, karena butuh yang mencerahkan dan melembabkan. Kemudian coba yang varian niacinamide dan baru pemakaian botol pertama udah bagus banget, mencerahkan dan melembabkan kulit saya. Saya pakai produk ini udah botol ke 5. Teksturnya juga langsung menyerap dan tidak lengket. Asal rutin pakai pasti mendapat hasil yang memuaskan', 'awalnya coba-coba untuk produk somethinc ini, karena butuh yang mencerahkan dan melembabkan. kemudian coba yang varian niacinamide dan baru pemakaian botol pertama udah bagus banget, mencerahkan dan melembabkan kulit saya. saya pakai produk ini udah botol ke 5. teksturnya juga langsung menyerap dan tidak lengket. asal rutin pakai pasti mendapat hasil yang memuaskan', 'awalnya cobacoba untuk produk somethinc ini karena butuh yang mencerahkan dan melembabkan kemudian coba yang varian niacinamide dan baru pemakaian botol pertama udah bagus banget mencerahkan dan melembabkan kulit saya saya pakai produk ini udah botol ke teksturnya juga langsung menyerap dan tidak lengket asal rutin pakai pasti mendapat hasil yang memuaskan', '[\"awalnya\", \"cobacoba\", \"untuk\", \"produk\", \"somethinc\", \"ini\", \"karena\", \"butuh\", \"yang\", \"mencerahkan\", \"dan\", \"melembabkan\", \"kemudian\", \"coba\", \"yang\", \"varian\", \"niacinamide\", \"dan\", \"baru\", \"pemakaian\", \"botol\", \"pertama\", \"udah\", \"bagus\", \"banget\", \"mencerahkan\", \"dan\", \"melembabkan\", \"kulit\", \"saya\", \"saya\", \"pakai\", \"produk\", \"ini\", \"udah\", \"botol\", \"teksturnya\", \"juga\", \"langsung\", \"menyerap\", \"dan\", \"tidak\", \"lengket\", \"asal\", \"rutin\", \"pakai\", \"pasti\", \"mendapat\", \"hasil\", \"yang\", \"memuaskan\"]', 'awalnya cobacoba untuk produk somethinc ini karena butuh yang mencerahkan dan melembabkan kemudian coba yang varian niacinamide dan baru pemakaian botol pertama udah bagus banget mencerahkan dan melembabkan kulit saya saya pakai produk ini udah botol teksturnya