(1046, 'PriscillaMery28', 'Bagus sie di kulitku yang udah mulai ada flek, pakai rutin 10hari udah keliatan banget hasilnya. Mengurangi dan bikin pudar flek ku. Bahannya juga ringan, mudah menyerap di kulit. Harus banget cobaib buat yabg udah mulai ada flek diwajah.', 'bagus sie di kulitku yang udah mulai ada flek, pakai rutin 10hari udah keliatan banget hasilnya. mengurangi dan bikin pudar flek ku. bahannya juga ringan, mudah menyerap di kulit. harus banget cobaib buat yabg udah mulai ada flek diwajah.', 'bagus sie di kulitku yang udah mulai ada flek pakai rutin hari udah keliatan banget hasilnya mengurangi dan bikin pudar flek ku bahannya juga ringan mudah menyerap di kulit harus banget cobaib buat yabg udah mulai ada flek diwajah', '[\"bagus\", \"sie\", \"kulitku\", \"yang\", \"udah\", \"mulai\", \"ada\", \"flek\", \"pakai\", \"rutin\", \"hari\", \"udah\", \"keliatan\", \"banget\", \"hasilnya\", \"mengurangi\", \"dan\", \"bikin\", \"pudar\", \"flek\", \"bahannya\", \"juga\", \"ringan\", \"mudah\", \"menyerap\", \"kulit\", \"harus\", \"banget\", \"cobaib\", \"buat\", \"yabg\", \"udah\", \"mulai\", \"ada\", \"flek\", \"diwajah\"]', 'bagus sie kulitku yang udah mulai ada flek pakai rutin hari udah keliatan banget hasilnya mengurangi dan bikin pudar flek bahannya juga ringan mudah menyerap kulit harus banget cobaib buat yabg udah mulai ada flek diwajah', '\"bagus sie kulitku udah flek pakai rutin udah keliatan banget hasilnya mengurangi bikin pudar flek bahannya ringan mudah menyerap kulit banget cobaib yabg udah flek diwajah\"', 'bagus sie kulit udah flek pakai rutin udah liat banget hasil kurang bikin pudar flek bahan ringan mudah serap kulit banget cobaib yabg udah flek wajah', 'Positif', '2024-11-29 06:58:50', '2024-11-29 06:58:50', NULL),
