(1076, 'Rostika_Maelani', 'Aku pakai sekalian sama rangkaian acne serum dan acne night cream serta acne day cream. Acne night creamnya aku sampai repurchase juga karena ingin melihat hasil penggunaan yang cukup lama, tapi hasilnya tidak terlalu signifikan dan aku juga kurang suka dengan aromanya karena aku memang lebih suka dengan produk yang less parfume. Akhirnya di botol ke 3 aku menyerah dan kasih ke adikku.', 'aku pakai sekalian sama rangkaian acne serum dan acne night cream serta acne day cream. acne night creamnya aku sampai repurchase juga karena ingin melihat hasil penggunaan yang cukup lama, tapi hasilnya tidak terlalu signifikan dan aku juga kurang suka dengan aromanya karena aku memang lebih suka dengan produk yang less parfume. akhirnya di botol ke 3 aku menyerah dan kasih ke adikku.', 'aku pakai sekalian sama rangkaian acne serum dan acne night cream serta acne day cream acne night creamnya aku sampai repurchase juga karena ingin melihat hasil penggunaan yang cukup lama tapi hasilnya tidak terlalu signifikan dan aku juga kurang suka dengan aromanya karena aku memang lebih suka dengan produk yang less parfume akhirnya di botol ke aku menyerah dan kasih ke adikku', '[\"aku\", \"pakai\", \"sekalian\", \"sama\", \"rangkaian\", \"acne\", \"serum\", \"dan\", \"acne\", \"night\", \"cream\", \"serta\", \"acne\", \"day\", \"cream\", \"acne\", \"night\", \"creamnya\", \"aku\", \"sampai\", \"repurchase\", \"juga\", \"karena\", \"ingin\", \"melihat\", \"hasil\", \"penggunaan\", \"yang\", \"cukup\", \"lama\", \"tapi\", \"hasilnya\", \"tidak\", \"terlalu\", \"signifikan\", \"dan\", \"aku\", \"juga\", \"kurang\", \"suka\", \"dengan\", \"aromanya\", \"karena\", \"aku\", \"memang\", \"lebih\", \"suka\", \"dengan\", \"produk\", \"yang\", \"less\", \"parfume\", \"akhirnya\", \"botol\", \"aku\", \"menyerah\", \"dan\", \"kasih\", \"adikku\"]', 'aku pakai sekalian sama rangkaian acne serum dan acne night cream serta acne day cream acne night creamnya aku sampai repurchase juga karena ingin melihat hasil penggunaan yang cukup lama tapi hasilnya tidak terlalu signifikan dan aku juga kurang suka dengan aromanya karena aku memang lebih suka dengan produk yang less parfume akhirnya botol aku menyerah dan kasih adikku', '\"pakai rangkaian acne serum acne night cream acne day cream acne night creamnya repurchase hasil penggunaan hasilnya signifikan suka aromanya suka produk less parfume botol menyerah kasih adikku\"', 'pakai rangkai acne serum acne night cream acne day cream acne night creamnya repurchase hasil guna hasil signifikan suka aroma suka produk less parfume botol serah kasih adik', 'Positif', '2024-11-29 06:59:21', '2024-11-29 06:59:21', NULL),
