(1100, 'marantina', 'Aku harus acungi dua jempol untuk produk Brightly Ever After Day Cream Scarlett ini. Teksturnya cair dan agak watery. Ini hal baru buatku karena biasanya aku pakai moisturizer dalam bentuk gel. Namun, teksturnya yang ringan membuat krim ini cepat sekali menyerap di kulit.Warna produknya memang putih, tapi ketika diaplikasikan pada wajah, tidak ada whitecast sama sekali, ya. Produknya tuh benar-benar menyerap dan langsung bikin wajah terasa lembap', 'aku harus acungi dua jempol untuk produk brightly ever after day cream scarlett ini. teksturnya cair dan agak watery. ini hal baru buatku karena biasanya aku pakai moisturizer dalam bentuk gel. namun, teksturnya yang ringan membuat krim ini cepat sekali menyerap di kulit.warna produknya memang putih, tapi ketika diaplikasikan pada wajah, tidak ada whitecast sama sekali, ya. produknya tuh benar-benar menyerap dan langsung bikin wajah terasa lembap', 'aku harus acungi dua jempol untuk produk brightly ever after day cream scarlett ini teksturnya cair dan agak watery ini hal baru buatku karena biasanya aku pakai moisturizer dalam bentuk gel namun teksturnya yang ringan membuat krim ini cepat sekali menyerap di kulitwarna produknya memang putih tapi ketika diaplikasikan pada wajah tidak ada whitecast sama sekali ya produknya tuh benarbenar menyerap dan langsung bikin wajah terasa lembap', '[\"aku\", \"harus\", \"acungi\", \"dua\", \"jempol\", \"untuk\", \"produk\", \"brightly\", \"ever\", \"after\", \"day\", \"cream\", \"scarlett\", \"ini\", \"teksturnya\", \"cair\", \"dan\", \"agak\", \"watery\", \"ini\", \"hal\", \"baru\", \"buatku\", \"karena\", \"biasanya\", \"aku\", \"pakai\", \"moisturizer\", \"dalam\", \"bentuk\", \"gel\", \"namun\", \"teksturnya\", \"yang\", \"ringan\", \"membuat\", \"krim\", \"ini\", \"cepat\", \"sekali\", \"menyerap\", \"kulitwarna\", \"produknya\", \"memang\", \"putih\", \"tapi\", \"ketika\", \"diaplikasikan\", \"pada\", \"wajah\", \"tidak\", \"ada\", \"whitecast\", \"sama\", \