(1112, 'NH39', 'Produk ini sebenernya ringan banget kalo dipake walaupun ingredientsnya terkesan berat gituuu. Di aku sih cocok-cocok aja, cuma ga yang sampe bikin surprise. Hasil pemakaian produk ini somehow mencerahkan bekas jerawat, tp agak lama dibanding produk sebelah. Nah, aku pake produk ini biasanya kalo lg butuh mencerahkan bekas jerawat tapi ga mau pake ingredients yang ekstrem (yg mengharuskan pemakaian sunscreen keesokan paginya) dan karena produk ini teksturnya light dan ga greasy, jadi kayak ga berasa pake apa-apa tapi diam-diam ingredients dalam muka lagi bekerja. Untuk mukaku yang gampang gatel2 kalo ga cocok, produk ini aman sih di kulit sensitif normal-to-dry ku. Kadang aku rekomendasiin juga produk ini untuk temen-temen yang baru tertarik merawat kulitnya karena ringan huehehe... tapi tetep balik ke kondisi/kecocokan kulit masing-masing. ', 'produk ini sebenernya ringan banget kalo dipake walaupun ingredientsnya terkesan berat gituuu. di aku sih cocok-cocok aja, cuma ga yang sampe bikin surprise. hasil pemakaian produk ini somehow mencerahkan bekas jerawat, tp agak lama dibanding produk sebelah. nah, aku pake produk ini biasanya kalo lg butuh mencerahkan bekas jerawat tapi ga mau pake ingredients yang ekstrem (yg mengharuskan pemakaian sunscreen keesokan paginya) dan karena produk ini teksturnya light dan ga greasy, jadi kayak ga berasa pake apa-apa tapi diam-diam ingredients dalam muka lagi bekerja. untuk mukaku yang gampang gatel2 kalo ga cocok, produk ini aman sih di kulit sensitif normal-to-dry ku. kadang aku rekomendasiin juga produk ini untuk temen-temen yang baru tertarik merawat kulitnya karena ringan huehehe... tapi tetep balik ke kondisi/kecocokan kulit masing-masing. ', 'produk ini sebenernya ringan banget kalo dipake walaupun ingredientsnya terkesan berat gituuu di aku sih cocokcocok aja cuma ga yang sampe bikin surprise hasil pemakaian produk ini somehow mencerahkan bekas jerawat tp agak lama dibanding produk sebelah nah aku pake prod