at agak lama dibanding produk sebelah nah aku pakai produk ini biasanya kalo butuh mencerahkan bekas jerawat tapi mau pakai ingredients yang ekstrem dan karena produk ini teksturnya light dan greasy jadi kayak berasa pakai apaapa tapi diamdiam ingredients dalam muka lagi bekerja untuk mukaku yang gampang gatel kalo cocok produk ini aman sih kulit sensitif normaltodry kadang aku rekomendasiin juga produk ini untuk tementemen yang baru tertarik merawat kulitnya karena ringan huehehe tapi tetep balik kondisikecocokan kulit masingmasing', '\"produk sebenernya ringan banget kalo dipakai ingredientsnya terkesan berat gituuu sih cocokcocok aja sampe bikin surprise hasil pemakaian produk somehow mencerahkan bekas jerawat dibanding produk sebelah pakai produk kalo butuh mencerahkan bekas jerawat pakai ingredients ekstrem produk teksturnya light greasy kayak berasa pakai apaapa diamdiam ingredients muka mukaku gampang gatel kalo cocok produk aman sih kulit sensitif normaltodry kadang rekomendasiin produk tementemen tertarik merawat kulitnya ringan huehehe tetep kondisikecocokan kulit masingmasing\"', 'produk sebenernya ringan banget kalo pakai ingredientsnya kes berat gituuu sih cocokcocok aja sampe bikin surprise hasil pakai produk somehow cerah bekas jerawat banding produk belah pakai produk kalo butuh cerah bekas jerawat pakai ingredients ekstrem produk tekstur light greasy kayak asa pakai apaapa diamdiam ingredients muka muka gampang gatel kalo cocok produk aman sih kulit sensitif normaltodry kadang rekomendasiin produk tementemen tarik rawat kulit ringan huehehe tetep kondisikecocokan kulit masingmasing', 'Positif', '2024-11-29 07:00:01', '2024-11-29 07:00:01', NULL),
