(1116, 'ara_flower', 'Punya flek hitam di wajah, jujur agak risih gitu. Dan pas pakai produk ini wajah itu jadi lebih adem,bersih dan lebih cerah.Karena ada white sabi yang bermanfaat mencerahkan kulit,suka sama teksturnya yang agak kental tapi cepet banget meresap ?.', 'punya flek hitam di wajah, jujur agak risih gitu. dan pas pakai produk ini wajah itu jadi lebih adem,bersih dan lebih cerah.karena ada white sabi yang bermanfaat mencerahkan kulit,suka sama teksturnya yang agak kental tapi cepet banget meresap ?.', 'punya flek hitam di wajah jujur agak risih gitu dan pas pakai produk ini wajah itu jadi lebih adembersih dan lebih cerahkarena ada white sabi yang bermanfaat mencerahkan kulitsuka sama teksturnya yang agak kental tapi cepet banget meresap', '[\"punya\", \"flek\", \"hitam\", \"wajah\", \"jujur\", \"agak\", \"risih\", \"gitu\", \"dan\", \"pas\", \"pakai\", \"produk\", \"ini\", \"wajah\", \"itu\", \"jadi\", \"lebih\", \"adembersih\", \"dan\", \"lebih\", \"cerahkarena\", \"ada\", \"white\", \"sabi\", \"yang\", \"bermanfaat\", \"mencerahkan\", \"kulitsuka\", \"sama\", \"teksturnya\", \"yang\", \"agak\", \"kental\", \"tapi\", \"cepet\", \"banget\", \"meresap\"]', 'punya flek hitam wajah jujur agak risih gitu dan pas pakai produk ini wajah itu jadi lebih adembersih dan lebih cerahkarena ada white sabi yang bermanfaat mencerahkan kulitsuka sama teksturnya yang agak kental tapi cepet banget meresap', '\"flek hitam wajah jujur risih gitu pas pakai produk wajah adembersih cerahkarena white sabi bermanfaat mencerahkan kulitsuka teksturnya kental cepet banget meresap\"', 'flek hitam wajah jujur risih gitu pas pakai produk wajah adembersih cerahkarena white sabi manfaat cerah kulitsuka tekstur kental cepet banget resap', 'Positif', '2024-11-29 07:00:07', '2024-11-29 07:00:07', NULL),
(1117, 'Silpicahyar', 'Pas tau scarlett ngeluarin sunscreen exited bgt karena emg nunggu banget ss nya scarlett. Finally bisa nyobain juga, aku langsung beli, cocok bgt buat kulit aku yang kombinasi, sebenernya ini bisa melembabkan jadi cocok buat yg dey skin tapi dipake yang kombinasi juga mantul sih, aaaaaaa suka bgt!!!', 'pas tau scarlett ngeluarin sunscreen exited bgt karena emg nunggu banget ss nya scarlett. finally bisa nyobain juga, aku langsung beli, cocok bgt buat kulit aku yang kombinasi, sebenernya ini bisa melembabkan jadi cocok buat yg dey skin tapi dipake yang kombinasi juga mantul sih, aaaaaaa suka bgt!!!', 'pas tau scarlett ngeluarin sunscreen exited bgt karena emg nunggu banget ss nya scarlett finally bisa nyobain juga aku langsung beli cocok bgt buat kulit aku yang kombinasi sebenernya ini bisa melembabkan jadi cocok buat yg dey skin tapi dipake yang kombinasi juga mantul sih aaaaaaa suka bgt', '[\"pas\", \"tau\", \"scarlett\", \"ngeluarin\", \"sunscreen\", \"exited\", \"bgt\", \"karena\", \"emg\", \"nunggu\", \"banget\", \"nya\", \"scarlett\", \"finally\", \"bisa\", \"nyobain\", \"juga\", \"aku\", \"langsung\", \"beli\", \"cocok\", \"bgt\", \"buat\", \"kulit\", \"aku\", \"yang\", \"kombinasi\", \"sebenernya\", \"ini\", \"bisa\", \"melembabkan\", \"jadi\", \"cocok\", \"buat\", \"dey\", \"skin\", \"tapi\", \"dipakai\", \"yang\", \"kombinasi\", \"juga\", \"mantul\", \"sih\", \"aaaaaaa\", \"suka\", \"bgt\"]', 'pas tau scarlett ngeluarin sunscreen exited bgt karena emg nunggu banget nya scarlett finally bisa nyobain juga aku langsung beli cocok bgt buat kulit aku yang kombinasi sebenernya ini bisa melembabkan jadi cocok buat dey skin tapi dipakai yang kombinasi juga mantul sih aaaaaaa suka bgt', '\"pas tau scarlett ngeluarin sunscreen exited bgt emg nunggu banget nya scarlett finally nyobain langsung beli cocok bgt kulit kombinasi sebenernya melembabkan cocok dey skin dipakai kombinasi mantul sih aaaaaaa suka bgt\"', 'pas tau scarlett ngeluarin sunscreen exited bgt emg nunggu banget nya scarlett finally nyobain langsung beli cocok bgt kulit kombinasi sebenernya melembabkan cocok dey skin pakai kombinasi mantul sih aaaaaaa suka bgt', 'Positif', '2024-11-29 07:00:09', '2024-11-29 07:00:09', NULL);
