(1139, 'ellak_viw', 'Dari dua tahun yang lalu sampe sekarang suka banget sama produk yang ada niacinamide nya. Bahkan udah nyoba banyak merek lain tapi akhirnya balik lagi ke somethinc. Kaya emang dia yang paling di sukain muka gitu. Kalau di aku dia ngasih efek ngontrol minyak dan bikin tone muka lebih cerah. kalo untuk bekas jerawat lumayan memudarkan tapi gak instan ya, dia baru kelihatan kinerjanya setelah beberapa bulan. tapi justru itu yang bikin yakin kalo ingredients produknya itu aman', 'dari dua tahun yang lalu sampe sekarang suka banget sama produk yang ada niacinamide nya. bahkan udah nyoba banyak merek lain tapi akhirnya balik lagi ke somethinc. kaya emang dia yang paling di sukain muka gitu. kalau di aku dia ngasih efek ngontrol minyak dan bikin tone muka lebih cerah. kalo untuk bekas jerawat lumayan memudarkan tapi gak instan ya, dia baru kelihatan kinerjanya setelah beberapa bulan. tapi justru itu yang bikin yakin kalo ingredients produknya itu aman', 'dari dua tahun yang lalu sampe sekarang suka banget sama produk yang ada niacinamide nya bahkan udah nyoba banyak merek lain tapi akhirnya balik lagi ke somethinc kaya emang dia yang paling di sukain muka gitu kalau di aku dia ngasih efek ngontrol minyak dan bikin tone muka lebih cerah kalo untuk bekas jerawat lumayan memudarkan tapi gak instan ya dia baru kelihatan kinerjanya setelah beberapa bulan tapi justru itu yang bikin yakin kalo ingredients produknya itu aman', '[\"dari\", \"dua\", \"tahun\", \"yang\", \"lalu\", \"sampe\", \"sekarang\", \"suka\", \"banget\", \"sama\", \"produk\", \"yang\", \"ada\", \"niacinamide\", \"nya\", \"bahkan\", \"udah\", \"nyoba\", \"banyak\", \"merek\", \"lain\", \"tapi\", \"akhirnya\", \"balik\", \"lagi\", \"somethinc\", \"kaya\", \"emang\", \"dia\", \"yang\", \"paling\", \"sukain\", \"muka\", \"gitu\", \"kalau\", \"aku\", \"dia\", \"ngasih\", \"efek\", \"ngontrol\", \"minyak\", \"dan\", \"bikin\", \"tone\", \"muka\", \"lebih\", \"cerah\", \"kalo\", \"untuk\", \"bekas