ream ringan watery pas pakai muka tuh bikin muka kaya basah gitu lamalama set muka dry hydrating sih pakai sih kaya efek apaapa enak aja dipakenya', 'Positif', '2024-11-29 07:00:37', '2024-11-29 07:00:37', NULL);
