(1141, 'dindaazzarah', 'Serum niacinamide pertamaku dan langsung jatuh cinta , kemasannya botol kaca pake pipet , teksturnya cair agak kental warnanya bening gaada bau sama sekali , buatku produk ini efektif buat mencerahkan kulit tapi harus sabar karena efeknya ga instan , di awal pemakaian terasa perih2 sedikit dan dibeberapa bagian wajahku kaya di pipi dan di hidung merah2 sedikit , selama seminggu aku pake product ini mukaku ada jerawat 3 , tapi setelah aku lanjutin pake mukaku jadi lebih baik lagi?? jadi halus , lembab , lebih cerah , dan pas bangun tidur mukaku jadi keliatan sehaatt banget!! Bahkan aku yg biasanya jerawatan pas mau mens jadi ga jerawatan , kalo ada jerawat pun cuma satu kecil dan cepet sembuh kalo dipakein serum ini!! Harganya juga terjangkau cuma 89 ribu bisa buat 1 bulanan buat aku? bagus dimuka bagus juga di kantong???', 'serum niacinamide pertamaku dan langsung jatuh cinta , kemasannya botol kaca pake pipet , teksturnya cair agak kental warnanya bening gaada bau sama sekali , buatku produk ini efektif buat mencerahkan kulit tapi harus sabar karena efeknya ga instan , di awal pemakaian terasa perih2 sedikit dan dibeberapa bagian wajahku kaya di pipi dan di hidung merah2 sedikit , selama seminggu aku pake product ini mukaku ada jerawat 3 , tapi setelah aku lanjutin pake mukaku jadi lebih baik lagi?? jadi halus , lembab , lebih cerah , dan pas bangun tidur mukaku jadi keliatan sehaatt banget!! bahkan aku yg biasanya jerawatan pas mau mens jadi ga jerawatan , kalo ada jerawat pun cuma satu kecil dan cepet sembuh kalo dipakein serum ini!! harganya juga terjangkau cuma 89 ribu bisa buat 1 bulanan buat aku? bagus dimuka bagus juga di kantong???', 'serum niacinamide pertamaku dan langsung jatuh cinta kemasannya botol kaca pake pipet teksturnya cair agak kental warnanya bening gaada bau sama sekali buatku produk ini efektif buat mencerahkan kulit tapi harus sabar karena efeknya ga instan di awal pemakaian terasa perih sedikit dan dibeberapa bagian wajahku kaya di pipi dan di hidung merah sedikit selama seminggu aku pake product ini mukaku ada jerawat tapi setelah aku lanjutin pake mukaku jadi lebih baik lagi jadi halus lembab lebih cerah dan pas bangun tidur mukaku jadi keliatan sehaatt banget bahkan aku yg biasanya jerawatan pas mau mens jadi ga jerawatan kalo ada jerawat pun cuma satu kecil dan cepet sembuh kalo dipakein serum ini harganya juga terjangkau cuma ribu bisa buat bulanan buat aku bagus dimuka bagus juga di kantong', '[\"serum\", \"niacinamide\", \"pertamaku\", \"dan\", \"langsung\", \"jatuh\", \"cinta\", \"kemasannya\", \"botol\", \"kaca\", \"pakai\", \"pipet\", \"teksturnya\", \"cair\", \"agak\", \"kental\", \"warnanya\", \"bening\", \"tidak ada\", \"bau\", \"sama\", \"sekali\", \"buatku\", \"produk\", \"ini\", \"efektif\", \"buat\", \"mencerahkan\", \"kulit\", \"tapi\", \"harus\", \"sabar\", \"karena\", \"efeknya\", \"instan\", \"awal\", \"pemakaian\", \"terasa\", \"perih\", \"sedikit\", \"dan\", \"dibeberapa\", \"bagian\", \"wajahku\", \"kaya\", \"pipi\", \"dan\", \"hidung\", \"merah\", \"sedikit\", \"selama\", \"seminggu\", \"aku\", \"pakai\", \"product\", \"ini\", \"mukaku\", \"ada\", \"jerawat\", \"tapi\", \"setelah\", \"aku\", \"lanjutin\", \"pakai\", \"mukaku\", \"jadi\", \"lebih\", \"baik\", \"lagi\", \"jadi\", \"halus\", \"lembab\", \"lebih\", \"cerah\", \"dan\", \"pas\", \"bangun\", \"tidur\", \"mukaku\", \"jadi\", \"keliatan\", \"sehaatt\", \"banget\", \"bahkan\", \"aku\", \"biasanya\", \"jerawatan\", \"pas\", \"mau\", \"mens\", \"jadi\", \"jerawatan\", \"kalo\", \"ada\", \"jerawat\", \"pun\", \"cuma\", \"satu\", \"kecil\", \"dan\", \"cepet\", \"sembuh\", \"kalo\", \"dipakein\", \"serum\", \"ini\", \"harganya\", \"juga\", \"terjangkau\", \"cuma\", \"ribu\", \"bisa\", \"buat\", \"bulanan\", \"buat\", \"aku\", \"bagus\", \"dimuka\", \"bagus\", \"juga\", \"kantong\"]', 'serum niacinamide pertamaku dan langsung jatuh cinta kemasannya botol kaca pakai pipet teksturnya cair agak kental war